(391, NULL, NULL, 'Run Silent, Run Deep', '1985', 34, 'M', '<p>Published in the September 1985 issue of Acorn User. <br />Published on the Acorn User games compendium tape in October 1986. <br />The compendium comprises: <a href="http://bbcmicro.co.uk/game.php?id=463">Spectramania</a>, <a href="http://bbcmicro.co.uk/game.php?id=1077">Quadline</a>, <a href="http://bbcmicro.co.uk/game.php?id=1274">Picture Slide</a>, <a href="http://bbcmicro.co.uk/game.php?id=1486">Maze</a>, <a href="http://bbcmicro.co.uk/game.php?id=1693">Acorn User Office Adventure</a>, <a href="http://bbcmicro.co.uk/game.php?id=753">Shuggy''s Garden</a>, <a href="http://bbcmicro.co.uk/game.php?id=391">Run Silent Run Deep</a>, and <a href="http://bbcmicro.co.uk/game.php?id=1136">Adventure</a>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-11-26 11:51:44', '0000-00-00 00:00:00', 0, '2018-01-05 13:29:36', 2, 'N', 'Y', '0'),
