(509, 25, NULL, 'Chukee  The Upgrade For Chuckie Egg (AKA Chuckie Egg 3) [hack]', '1984', 4, 'L', '<p>Extra levels and extra features for the classic <a href="game.php?id=25">Chuckie Egg</a>.</p>\r\n<p>According to the cassette front cover inlay, this upgrade was approved by A&amp;F Software.</p>', 1, 1, NULL, NULL, NULL, NULL, 'Unofficial release', '', '', 3, '2019-06-04 08:42:45', '0000-00-00 00:00:00', 0, '2019-01-25 14:32:41', 3, 'N', 'Y', '0'),
(510, NULL, NULL, 'Crazy Balloon', '1983', 1, 'W', '<p>For many years, this game was thought to be an unreleased game from Acornsoft.</p>\r\n<p>This was debunked at the <a href="https://stardot.org.uk/forums/viewtopic.php?f=51&amp;t=13843&amp;p=181831&amp;hilit=balloon#p181831">Stardot Forums.</a></p>\r\n<p>The Acornsoft connection appears to be a hoax, but does anyone know *who* wrote it??</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-04 09:00:38', '0000-00-00 00:00:00', 0, '2019-01-25 09:43:44', 2, 'N', 'Y', '0'),
