(512, NULL, NULL, 'Imogen', '1986', 19, 'R', '<p><a href="https://en.wikipedia.org/wiki/Imogen_(video_game)">Imogen</a> is an animated adventure game. There are sixteen levels or &ldquo;sections&rdquo;, and each section contains a number of puzzles on a different theme. You can&rsquo;t get killed, but there is a limit on the number of times you can change character.</p>\r\n<p><strong>Z</strong>: left.&nbsp;<strong>X</strong>: right.&nbsp;<strong>Return:</strong> action/jump/climb.</p>\r\n<p>The <strong>left</strong> and <strong>right arrow</strong> keys move the pointer.&nbsp;The <strong>spacebar</strong> selects an icon.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2020-01-28 13:54:50', '0000-00-00 00:00:00', 0, '2020-01-28 13:44:30', 3, 'N', 'Y', '0'),
