(653, NULL, NULL, 'Froglet', '1983', 4, 'R', '<p>The listing for this game was published in the April 1983 issue of Computing Today magazine, and then updated in the June 1983 issue.</p>\r\n<p>The game was advertised for sale commercially by ASP software from the June 1983 issue of Computing today.</p>', 1, 1, NULL, NULL, NULL, NULL, 'V2C', NULL, NULL, 2, '2019-05-08 13:35:41', '0000-00-00 00:00:00', 0, '2017-05-08 21:56:59', 0, 'N', 'Y', '0'),
