(655, NULL, NULL, 'Jam Butty', '1985', 4, 'R', '<p>First advertised in Electron User magazine volume 2, issue 8 in May 1985. <br />Sold on the "Ten of the best" compilation, which consisted of games previously listed in Electron User magazine. <br />Jam Butty was the only game on this compilation which was not previously listed in the magazine. <br />Therefore you had to purchase the cassette if you wanted this game. <br />Later released by Alternative on the Triple Decker 03 compilation.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, 'Triple Decker', '03', 2, '2018-11-26 22:49:28', '0000-00-00 00:00:00', 0, '2017-05-08 21:57:02', 0, 'N', 'Y', '0'),
(656, NULL, NULL, 'Lawn Tennis', '1984', 478, 'M', '<p>Published on the "Model B Computing" cassette number 6 in August/September 1984.</p>\r\n<p>This game may not be playable without a joystick. Jsbeeb does not currently emulate a joystick so it might not be possible to play this game on the website. Try using an emulator or a real BBC.</p>', 2, 2, 'R', NULL, NULL, NULL, NULL, 'Model B Computing Cassette', '06', 1, '2018-01-06 21:47:25', '0000-00-00 00:00:00', 0, '2018-01-06 21:46:59', 1, 'N', 'Y', '0'),
(657, NULL, NULL, 'Missile Command', '1984', 454, 'M', '<p>Published in the June 1984 issue of Computer &amp; Video Games magazine, issue 32.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-02-09 19:16:44', '0000-00-00 00:00:00', 0, '2017-05-08 21:57:04', 0, 'N', 'Y', '0'),
