(663, NULL, NULL, 'Saigon', '1988', 461, 'R', '<p>According to&nbsp;<a href="http://www.partis.org/portfolio/main.php">his site</a> Gary Partis was the author of this game, but was uncredited.</p>\r\n<p>It was credited to "Tequila", which was simply an alias to prevent knowledge of his involvement.</p>\r\n<p>It is not known why he did not want people to know he was involved.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-16 08:37:41', '0000-00-00 00:00:00', 0, '2017-07-24 12:39:44', 0, 'N', 'Y', '0'),
