(753, NULL, NULL, 'Shuggy''s Garden', '1985', 1, 'M', 'Published in the December 1985 issue of Acorn User.\r\n<br>Published on the Acorn User games compendium tape in October 1986.\r\n<br>The compendium comprises: <a href="http://bbcmicro.co.uk/game.php?id=463">Spectramania</a>, <a href="http://bbcmicro.co.uk/game.php?id=1077">Quadline</a>, <a href="http://bbcmicro.co.uk/game.php?id=1274">Picture Slide</a>, <a href="http://bbcmicro.co.uk/game.php?id=1486">Maze</a>, <a href="http://bbcmicro.co.uk/game.php?id=1693">Acorn User Office Adventure</a>, <a href="http://bbcmicro.co.uk/game.php?id=753">Shuggy''s Garden</a>, <a href="http://bbcmicro.co.uk/game.php?id=391">Run Silent Run Deep</a>, and <a href="http://bbcmicro.co.uk/game.php?id=1136">Adventure</a>.\r\n', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2017-12-31 11:10:46', '0000-00-00 00:00:00', 0, '2017-12-29 20:03:59', 2, 'N', 'Y', '0'),
