(759, NULL, NULL, 'Brick ''Em In (AKA Wall ''Em In)', '1982', 1, 'R', '<p>Matthew Day (the author of this game and <a href="index.php?search=Matthew+Day&amp;on_A=on">its variants</a>) contacted us to say, "[The] original working title [was] ''Purple People eaters'' ...&nbsp;Inspiration: A type-in from a magazine for the Apple II ...&nbsp;A complete ground up re-implementation, using a (actually too clever) recursive procedure to determine if the direction was blocked ...&nbsp;For the Electron re-release (this might be <a href="game.php?id=2840">Wall em in</a>), this cool but inefficient routine caused speed problems, so I had to replace that pie[ce] of logic with something more efficient, and probably closer to how the original type-in did things ...&nbsp;One other thing, I''m pretty sure I left a somewhat unfortunate bug, reversing the score multiplier with difficulty so the score actually ended up lower at harder settings."</p>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-06-15 13:56:23', '0000-00-00 00:00:00', 0, '2018-08-26 10:06:55', 2, 'N', 'Y', '0'),
(760, 25, NULL, 'Chuckie Egg 4 (AKA Chukee Egg 4) [hack]', '1984', 4, 'L', '<p>Extra levels for the classic <a href="game.php?id=25">Chuckie Egg</a>.&nbsp;</p>\r\n<p>According to the <a href="http://web.archive.org/web/20060211065752/http://www.bagshot-row.org:80/chuckie-egg/hacksandupgrades.html">Hacks and Upgrades</a> section of the now-defunct website <a href="http://web.archive.org/web/20050918052628/http://www.bagshot-row.org/chuckie-egg/">The Chuckie Egg Professional''s Resource Kit</a>, "This is a straight-forward, anonymous modification of the original BBC 32K Chuckie Egg release with some modified levels based originally on the eight levels supplied with <a href="game.php?id=509">CHUKEE</a> from BIT TWIDDLERS".</p>', 1, 4, NULL, NULL, NULL, NULL, 'Unofficial release', '', '', 3, '2018-11-12 11:36:32', '0000-00-00 00:00:00', 0, '2019-01-26 12:05:26', 2, 'N', 'Y', '0'),
