(836, NULL, NULL, 'HunchBack', '1984', 4, 'M', '<p>Published in Issue 10 of Personal Computer Games, September 1984.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>Later published on the Electron User Group PD Disc 38 in June 1998.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Hunchback is to be found in most arcades and it is one of the more unusual games. You control Quazimodo, champion bell ringer of all France, as he scurries across the roof of the abbey to rescue his true love, Esmerelda.</p>\r\n<p>To complete each screen, pull on the bell rope and exit the screen to the right. Here is a table of what happens on each level of the game.</p>\r\n<ol>\r\n<li>Arrows and rocks fly across the screen and spears are thrown upwards.</li>\r\n<li>Same as level one plus a block appears in the middle of the screen over Quazimodo''s head.</li>\r\n<li>Same as level two except that another block appears on the screen and boiling oil falls instead of spears being thrown.</li>\r\n<li>Same as level three except that another block appears on the right and both oil and spears have to be avoided.</li>\r\n<li>Similar to level four except that the two left-most blocks now become wider.</li>\r\n<li>The same as level five except that there is a rope that also must pulled to finish this screen and release Esmerelda.</li>\r\n</ol>\r\n<p>When you complete all this, Esmerelda begs poor Quazimodo to rescue her sister from a similar predicament So, being a love-struck fool, Quazi goes through it all again. This time, however, the time bonus (bottom right of the screen) decreases faster. If it reaches zero then Quazi bites the dust!</p>\r\n<p>Though this version of Hunchback may not offer all the varied levels of the arcade original, it still offers a satisfactory challenge for even the most skilled players.</p>\r\n<p>This program is also an excellent demonstration of just how BBC BASIC can be. On most other computers this game in would be unbearably slow!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2018-12-09 21:37:44', '0000-00-00 00:00:00', 0, '2017-05-08 22:00:21', 0, 'N', 'Y', '0'),
