(857, NULL, NULL, 'Missile Defender', '1984', 454, 'M', '<p>Published in the April 1984 issue of Personal Computer World magazine (PCW).</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>*** MESSAGE TO SECTOR A37 STOP ENEMY NUCLEAR MISSILES HEADING YOUR WAY STOP BEST OF LUCK STOP ***</p>\r\n<p>Just your luck to be in command when the enemy decides to take some pot shots at your sector! Missile Defender is a version of the classic arcade favourite Missile Command.</p>\r\n<p>The object of the game is to protect your cities from an onslaught of IBMs (Intercontinental Ballistic Missiles, dummy, not computers from America!) The arcade original gave you three different bases from which to launch you missiles but, due to defence budget cuts, you have just one!</p>\r\n<p>You score 25 points for each missile zapped. Every 1000 points you score gives you a new sector of four cities to protect. Each incoming missile is capable of wiping out a city and when all the cities are destroyed, the game is over. Your controls are:</p>\r\n<p style="padding-left: 30px;">Z = Left<br />X = Right<br />* = Up<br />? = Down</p>\r\n<p>Happy blasting!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2018-12-09 22:51:16', '0000-00-00 00:00:00', 0, '2017-05-08 22:00:44', 0, 'N', 'Y', 'Y'),
