(959, NULL, NULL, 'Flappa Catcha', '1984', 10, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>You are Sam. Together with your girlfriend, Ethel, you have been trying to steal the ill-qotten gold of an evil old witch, mad Mabel. You''ve both been nabbed by Mabel and Ethel is held in a cage ready for supper - Mabel''s!</p>\r\n<p>To provide sport to help her appetite, Mabel has trapped you between two walls and is launching exploding demon-birds at you. You do, however, have a hat with magical properties which will neutralize the birds if you can catch them in it before they land.</p>\r\n<p>For every six birds caught Mabel will give you a bag of gold. You need three bags to win the game and save Ethel.</p>\r\n<p>Every time you miss a bird, Mabel''s pet zombie will gradually tunnel under a wall and eventually get you! If you are hit by a bird you will be instantly vaporized. You have only three lives! Be careful, because if Mabel thinks you''re doing too well you''ll have to dodge a few lightning bolts as well!</p>\r\n<p>Your controls for moving about to catch the birds are:</p>\r\n<p style="padding-left: 30px;">Z = Left<br />X = Riqht</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:20:39', '0000-00-00 00:00:00', 0, '2017-05-08 22:02:41', 0, 'N', 'Y', '0'),
