(986, NULL, NULL, 'Omniopoly', '1984', 509, 'M', '<p>Published in the January and March 1984 issues of Personal Computer World magazine (PCW).</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>Later published on the Electron User Group PD Disc 54 in October 2000.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Omniopoly bears more than a passing resemblance to a well-known board game... become a property millionaire! The computer plays the Bank and displays a very realistic board, while two human opponents compete against each other. The only change to the standard rules is the Auction Rule. In the board game a property is auctioned if not purchased by the first player to land on it, but this does not apply with the computer version. All other features of the board game are supported, and presentation of this excellent game rivals that of commercial versions. See you in Mayfair!</p>\r\n</blockquote>', 2, 2, NULL, NULL, NULL, NULL, 'V1.40', NULL, NULL, 1, '2018-12-09 22:04:00', '0000-00-00 00:00:00', 0, '2017-05-08 22:03:11', 0, 'N', 'Y', '0'),
