(999, NULL, NULL, 'Martian Attack', '1984', 454, 'B', '<p>Originally authored by Nikola Stojanovic and converted to the BBC Micro by Adam Ruddle and James Byrne.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Martian Attack is an arcade style game for a 32K BBC Micro, once again the earth is under attack from strange Martian creatures!</p>\r\n<p>Your task is to defeat the irksome invaders and save the earth. To aid your mission you have a helicopter and a plane under control. The plane is used to shoot down the alien spacecraft while the helicopter attempts to reach the landing pad at the top of the screen. When you reach the platform you pass on to the next level of the game.</p>\r\n<p>As the helicopter nears the platform the aliens change from modules into heads, and the number of points scored for zapping them increases. At each successive level, the number of aliens increases, making it more and more difficult to complete the level.</p>\r\n<p>A point to note when typing in this program is that a lot of the variables are in lower case letters and should be typed in as such. Be careful not to confuse them with capitals or the program may not work properly.</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:22:54', '0000-00-00 00:00:00', 0, '2017-05-08 22:03:27', 0, 'N', 'Y', '0'),
