(1012, NULL, NULL, 'City Smasher', '1984', 2, 'M', '<p>Published in Issue 7 of Personal Computer Games, June 1984.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>This is a shoot and bomb game where you are flying an aircraft over an enemy city. The plan is to hit the skyscrapers with your bombs, but these are tall tower blocks so you are also in danger of bashing into them as your plane slowly loses height during the game.</p>\r\n<p>You can move the plane down to get closer for better bombing aim and you have a laser gun mounted at the front of the plane for forward firing, in case you get too low and have to blast the top off a building to avoid it. Unfortunately this will only fire four times before it runs out of laser power. Your controls<br />are:</p>\r\n<p style="padding-left: 30px;">SPACE = Drop bombs<br />Z = Move down<br />A = Fire laser</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2018-12-09 22:34:23', '0000-00-00 00:00:00', 0, '2017-05-08 22:03:42', 0, 'N', 'Y', '0'),
