(1053, NULL, NULL, 'Four In A Line', '1984', 34, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>This is a game for two players where the aim is to drop counters into a grid. The winner is the first one to get... you guessed it, four in a row.</p>\r\n<p>So, this is a game of strategy and forethought, where you have to attempt to block your opponent''s moves as well as plan ahead for your own.</p>\r\n<p>In order to drop a counter you simply type the number of the column in which you wish it to go.</p>\r\n<p>Although very simple, the graphics are extremely effective and give an impression of smooth movement as the counters fall into the grid.</p>\r\n</blockquote>', 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:20:59', '0000-00-00 00:00:00', 0, '2017-05-08 22:04:27', 0, 'N', 'Y', '0'),
