(1063, NULL, NULL, 'Baby Monty (Monty Mole''s Little Brother)', '1984', 4, 'B', '<p>Originally authored by Anthony Crowther for the Commodore 64, and adapted for the BBC Micro by James Byrne.</p>\r\n<p>The original Commodore 64 listing was published in Personal Computer Games magazine, issue 9 in August 1984.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Monty the mole''s baby brother is trapped in a series of deep, dark underground caverns which are slowly filling with water. Luckily he has found an old boat and is rowing like mad - he has to, to avoid the barrels which are mysteriously tumbling down on top of him.</p>\r\n<p>The walls are also a source of danger, as they will sink the boat if it bumps into them. He will also be crushed to death if trapped try the rising tide against the ceiling of the caves. However, you can help the miserable mole by steering the boat safely through the maze of caves. Strangely enough you can also use the flood to float the boat to the surface at the top of the screen faster. Your controls for this subterranean mission are:</p>\r\n<p style="padding-left: 30px;">Z = Left<br />X = Right<br />SHIFT = Raise water level</p>\r\n<p>Can you save the mole from a watery grave and get him back to his mummy?</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:19:46', '0000-00-00 00:00:00', 0, '2017-05-08 22:04:38', 0, 'N', 'Y', '0'),
