(1077, NULL, NULL, 'Quadline (AKA Quad Line)', '1985', 39, 'M', '<p>Published in the January 1985 issue of Acorn User. <br />Published on the Acorn User games compendium tape in October 1986. <br />The compendium comprises <a href="http://bbcmicro.co.uk/game.php?id=463">Spectramania</a>, <a href="http://bbcmicro.co.uk/game.php?id=1077">Quadline</a>, <a href="http://bbcmicro.co.uk/game.php?id=1274">Picture Slide</a>, <a href="http://bbcmicro.co.uk/game.php?id=1486">Maze</a>, <a href="http://bbcmicro.co.uk/game.php?id=1693">Acorn User Office Adventure</a>, <a href="http://bbcmicro.co.uk/game.php?id=753">Shuggy''s Garden</a>, <a href="http://bbcmicro.co.uk/game.php?id=391">Run Silent Run Deep</a>, and <a href="http://bbcmicro.co.uk/game.php?id=1136">Adventure</a>.</p>\r\n<p>Published on the Acorn User subscriber''s disc in August 1991. This version had an updated menu system and this is the version available to play and download.</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-29 16:50:54', '0000-00-00 00:00:00', 0, '2018-08-31 09:49:47', 2, 'N', 'Y', '0'),
