(1111, NULL, NULL, 'Poker Dice', '1984', 34, 'R', '<p>Darts, Pentominoes, and Poker Dice were sold together on the "Ken 1" compilation.</p>', 2, 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-07-10 00:08:57', '0000-00-00 00:00:00', 0, '2017-05-08 22:05:33', 0, 'N', 'Y', '0'),
(1112, NULL, NULL, 'Race Chase', '1983', 457, 'B', '<p>Originally authored by D. Denholm for the Sharp MZ-80K computer, and published in Personal Computer World in March 1982. The program was converted for the BBC Micro by Paul Borrett.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>Later published on the Electron User Group PD Disc 51 in June 2000.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<blockquote>\r\n<p>This challenging game is based on a car race. You pilot a car round a five-lane track, trying to hit as many dots as possible. However, to hinder you a mad driver is travelling in the opposite direction trying to crash his car into yours!</p>\r\n<p>Try and cover as many dots as you can before he hits you. Controls are by two keys: Z to move in a lane, and M to move out a lane, and you are in the car travelling anti-clockwise.</p>\r\n<p>If you manage to eradicate all the dots successfully a new track will appear.</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-10 17:12:24', '0000-00-00 00:00:00', 0, '2017-05-08 22:05:34', 0, 'N', 'Y', '0'),
