(1117, NULL, NULL, 'Balloon Fun (AKA Balloon)', '1983', 1, 'M', '<p>Published in the June 1983 issue of Personal Computer World magazine.</p>\r\n<p>Originally authored by A. Roe, assisted by K. Roberts and M. Stevinson - Balloon Addict.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>Later published on the Electron User Group PD Disc 47 in January 2000.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<blockquote>\r\n<p>In this exciting game you must steer a balloon through a rocky ravine to safety. You control your balloon with the keys shown in the introduction sequence and you must avoid having the rocks burst your balloon. Easy, except that your balloon sways from side to side in the wind and can easily swing back at just the wrong moment. It takes a lot of patience and skill to win at this game! Bon voyage, and I hope it doesn''t take you eighty days to get through this one.</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-10-31 00:19:09', '0000-00-00 00:00:00', 0, '2020-01-24 17:37:44', 2, 'N', 'Y', '0'),
