(1136, NULL, NULL, 'Adventure', '1986', 13, 'M', '<p>This game appears to be loosely based on <a href="https://en.wikipedia.org/wiki/Adventure_(Atari_2600)">Adventure</a> for the Atari 2600 by Warren Robinett. Released on the Acorn User games compendium tape in October 1986, this is the only game on the cassette that was not previously published as an Acorn User type-in.</p>\r\n<p>The compendium comprises <a href="game.php?id=463">Spectramania</a>, <a href="game.php?id=1077">Quadline</a>, <a href="game.php?id=1274">Picture Slide</a>, <a href="game.php?id=1486">Maze</a>, <a href="game.php?id=1693">Acorn User Office Adventure</a>, <a href="game.php?id=753">Shuggy''s Garden</a>, <a href="game.php?id=391">Run Silent Run Deep</a>, and <a href="game.php?id=1136">Adventure</a>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-08-13 13:28:27', '0000-00-00 00:00:00', 0, '2017-05-08 22:06:00', 0, 'N', 'Y', '0'),
