(1145, NULL, NULL, 'Pursuit Ship', '1984', 453, 'M', '<p>Published in the April 1984 issue of Personal Computer World magazine (PCW).</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Pursuit Ship is a traditional arcade style space game where you have to locate the enemy ship and blast it into cosmic dust! To aid you in your task you have a long range radar scan which shows the location of the enemy ship relative to yaw sights. All you have to do is to guide it into your sights and fire.</p>\r\n<p>A point to note when typing in this listing is that memory is very limited and so all non-essential spaces should be removed, as they are here.</p>\r\n</blockquote>', 1, 1, 'O', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2018-12-09 21:25:27', '0000-00-00 00:00:00', 0, '2018-09-08 16:28:27', 2, 'N', 'Y', 'Y'),
(1146, NULL, NULL, 'Snacker', '1992', 1, 'P', '<p>Published on BBC PD Disc 120.</p>\r\n<p>Published on the 8BS Public Domain disc JJF-37.</p>\r\n<p>Also given away on the subscribers BBC Disc in Micro User Magazine vol.10 issue 6 in August 1992. (Credited to JJF PD).</p>', 1, 1, 'O', NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-16 09:01:55', '0000-00-00 00:00:00', 0, '2018-09-08 16:28:43', 2, 'N', 'Y', '0'),
