(1158, NULL, NULL, 'City Bomber', '1991', 2, 'P', '<p>Published on the 8BS Public Domain disc 09 in February 1991. <br />Also published on the Micro User Magazine subscribers disc vol.10 issue 1 in March 1992. (Credited to JJF PD).</p>\r\n<p>Published on the BBC PD Disc 15.</p>\r\n<p>Later published on the Electron User Group PD Disc 45 in September 1999.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-10 18:44:19', '0000-00-00 00:00:00', 0, '2017-05-08 22:06:24', 0, 'N', 'Y', '0'),
