(1161, NULL, NULL, 'Fighter Pilot', '1983', 460, 'B', '<p>Originally authored by E.G. Kemplen for the Apple computer, and published in Personal Computer World in July 1982. The program was converted for the BBC Micro by Haracham Wassi.</p>\r\n<p>Published in Issue 4 of Personal Computer Games, March 1984.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<blockquote>\r\n<p>You are seated in the cockpit of your Spitfire, hot on the tail of an enemy aircraft. He, not unnaturally, is doing his level best to get out of your gun sights. The object of the game is to score 50 points by hitting the target as often as you can, before your fuel runs out.</p>\r\n<p>You can control your aircraft so as to climb, dive, swoop to the left or right, the screen display always shows the position of the enemy in your line of fire. Displays of your current score, number of shots, and fuel level are also provided. A good eye, and considerable dexterity are needed to play this game well; eleven fingers are also an advantage!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-10 17:10:28', '0000-00-00 00:00:00', 0, '2017-05-08 22:06:27', 0, 'N', 'Y', '0'),
