(1239, NULL, NULL, 'Power Raider', '1992', 3, 'P', '<p>Published on the 8BS Public Domain disc 20 in August 1992. <br />Also given away on the Micro User Subscribers Disc Vol.10 issue 7 in September 1992. (Credited to 8BS PD). This was the last issue of Micro User before the name changed to "Acorn Computing". <br />Given away AGAIN on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.12 issue 12 in January 1995.</p>\r\n<p>Published on BBC PD disc 166 which featured "Mad Rabbit" PD.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-16 09:03:35', '0000-00-00 00:00:00', 0, '2019-12-16 14:51:17', 2, 'N', 'Y', '0'),
