(1241, NULL, NULL, 'Search & Rescue (AKA Search And Rescue)', '1983', 11, 'B', '<p>Originally authored by Geoffrey Little and Michael Orton for the Commodore PET, and published in Personal Computer World in December 1982. The program was converted for the BBC Micro by Paul Borrett.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>Later published on the Electron User Group PD Disc 54 in October 2000.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<blockquote>\r\n<p>This is an exciting game, with good graphics and sound, requiring some skill in successfully piloting a search and rescue helicopter on its rescue mission.</p>\r\n<p>By using four different keys: up = '':'', down = ''/'', left = ''Z'', and right = ''X'', you move the helicopter into a position to pick up men from a ship in distress and deliver them safely to land. However, you only have a limited amount of fuel on board, so don''t stray away from the land for too long and beware of crashing into the sea!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-10 17:15:31', '0000-00-00 00:00:00', 0, '2018-09-10 10:55:57', 2, 'N', 'Y', 'Y'),
(1242, NULL, NULL, 'Spider Chase (AKA Spider Man)', '1985', 4, 'M', '<p>Published in Beebug Magazine volume 3 issue 9 in March 1985.</p>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, 'VB0.2', NULL, NULL, 2, '2019-10-29 22:45:15', '0000-00-00 00:00:00', 0, '2017-05-08 22:07:57', 0, 'N', 'Y', '0'),
