(1248, NULL, NULL, 'Galaxian', '1984', 454, 'M', '<p>Published in Issue 3 of Personal Computer Games, February 1984.</p>\r\n<p>The magazine listing states the games was "converted to 32K BBC Micro by C.R. Tanner".</p>\r\n<p>This issue of Personal Computer Games also had a free flexi-disc on the cover which contained the type-ins from the magazine.</p>\r\n<p>The question of which was easier, typing in the listing, or getting the computer to recognise the flexi-disc is a different matter!</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-21 11:39:30', '0000-00-00 00:00:00', 0, '2017-05-08 22:08:03', 0, 'N', 'Y', '0'),
(1249, NULL, NULL, 'Holed Out!!', '1989', 465, 'R', '<p>If you are playing this game on a real BBC micro, it requires 2 banks of "Sideways RAM" which load into banks 4 and 5.</p>', 1, 4, NULL, NULL, '2 x Banks SWR Required', NULL, NULL, 'Holed Out', '1', 2, '2018-06-22 13:15:19', '0000-00-00 00:00:00', 0, '2018-06-22 10:05:51', 2, 'N', 'Y', '0'),
(1250, NULL, NULL, 'Hunger Alley', '1984', 1, 'B', '<p>Originally authored by Anwar Sidat, Sadiq Norat, and Soyab Norat. Converted to the BBC Micro by Adam Ruddle.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>No book of games would be complete without an appearance of the king of the arcade - PAC-MAN. In this version, you have to move around a maze gobbling up food pills and avoid poisoned skulls - unless you have just eaten a power pill. After eating one of these, you flash, change colour and are allowed a time of 500 units to devour the nasty skulls. You score 10 points for each pill eaten, 30 for each power pill and 50 for each skull.</p>\r\n<p>The game has nine different coloured screens and you around by operating four different keys:</p>\r\n<p style="padding-left: 30px;">Z - Left<br />X = Right<br />* = Up<br />? = Down</p>\r\n<p>Remember, speed is the key word in this game, so gobble up those pills as fast as you can!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:22:23', '0000-00-00 00:00:00', 0, '2017-05-08 22:08:06', 0, 'N', 'Y', '0'),
