(1292, NULL, NULL, 'Push-The-Bale (AKA Push The Bale)', '1992', 17, 'P', '<p>Published on 8BS Public Domain disc 22 in October 1992.</p>\r\n<p>Also given away on the BBC Subscribers disc in Acorn Computing magazine (formerly The Micro User), volume 10, issue 11, in January 1993. (Credited to 8BS PD.)</p>\r\n<p>Please note that the original release had joystick support but it caused problems, so it was removed in the 1993 Acorn Computing giveaway release.</p>\r\n<p>Published on 8BS Public Domain disc 46 in December 1995.</p>', 1, 1, '', NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-11-27 13:36:00', '0000-00-00 00:00:00', 0, '2019-11-27 08:42:49', 2, 'N', 'Y', '0'),
