(1294, NULL, NULL, 'Robot Chase!', '1983', 1, 'M', '<p>Published in "Which Micro? &amp; Software Review" magazine, April 1983, issue 9.</p>\r\n<p>Interestingly,&nbsp; the program was not a type-in but came on a flexi-disc record along with other programs for the Sinclair ZX81, Sinclair Spectrum, Commodore VIC20, and Commodore PET computers.&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-04 10:00:54', '0000-00-00 00:00:00', 0, '2017-05-08 22:08:55', 0, 'N', 'Y', '0'),
(1295, NULL, NULL, 'Snakes And Ladders', '1984', 527, 'M', '<p>Published on the "Model B Computing" cassette number 3 in February/March 1984.</p>\r\n<p>Please note: This listing shows a copyright date of June 1983. An earlier version of this game by Peter Donn was published in Your Computer magazine vol.3 issue 6 in June 1983 and this listing shows a copyright date of August 1982.<br />A virtually identical game to the Model B Computing listing was later published on the 8BS Public Domain disc 31 in November 1993 which has the author as "James M. Cavanagh" in all of the REM statements. <br />The correct author is Peter Donn from 1982/1983.</p>', 2, 2, NULL, NULL, NULL, NULL, NULL, 'Model B Computing Cassette', '03', 2, '2019-03-15 14:25:22', '0000-00-00 00:00:00', 0, '2018-09-12 14:59:45', 2, 'N', 'Y', '0'),
