(1439, NULL, NULL, 'Splat The Rat! (AKA Rat-Splat)', '1982', 457, 'R', '<p>Sold by Beebugsoft as part of "Games 3". The games were <a href="http://bbcmicro.co.uk/game.php?id=1576">Mindbender</a>, <a href="http://bbcmicro.co.uk/game.php?id=1562">Shape Match</a>, and <a href="http://bbcmicro.co.uk/game.php?id=1439">Splat The Rat!</a></p>\r\n<p>First advertised in volume 1 issue 4, although it may have been advertised on a seperate leaflet slightly earlier.</p>\r\n<p>**There is evidence that later copies of "Games 3" just included Mindbender and Shape Match, but NOT Splat The Rat. (This is probably because the game needed alterations to work on the new OS 1.20).</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-09 11:27:03', '0000-00-00 00:00:00', 0, '2019-05-09 11:40:10', 2, 'N', 'Y', '0'),
