(1472, NULL, NULL, 'Splash!', '1984', 17, 'M', '<p>Published in the April 1984 issue of Personal Computer World magazine (PCW).</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>This a new and different board game for two players: the computer and you. The players take turns to ''drop'' their counters onto their chosen square in a 7 by 7 grid, but the ''splash'' of colour onto surrounding squares may give your opponent the advantage. The effects are predictable and the computer can keep track of what will happen, but can you?</p>\r\n<p>Full instructions are contained within the program. Lines 2000-2330 contain an assembly language routine and you should be especially careful to type these lines exactly as they are shown.</p>\r\n</blockquote>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, '', NULL, 1, '2018-12-09 21:14:28', '0000-00-00 00:00:00', 0, '2017-05-08 22:12:13', 0, 'N', 'Y', '0'),
(1473, NULL, NULL, 'Superman: Man Of Steel', '1989', 2, 'R', '<p>To run the game, you have to type&nbsp;<em>CHAIN "LOADER"</em></p>\r\n<p>There were thirty-one files on the original disc, which is the limit for the standard Acorn DFS disc filing system.&nbsp;Therefore there was no room for a <em>!BOOT</em> file. So, to run the game, you have to type <em>CHAIN "LOADER"</em></p>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, 'Tape Version', NULL, NULL, 3, '2018-09-17 15:56:13', '0000-00-00 00:00:00', 0, '2018-09-17 16:30:42', 3, 'N', 'Y', '0'),
