(1486, NULL, NULL, 'Maze (AKA 3D Maze)', '1986', 1, 'M', '<p>Published in the September 1986 issue of Acorn User. <br />Published on the Acorn User games compendium tape in October 1986. <br />The compendium comprises <a href="game.php?id=463">Spectramania</a>, <a href="game.php?id=1077">Quadline</a>, <a href="game.php?id=1274">Picture Slide</a>, <a href="game.php?id=1486">Maze</a>, <a href="game.php?id=1693">Acorn User Office Adventure</a>, <a href="game.php?id=753">Shuggy''s Garden</a>, <a href="game.php?id=391">Run Silent Run Deep</a>, and <a href="game.php?id=1136">Adventure</a>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2018-06-19 11:24:01', '0000-00-00 00:00:00', 0, '2018-09-15 19:19:19', 2, 'N', 'Y', '0'),
