(1488, NULL, NULL, 'Noughts And Crosses', '1982', 534, 'M', '<p>This game was published as a type-in listing in issue 2 of OWL magazine.&nbsp;OWL magazine was a supplementary pull-out in Computer &amp; Video Games magazine.</p>\r\n<p>As far as can be seen there were only two issues printed.&nbsp;Issue 1 of OWL came with the June 1982 (issue 8) of C&amp;VG while issue 2 of OWL came with the September 1982 issue of C&amp;VG (issue 11).</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-08-18 11:49:37', '0000-00-00 00:00:00', 0, '2019-08-16 17:30:09', 2, 'Y', 'Y', '0'),
