(1503, NULL, NULL, 'Dogfight (AKA Dog Fight) (AKA Super Combat)', '1984', 2, 'M', '<p>Published in the February 1984 issue of Personal Computer World magazine (PCW). The article called the game "Dogfight", but the REMS at the beginning of the listing called the game "Super Combat".</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine. The REMs now called the game "Dogfight".</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Dogfight is an excellent ''shoot ''em up'' type of game, but it is somewhat unusual because it involves two players playing against each other.</p>\r\n<p>The game is an air battle between two planes - a dogfight, in fact. The aim is to score 10 hits against your opponent before you run out of fuel. Each player has a choice of either a jet or a biplane; the jet is faster but has a larger turning circle and consumes more fuel.</p>\r\n<p>Having selected their planes the players must choose the amount ammunition they wish to take with them on their sortie; this should be a value between 10 and 99. You will also be asked if you wish to fly in a clear sky or one with clouds. Novice pilots may need the security of clouds because the opposing flyer cannot shoot down while you are hidden from view. The controls are:</p>\r\n<table style="border-collapse: collapse; width: 100%;" border="1">\r\n<tbody>\r\n<tr style="height: 18px;">\r\n<td style="width: 50%; height: 18px; text-align: center;">PLAYER 1 (blue)</td>\r\n<td style="width: 50%; height: 18px; text-align: center;">PLAYER 2 (black)</td>\r\n</tr>\r\n<tr style="height: 18px;">\r\n<td style="width: 50%; height: 18px; text-align: center;">W=Left</td>\r\n<td style="width: 50%; height: 18px; text-align: center;">O=Left</td>\r\n</tr>\r\n<tr style="height: 18px;">\r\n<td style="width: 50%; height: 18px; text-align: center;">E=Right</td>\r\n<td style="width: 50%; height: 18px; text-align: center;">P=Right</td>\r\n</tr>\r\n<tr style="height: 18px;">\r\n<td style="width: 50%; height: 18px; text-align: center;">A=Fire</td>\r\n<td style="width: 50%; height: 18px; text-align: center;">K=Fire</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</blockquote>', 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-07-08 16:29:10', '0000-00-00 00:00:00', 0, '2017-05-08 22:12:46', 0, 'N', 'Y', '0'),
