(1516, NULL, NULL, 'Black Holes', '1984', 17, 'M', '<p>Published on the "Model B Computing" cassette number 7 in October/November 1984.</p>\r\n<p>Published as part of the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=PCW+Games+Collection&amp;sort=b">PCW Games Collection</a></p>\r\n<p>Later published on the Electron User Group PD Disc 40 in October 1998.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Black Holes is not a high-speed action game, but a game of skill and strategy with a little bit of luck thrown in for good measure.</p>\r\n<p>Twenty-five aliens appear at the bottom of the screen, one at a time and in one of five colours. The colour of each is chosen at random and your task is to store these creatures in the black holes. Each black hole is identified by a letter, and you choose them by pressing the appropriate keys on the keyboard.</p>\r\n<p>The first four aliens that appear must be placed in the four corners of the grid. After that they may be placed anywhere on the screen, providing the following rules are obeyed:</p>\r\n<ol>\r\n<li>Each alien must be placed next to another one.</li>\r\n<li>Aliens of the same colour must not be placed next to each other.</li>\r\n<li>Aliens must be stored before they cross the screen, otherwise the game is lost.</li>\r\n</ol>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, 'Model B Computing Cassette', '07', 2, '2019-01-04 16:21:54', '0000-00-00 00:00:00', 0, '2017-05-08 22:12:59', 0, 'N', 'Y', '0'),
(1517, NULL, NULL, 'Cheese', '1983', 10, 'B', '<p>Originally authored by Paul Bradshaw for the Commodore PET, and published in Personal Computer World in February 1982. The program was converted for the BBC Micro by James Byrne.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The accompanying book contained the following description:</p>\r\n<blockquote>\r\n<p>This is a nice simple game in which you play the role of a sly cat. Your task is to prevent mice from eating a hunk of cheese. Instructions for moving, and for trapping mice, will appear on the screen when the program is run.</p>\r\n<p>You score points for eating the mice as quickly as possible when they appear. If you don''t kill them they will eventually run into the cheese and take a huge bite out of it. When all the cheese is gone the game is over. Happy mouse-hunting!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-10 17:07:40', '0000-00-00 00:00:00', 0, '2017-05-08 22:13:01', 0, 'N', 'Y', '0'),
(1518, NULL, NULL, 'Code Breaker', '1984', 17, 'M', '<p>Published in Electron User Magazine vol.1 issue 9 in June 1984. <br />Later released by Alternative Software on the Triple Decker 09 compilation.</p>\r\n<p>The game later appeared as part of <a href="game.php?id=2017">9 Classic Card And Board Games No. 1</a></p>', 1, 1, NULL, NULL, NULL, NULL, NULL, 'Triple Decker', '09', 2, '2019-07-09 08:52:46', '0000-00-00 00:00:00', 0, '2017-05-08 22:13:02', 0, 'N', 'Y', '0'),
