(1586, NULL, NULL, 'Alien Blaster (AKA Blaster)', '1983', 454, 'B', '<p>Originally authored for the Sinclair Spectrum by Alan Green, then converted for the BBC Micro by Daniel Lucas.</p>\r\n<p>The original Spectrum listing was published in issue 1 (Summer 1983) of Personal Computer Games magazine from VNU publishing.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>Later published on the Electron User Group PD Disc 40 in October 1998.</p>\r\n<p>The book accompanying the <em>Best of PCW Software for the BBC</em> compilation contained the following description:</p>\r\n<blockquote>\r\n<p>This is a simple but addictive game that uses sound and colour to good effect.</p>\r\n<p>Menacing Aliens are trying to colonise the earth and to save us all you must shoot them down before they land. Inexorably, the nearer they get the higher they score, and you have got to act very fast - only five have to land to take over the planet!</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2019-01-06 01:29:55', '0000-00-00 00:00:00', 0, '2017-05-08 22:14:16', 0, 'N', 'Y', '0'),
