(1607, NULL, NULL, 'Bomber Strike (AKA Air Raid)', '1983', 2, 'M', '<p><em>Published in Electron User magazine vol.1 issue 1 in October 1983. (This magazine was a pullout within Micro User vol.1 issue 8 in October 1983).</em></p>\r\n<p><em>A very similar game, using almost identical code, was published in Practical Computing magazine volume 8 issue 2, in February 1985. The article credited Andrew Graham as the author.</em></p>\r\n<p><em>Whether Andrew Graham is the author of Bomber Strike from 1983 is debatable!</em></p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-08-09 22:16:58', '0000-00-00 00:00:00', 0, '2019-11-09 10:27:50', 2, 'N', 'Y', '0'),
