(1648, NULL, 'The', 'Seventh Star', '1984', 13, 'R', '<p><em>In this text adventure game you will explore the mysterious city on the surface of the strange planet known as the Seventh Star. There you must try to survive on the planet long enough to find out how you can get back to earth. A lot of very strange characters inhabit the city. Some may help you but others will be hostile so you must be alert to possible danger, even in the most unlikely places.&nbsp;</em></p>\r\n<p><em>From the wreckage of your ship you salvage a bucket, a crowbar and Mu-Mu, your hand-held micro-microcomputer. Anything from a sandwich to an electric chair may be useful so don''t underestimate anything you find.</em></p>\r\n<p><a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=18281#p253984">More details</a> at Stardot.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 3, '2019-11-22 19:40:48', '0000-00-00 00:00:00', 0, '2017-05-22 22:31:50', 0, 'N', 'Y', '0'),
