(1787, NULL, NULL, 'Kingdom Of Craal (AKA Palace Of Craal)', '1985', 13, 'M', '<p>Published in Micro User Magazine vol.2 issue 12 in February 1985. <br />Published in Electron User magazine volume 2, issue 5 in February 1985. <br />Published on the "Adventure Anthology" compilation, which was first advertised in Electron User volume 5, issue 8 in May 1988. <br />The compilation consisted of 4 adventures previously published in the pages of Electron User, PLUS "Johnny" by Bill Trevelyan which was previously unpublished.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, '', NULL, 2, '2019-10-29 23:48:41', '0000-00-00 00:00:00', 0, '2017-05-08 22:18:03', 0, 'N', 'Y', '0'),
