(1790, NULL, 'The', 'Golden Crown', '1988', 13, 'M', 'Published in Electron User magazine volume 5, issue 4 in January 1988.\r\nAlso published in "Let''s Compute" magazine issue 7 in February 1991.\r\n<br>Published on the "Adventure Anthology" compilation, which was first advertised in Electron User volume 5, issue 8 in May 1988.\r\n<br>The compilation consisted of 4 adventures previously published in the pages of Electron User, PLUS "Johnny" by Bill Trevelyan which was previously unpublished.', 1, 1, NULL, NULL, NULL, 'Y', NULL, NULL, NULL, 2, '2017-12-18 13:41:34', '0000-00-00 00:00:00', 0, '2017-05-08 22:18:07', 0, 'N', 'Y', '0'),
