(1792, NULL, 'The', 'Hexagram Of Trutania Valley', '1986', 13, 'R', '<p>This game was published in a ''4 pack'' of adventures.</p>\r\n<p>The games were <a href="game.php?id=1722">The Philosopher''s Stone</a>, <a href="game.php?id=1792">The Hexagram of Trutania Valley</a>, <a href="game.php?id=1751">Inner Space</a>, and <a href="game.php?id=1726">Stranded On Iloofrax</a>.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 3, '2018-09-23 14:57:55', '0000-00-00 00:00:00', 0, '2018-09-22 11:27:50', 2, 'N', 'Y', '0'),
(1793, NULL, NULL, 'Jungle Adventure (Parts 1 And 2)', '1987', 13, 'M', 'Part 1 was published in Beebug magazine volume 6 issue 2 in June 1987, and part 2 in the following issue. Volume 6 issue 3 in July 1987.', 1, 1, NULL, 'T', NULL, NULL, 'VB1.0', NULL, NULL, 2, '2017-12-10 15:00:10', '0000-00-00 00:00:00', 0, '2017-05-08 22:18:10', 0, 'N', 'Y', NULL),
(1794, NULL, 'The', 'Mirror Of Khoronz', '1987', 13, 'P', '<p>This game is a sequel to <a href="http://bbcmicro.co.uk/game.php?id=1680">Gateway To Karos</a> published by Acornsoft.</p>\r\n<p>It was released into the public domain by Joyce Haslam.</p>\r\n<p>Published on BBC PD Disc 135.</p>\r\n<p>Published on the 8BS Public Domain disc TBI-146</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, 'Gateway To Karos', '2', 2, '2018-10-12 12:35:31', '0000-00-00 00:00:00', 0, '2017-05-08 22:18:11', 0, 'N', 'Y', '0'),
(1795, NULL, NULL, 'Puss In Boots', '1984', 13, 'M', '<p>Published in the March/April 1984 issue of A&amp;B Computing. It was also sold on&nbsp;<a href="index.php?search=Adventure+Crazy+collection+no.2&amp;on_C=on&amp;sort=a">Adventure Crazy No.2</a>, a collection of games which comprised&nbsp;Death In Poglovia, Puss In Boots, Secret Agent, The Orb, Mysterious Yeti, and Diamond Adventure.</p>', 1, 1, NULL, NULL, NULL, NULL, '', '', NULL, 3, '2018-10-13 20:16:47', '0000-00-00 00:00:00', 0, '2017-05-08 22:18:12', 0, 'N', 'Y', '0'),
(1796, NULL, NULL, 'Return Of The Diamond', '1983', 13, 'M', '<p>Published in Beebug Magazine volume 2 issue 2 in June 1983. <br />Published in Elbug Magazine volume 1 issue 2 in December 1983.</p>\r\n<p>Published in the book "Games and other programs for the Acorn Electron" from Penguin Books in December 1983.</p>\r\n<p>Later published on the 8BS Public Domain disc 60 in December 1997.</p>\r\n<p>Later published on the 8BS Public Domain disc TBI-93</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-11-18 12:51:14', '0000-00-00 00:00:00', 0, '2017-05-08 22:18:13', 0, 'Y', 'Y', '0'),
