(1840, 25, NULL, 'Chuckie Egg 2009 [game only] (AKA Chuckie Egg 6) [hack]', '2009', 4, 'L', '<p>Eight&nbsp;extra levels by Dave Edwards for the classic <a href="game.php?id=25">Chuckie Egg</a>. The levels were created with Dave Edwards''s level-editor, which was part of <a href="game.php?id=2952">the original Chuckie Egg 2009 release</a>.</p>\r\n<p>The full game, including the level-editor, was published on the 8BS public-domain disc TBI-185.</p>\r\n<p>The new levels (<em>without</em> the editor) were published on the Electron User Group PD Disc 70 in 2009, and this BBC Micro game is an adaptation of that Electron release.</p>', 1, 4, NULL, NULL, NULL, 'Y', 'Unofficial release', '', '', 3, '2018-11-21 00:01:36', '0000-00-00 00:00:00', 0, '2018-11-14 08:34:00', 2, 'N', 'Y', '0'),
