(1887, NULL, NULL, 'Trank', '1984', 2, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Trank is an original zapping game involving Herman, the triangular tank, and a wandering gaily coloured target. The aim is to shoot as many targets as possible, without running into them, the walls or the obstacles. Herman can be controlled by either the keyboard or two joysticks, and the method of control is a little different to most games. If you are using joysticks the left stick controls his left caterpillar track and the fight stick controls his fight caterpillar track, so if both sticks are fully forward he will go forward at top speed, and if they are both back he will go in reverse at top speed. If one stick is forward and one back he will turn. Using the keyboard is similar:</p>\r\n<p style="padding-left: 30px;">A - Left track forward<br />Z - Left track backwards<br />* - Right track forward<br />? - Right track backwards<br />SPACE - Fire</p>\r\n</blockquote>', 1, 1, 'O', NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:24:15', '0000-00-00 00:00:00', 0, '2018-12-27 10:41:25', 2, 'N', 'Y', '0'),
(1888, NULL, NULL, 'Weenies', '2003', 19, 'R', 'This game gives you a password on completing a level. This can be used to skip to the next level the next time the game is played. These may be listed as an easter egg somewhere in the instructions screens. Try pressing P.', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2017-10-23 11:45:50', '0000-00-00 00:00:00', 0, '2017-05-08 22:19:56', 0, 'N', 'Y', NULL),
