(1925, NULL, NULL, 'Ultima', '1990', 31, 'M', '<p>Published in Micro User Magazine vol.8 issue 5 in July 1990</p>\r\n<p><a href="game.php?id=3068">Another version</a> of this game had already been published in Personal Software magazine, Spring 1983 edition.</p>\r\n<p>This variation on Chess was invented in 1962 by Robert Abbott. It was originally called <a href="https://en.wikipedia.org/wiki/Baroque_chess">Baroque Chess</a>, but was changed to Ultima at the suggestion of his publisher.</p>\r\n<p>Some variations to the rules exist.</p>', 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-08 13:29:05', '0000-00-00 00:00:00', 0, '2018-10-06 10:41:08', 2, 'N', 'Y', '0'),
(1926, NULL, NULL, 'Yartsie', '1985', 549, 'R', '<p>This game was published on a ''4 pack'' of games.</p>\r\n<p>The games were <a href="game.php?id=1942">Three Crystals</a>, <a href="game.php?id=1926">Yartsie</a>, <a href="game.php?id=1917">Hunchbach</a>, and <a href="game.php?id=1914">Fruity</a></p>', 1, 3, NULL, NULL, NULL, NULL, NULL, '', NULL, 2, '2018-06-19 16:36:37', '0000-00-00 00:00:00', 0, '2017-05-08 22:21:12', 0, 'N', 'Y', '0'),
(1927, NULL, NULL, '3D Maze', '1983', 1, 'R', '<p>Published on the three-game compilation Games Of Deduction. The games included were 3D Maze, Colour Cube, and Master Code.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-04-19 14:50:02', '0000-00-00 00:00:00', 0, '2017-05-08 22:21:34', 0, 'N', 'Y', '0'),
(1928, NULL, NULL, 'Asteroid Lander', '1982', 569, 'R', '<p>This game was sold in a double-pack with <a href="game.php?id=1958">Pete The Plastered Postman.</a></p>\r\n<p>The (slightly buggy) game listing was published in the September 1982 issue of Personal Computing Today, vol. 1 no.2.</p>\r\n<p>I am unsure as to whether this was before, or after the professional release.</p>\r\n<p>The game listing was later published in the July/August 1983 issue of A&amp;B Computing, vol. 1 issue 2.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-05-10 10:33:04', '0000-00-00 00:00:00', 0, '2017-05-08 22:21:35', 0, 'Y', 'Y', '0'),
