(1979, NULL, NULL, 'Artemidorus', '1986', 1, 'W', 'In common with most of the games on this website, the game was restored by Mick Brown. While he was able to aquire the program, he was not able to find the data files which make up the levels. Undaunted, Mick created some new levels so the game can be played again. Read the story on the <a href="http://stardot.org.uk/forums/viewtopic.php?f=6&t=9891&p=118458">stardot forums</a>. If you have access to the original data files, please <a href="http://stardot.org.uk/forums/viewtopic.php?f=6&t=11274&p=139922">let us know in the stardot forums</a>.', 1, 1, NULL, NULL, NULL, NULL, 'New Screens', NULL, NULL, 1, '2017-05-10 23:15:51', '0000-00-00 00:00:00', 0, '2017-05-08 22:23:00', 0, 'N', 'Y', NULL),
