(1981, NULL, NULL, 'Championship Boxing', '1983', 500, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.&nbsp;Original program by Paul Stanley, converted for the BBC Micro by Ian Thomas.&nbsp;Later published on the Electron User Group PD Disc 54 in October 2000.</p>\r\n<p>Sixty Programs For The BBC Micro contains the following description:</p>\r\n<blockquote>\r\n<p>Although we say it ourselves, this program is very close to being a masterpiece. Let''s face it, you''re never going to make it into the ring, but the hours you spend keying in programs amount to a great deal of repressed aggression. So here''s your chance to take on the boxing champions of the world without stirring from your armchair. The program offers you a bird''s eye view of a boxing ring and the opportunity to go three rounds with an opponent of your choice. You only score points if you manage to connect with the head, and a KO is possible if your strategy''s slick enough.</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-08-13 13:38:18', '0000-00-00 00:00:00', 0, '2019-01-03 14:44:56', 2, 'N', 'Y', '0'),
