(2015, NULL, NULL, 'Search For The Lost Orb', '19XX', 13, 'U', '<p>Not much is known about this game, but it appears to be of commercial quality.</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, '', NULL, 3, '2018-12-22 19:40:26', '0000-00-00 00:00:00', 0, '2018-06-25 10:16:48', 2, 'N', 'Y', '0'),
(2016, NULL, NULL, '2002: A Space Oddity', '1986', 13, 'R', '<p>This game was not listed in the magazine. <br />Commercially released on the "Adventure Crazy" Adventurescape disc, first advertised in the March 1986 issue. <br />The games included on the disc were: Jungle Adventure, 2002, Pobjoy Special, Island Adventure, Silicon Adventure, LiveAid, Snow Queen, Anthrosin, and Creepy Adventure.</p>', 1, 1, NULL, 'D', NULL, NULL, 'Adventurescape', '', NULL, 2, '2018-03-21 22:32:18', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:08', 0, 'N', 'Y', '0'),
(2017, NULL, NULL, '9 Classic Card And Board Games No. 1', '1986', 553, 'R', '<p>First advertised in Micro User Vol.4 issue 1 in March 1986, "9 Classic Card And Board Games No.1" and "9 Classic Card And Board Games No.2" were available for purchase separately. These compilations included some previously published type-in games. Please note that some games were slightly altered.</p>\r\n<p><strong>Draughts: Published in Micro User Magazine vol.3 issue 5 in July 1985</strong></p>\r\n<p><strong>Fives: Published in Micro User Magazine vol.3 issue 11 in January 1986</strong></p>\r\n<p><strong>Dominoes: Published in Micro User Magazine vol.3 issue 3 in May 1985</strong></p>\r\n<p><strong>Molecule: </strong><strong><strong>Published in Micro User Magazine vol.3 issue 10 in December 1985</strong></strong></p>\r\n<p><strong>Reversi:</strong></p>\r\n<p><strong>Code Breaker: Published in Electron User Magazine vol.1 issue 9 in June 1984. Later released by Alternative Software on the Triple Decker 09 compilation.</strong></p>\r\n<p><strong>Patience: Published on the Micro User <a href="index.php?search=Golden+Games&amp;on_C=on">Golden Games</a> compilation in 1984</strong></p>\r\n<p><strong>Pontoon: Published in Micro User Magazine vol.1 issue 9 in November 1983</strong></p>\r\n<p><strong>Pairs:</strong></p>\r\n<p>&nbsp;</p>', 1, 2, 'O', NULL, NULL, NULL, NULL, 'Micro User Classic Card And Board Games', '1', 2, '2019-07-09 08:12:24', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:05', 0, 'N', 'Y', '0'),
(2018, NULL, NULL, '9 Classic Card And Board Games No. 2', '1986', 553, 'R', '<p>First advertised in Micro User Vol.4 issue 1 in March 1986, "9 Classic Card And Board Games No.1" and "9 Classic Card And Board Games No.2" were available for purchase separately. These compilations included some previously published type-in games.</p>\r\n<p><strong>Backgammon: Published in Micro User Magazine vol.2 issue 5 in July 1984</strong></p>\r\n<p><strong>Cribbage: Published on the Micro User <a href="index.php?search=Golden+Games&amp;on_C=on">Golden Games</a> compilation in 1984</strong></p>\r\n<p><strong>Squares: Published in Micro User Magazine vol.3 issue 10 in December 1985</strong></p>\r\n<p><strong>Solitaire: Published in Micro User Magazine vol.3 issue 8 in October 1985</strong></p>\r\n<p><strong>Tic Tac Toe:</strong></p>\r\n<p><strong>Sliding Blocks:</strong></p>\r\n<p><strong>Poker: Published on the Micro User <a href="index.php?search=Golden+Games&amp;on_C=on">Golden Games</a> compilation in 1984</strong></p>\r\n<p><strong>Sevens: Published on the Micro User <a href="index.php?search=Golden+Games&amp;on_C=on">Golden Games</a> compilation in 1984</strong></p>\r\n<p><strong>Higher And Lower:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, 'Micro User Classic Card And Board Games', '2', 2, '2019-07-09 08:32:30', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:05', 0, 'N', 'Y', '0'),
