(2023, NULL, NULL, 'Acorn Adventure', '1983', 13, 'R', '<p>Published on "Beebtape 5". This was number 5 in a series of 6 "Beebtapes" - compilation tapes that CSL Microdata released in 1982 and 1983.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, 'Beebtape', '5', 2, '2018-10-10 18:13:40', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:12', 0, 'N', 'Y', '0'),
