(2026, NULL, NULL, 'Alien Jailbreak', '2014', 13, 'P', '<p>Development on this game, then untitled, began in the 1980s. An incomplete version was discovered and finished independently in 2014.&nbsp;</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 3, '2018-01-09 12:45:08', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:17', 0, 'N', 'Y', '0'),
(2027, NULL, NULL, 'All The Colours Of Darkness', '1991', 13, 'P', '<p>Written with BAPS (The Bazzasoft Adventure Programming System).</p>\r\n<p>Published on the 8BS Public Domain disc TBI-189.</p>\r\n<p>Contained on the BAPS disc were "All the colours of darkness", "House - it''s quite good really", "Test of the turnip", and "Eridan rescue", and the BAPS program itself.</p>\r\n<p>Also given away on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.11 issue 9 in November 1993.</p>\r\n<p>&nbsp;</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 09:28:04', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:18', 0, 'N', 'Y', '0'),
(2028, NULL, NULL, 'American Suds (Parts 1 to 4)', '1986', 13, 'R', '<p>All three&nbsp;<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=suds&amp;on_T=on&amp;on_A=on&amp;sort=b">Suds adventures</a>&nbsp;were written using&nbsp;<a href="https://en.wikipedia.org/wiki/The_Quill_(software)">The Quill</a>.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, 'Suds', '2', 3, '2019-09-01 23:45:49', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:19', 0, 'N', 'Y', '0'),
(2029, NULL, NULL, 'Amnesia', '1985', 13, 'R', 'First Advertised in the November 1985 issue of A&B Computing. This was a disc only purchase, along with the upgraded version of the "Adventurescape" adventure writing system.', 1, 1, NULL, 'D', NULL, NULL, 'Adventurescape', '', NULL, 2, '2017-12-16 12:09:07', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:20', 0, 'N', 'Y', '0'),
(2030, NULL, NULL, 'Anion 3 (AKA Anion-3)', '1987', 13, 'P', '<p>This game was originally programmed in 1987/1988, and then updated and finished in 2016.</p>\r\n<p>More details&nbsp;<a href="http://stardot.org.uk/forums/viewtopic.php?f=13&amp;t=10717">here.</a></p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-04-09 00:29:21', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:21', 0, 'N', 'Y', '0'),
(2031, NULL, NULL, 'Annabel Gray (Parts 1 And 2)', '1988', 13, 'R', '<p><a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=Lee+Software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=b">Both adventures from Lee Software</a> were written using "The Quill".</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-09 18:18:04', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:21', 0, 'N', 'Y', '0'),
