(2033, NULL, NULL, 'Anthrosin', '1986', 13, 'M', '<p>Published in the March 1986 issue of A&amp;B Computing. <br />This was one of 2 winning games in the Adventurescape games writing competition, the other being Jungle Quest. <br />Commercially released on the "Adventure Crazy" Adventurescape disc, first advertised in the March 1986 issue. <br />The games included on the disc were: Jungle Adventure, 2002, Pobjoy Special, Island Adventure, Silicon Adventure, LiveAid, Snow Queen, Anthrosin, and Creepy Adventure.</p>', 1, 1, NULL, 'D', NULL, NULL, 'Adventurescape', '', NULL, 2, '2018-03-21 22:30:23', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:23', 0, 'N', 'Y', '0'),
