(2036, NULL, NULL, 'Aussie Suds (Part 1)', '1988', 13, 'U', '<p>This is part one of a series. Unfortunately the author died before he was able to write any further episodes. However, if you like this game then try <a href="game.php?id=2237">Suds</a>&nbsp;and <a href="game.php?id=2028">American Suds</a> by the same author.</p>\r\n<p>All three&nbsp;<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=suds&amp;on_T=on&amp;on_A=on&amp;sort=b">Suds adventures</a> were written using <a href="https://en.wikipedia.org/wiki/The_Quill_(software)">The Quill</a>.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, 'Suds', '3', 3, '2019-09-01 23:46:20', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:26', 0, 'N', 'Y', '0'),
(2037, NULL, 'The', 'Axe Of Kolt (Parts 1 to 4)', '1988', 13, 'R', '<p>All 5 <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=elk+adventure+club&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=b">Elk Adventure Club adventures</a> were written using "The Quill".</p>', 1, 1, NULL, 'T', NULL, 'Y', NULL, NULL, NULL, 2, '2019-07-18 00:20:05', '0000-00-00 00:00:00', 0, '2018-09-12 18:55:29', 2, 'N', 'Y', '0'),
