(2043, NULL, NULL, 'Bomb Alert', '1989', 13, 'P', '<p>Published by 8BS as part of the Jon Ripley Public Domain collection, on "disc JJR-09", which in fact comprises three discs of adventure games. Bomb Alert was on disc 1.</p>\r\n<p>(For reasons unknown, the version of the game that was on the disc-image that was originally uploaded here was incomplete: the winning ending message was missing. A suitable message was written and added to the game in 2018. <a href="https://stardot.org.uk/forums/viewtopic.php?f=51&amp;t=15436">More details</a> at Stardot.)</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 3, '2018-08-03 16:59:56', '0000-00-00 00:00:00', 0, '2018-07-29 13:17:35', 3, 'N', 'Y', '0'),
(2044, NULL, NULL, 'Bored Of The Rings (Parts 1 to 4)', '1985', 13, 'R', '<p>The official BBC Micro port of Fergus McNeill&rsquo;s parodic text adventure game Bored Of The Rings.</p>\r\n<p><a href="https://en.wikipedia.org/wiki/Bored_of_the_Rings_(video_game)">More details</a> at Wikipedia.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 3, '2020-01-04 12:41:00', '0000-00-00 00:00:00', 0, '2017-05-10 21:28:08', 0, 'N', 'Y', '0'),
