(2048, NULL, NULL, 'Captive', '1983', 13, 'B', '<p>From the book <em>Creating Adventure Programs on the BBC Micro</em> by <em>Ian Watt</em> published by <em>Interface Publications</em>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2019-01-06 01:14:25', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:42', 0, 'N', 'Y', '0'),
