(2050, NULL, NULL, 'Castle Of Fear', '1984', 13, 'M', '<p><em>...this isn''t really an adventure. It''s basically a 3D noughts and crosses (or tic-tac-toe for our American friends) that plays like a role-playing game with single-letter input played in real-time with lots of sudden-death scenarios and random events that you''ve got no control over. Avoid it unless you''re extremely patient and prepared to play it dozens of times, even if you know the solution.</em> &mdash;Garry at <a href="http://www.solutionarchive.com/phpBB3/viewtopic.php?f=3&amp;t=981&amp;p=9003#p8997">CASA</a></p>\r\n<p>Published in Micro User magazine, volume 2, issue 6, in August 1984.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-01-26 13:41:38', '0000-00-00 00:00:00', 0, '2019-01-25 12:18:18', 3, 'N', 'Y', '0'),
(2051, NULL, NULL, 'Catacombs', '1984', 13, 'M', 'Published in Acorn Programs magazine August/September 1984. Issue 5.', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2017-11-27 14:25:09', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:48', 0, 'N', 'Y', NULL),
(2052, NULL, NULL, 'Cave Adventure', '1985', 13, 'P', '<p>Published on the 8BS Public Domain disc TBI-93</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-16 17:18:50', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:49', 0, 'N', 'Y', '0'),
(2053, NULL, NULL, 'Caves', '1984', 13, 'B', '<p>From the book <em>How to Write Adventure Games</em> by <em>Peter Killworth</em> published by <em>Penguin Acorn Computer Library</em>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2019-01-06 00:12:53', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:50', 0, 'N', 'Y', '0'),
(2054, NULL, NULL, 'Cells And Serpents', '1983', 36, 'R', '<p>The BBC micro game is a conversion of "Cells And Serpents", written for the NASCOM computer by G. Lovell, first published in the December 1980 issue of Computing Today magazine.</p>\r\n<p>The original, commercial BBC micro release by ASP software was in early 1983. A functionally identical, but much better annotated listing was published in the May/June 1983 issue of A&amp;B Computing (volume 1, issue 1) which credits I.G. Nicholls with the translation.<br />Later, a slightly different listing was published both on the 8BS Public Domain disc 05 in September 1990, and BBC PD Disc 10.<br />An improved version of this listing was published on both BBC PD Disc 166 (which featured Mad Rabbit PD Disc 024) and 8BS Public Domain disc 08 in January 1991 which credits the improvements to Roger Pashby in October 1990.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-08 11:40:35', '0000-00-00 00:00:00', 0, '2017-11-02 17:25:31', 0, 'Y', 'Y', '0'),
(2055, NULL, NULL, 'Cloudburst', '1984', 13, 'P', '<p>This game was David Machin''s ''O'' level computer science project (and Micronet 800''s "Freebie software of the month" winner.)</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-03-12 00:05:53', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:53', 0, 'N', 'Y', '0'),
(2056, NULL, NULL, 'Coffee Adventure', '1984', 13, 'B', '<p>This game was published in <a href="game.php?id=3210">The Second Book Of Listings</a> by BBC Publications in 1984.</p>\r\n<p>A slightly altered version (altered to work in Mode 6 for the Electron) was later published on the Electron User Group PD Disc 51 in June 2000.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-08-08 14:09:40', '0000-00-00 00:00:00', 0, '2019-07-25 20:10:41', 2, 'N', 'Y', '0'),
(2057, NULL, NULL, 'Complete Home Entertainment Centre', '1986', 553, 'R', NULL, 1, 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-24 10:39:19', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:58', 0, 'N', 'Y', '0'),
