(2059, NULL, NULL, 'Conquering Everest', '1982', 36, 'R', '<p>The original listing, by Simon Bunce, for the NASCOM 2 computer was printed in "Computing Today" magazine in the May 1981 issue.</p>\r\n<p>This was later converted for the BBC Micro, and printed in "Personal Software" magazine issue 1, Summer 1982.</p>\r\n<p>This was then expanded and released commercially in 1983 by ASP Software.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2018-12-17 22:20:17', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:59', 0, 'N', 'Y', '0'),
