(2064, NULL, NULL, 'Creepy Adventure', '1986', 13, 'R', '<p>This game was not listed in the magazine. <br />Commercially released on the "Adventure Crazy" Adventurescape disc, first advertised in the March 1986 issue. <br />The games included on the disc were: Jungle Adventure, 2002, Pobjoy Special, Island Adventure, Silicon Adventure, LiveAid, Snow Queen, Anthrosin, and Creepy Adventure.</p>', 1, 1, NULL, 'D', NULL, NULL, 'Adventurescape', '', NULL, 2, '2018-03-21 22:37:15', '0000-00-00 00:00:00', 0, '2017-05-08 22:25:05', 0, 'N', 'Y', '0'),
