(2066, NULL, 'The', 'Crypt Of Gabon', '1983', 13, 'B', '<p>From the book Games BBC Computers Play by Tim Hartnell, S.M. Gee, and Mike James. Published by Interface Publications.</p>\r\n<p>The introductory text reads:</p>\r\n<blockquote>\r\n<p>In this ADVENTURE program, written by Ian Watt, you start outside the crypt.</p>\r\n<p>A stolen diamond must be replaced in it''s correct position within the crypt, before you make good your escape. The crypt, needless to say, is guarded by a monster which will destroy the world if the diamond is not replaced. The ambition of monster''s know no bounds. You have a limited time before you will be killed by the monster, which was designed by Gabon, who is buried in the crypt.</p>\r\n<p>You have to direct the computer to manipulate the objects you come across, and to move around. As with all good ADVENTURE programs, much of the pleasure in playing comes from discovering the vocabulary the computer will understand, so we will not give too much away in the introduction. The computer has, however, an extensive vocabulary, so if one command doesn''t work, try another.</p>\r\n<p>The program has been written so that only the first three letters of each command and object need to be typed in, although the computer will also accept the full word. For example, if you wished to say GET DIAMOND, the BBC Micro will accept GET DIA or GET DIAMOND. Other examples: DROP REVOLVER &ndash; DRO REV; THROW ROPE &ndash; THR ROP.</p>\r\n<p>Good luck in your quest.</p>\r\n</blockquote>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-04-19 13:50:55', '0000-00-00 00:00:00', 0, '2017-05-08 22:25:09', 0, 'N', 'Y', '0'),
(2067, NULL, 'The', 'Cube Of Zoth', '1987', 13, 'M', '<p>Published on the June/July 1987 issue of Disk User. Issue 01. <br />Written with A&amp;B Computing''s "Adventurescape" system. <br />Prizes of a copy of Adventurescape were given to the first thirty readers to solve the game.</p>\r\n<p>The disc was later offered for sale in A&amp;B Computing.</p>\r\n<p>Later published on the 8BS Public Domain disc TBI-93</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 09:37:07', '0000-00-00 00:00:00', 0, '2017-05-08 22:25:10', 0, 'N', 'Y', '0'),
