(2093, NULL, NULL, 'Eridan Rescue', '1991', 13, 'P', '<p>Written with BAPS (The Bazzasoft Adventure Programming System).</p>\r\n<p>Contained on the BAPS disc were "All the colours of darkness", "House - it''s quite good really", "Test of the turnip", and "Eridan rescue".</p>\r\n<p>This is one of the two sample adventures provided with the "Bazzasoft Adventure Creator". The othe one being "Test Of The Turnip".</p>\r\n<p>Published on the 8BS Public Domain disc TBI-189 - which contains all the above programs</p>\r\n<p>Published on BBC PD Disc 70.</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 12:11:39', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:10', 0, 'N', 'Y', '0'),
