(2117, NULL, 'The', 'Golden Fleece', '1984', 13, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Golden Fleece is an interesting adventure game with the added bonus of exciting graphics at each location. The object of your quest is to find the Golden Fleece, which is at one of the 18 locations. You may type in one or two word commands: the commands that the program understands are GO, DIG, GET, DROP, PAY, TAKE, CUT, ROW, KILL, LIGHT, OPEN and INV (inventory - to give you a list of the objects that you are carrying). Directions may be entered in any of three different ways; for example to go north you can type GO NORTH, NORTH or just N.</p>\r\n<p>The which the program is written makes it easy to extend. Each verb is dealt with by its own procedure, so to add an extra verb all you have to do is add a line to check for it, at line 535 for example, and then add a procedure to deal with it.</p>\r\n</blockquote>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-01-04 16:21:20', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:36', 0, 'N', 'Y', '0'),
