(2135, NULL, NULL, 'Island Of Secrets', '1984', 13, 'B', '<p><em>Island of Secrets</em> may be found as a type-in listing in the book of the same name, a free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>\r\n<p>As well as the listing the book contains an illustrated background story to the adventure. Some of the illustrations contain information that may aid the adventurer.</p>\r\n<p>Later published on the Electron User Group PD Disc 58 in May 2001.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-02-21 16:39:11', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:05', 0, 'N', 'Y', '0'),
