(2169, NULL, NULL, 'Mutiny In The Mansion', '19XX', 13, 'P', '<p>Published on the ''Viking Collection'' Public Domain Disc from 8BS Software TBI-115.</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-01-15 15:07:54', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:48', 0, 'N', 'Y', '0'),
(2170, NULL, 'The', 'Mysterious Yeti', '1986', 13, 'R', '<p>This game was not listed in the magazine. It was first advertised in the March 1986 issue of A&amp;B Computing. It was also sold on&nbsp;<a href="index.php?search=Adventure+Crazy+collection+no.2&amp;on_C=on&amp;sort=a">Adventure Crazy No.2</a>, a collection of games which comprised&nbsp;Death In Poglovia, Puss In Boots, Secret Agent, The Orb, Mysterious Yeti, and Diamond Adventure.</p>', 1, 1, NULL, 'D', NULL, NULL, '', '', NULL, 3, '2018-10-13 20:16:19', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:49', 0, 'N', 'Y', '0'),
(2171, NULL, 'The', 'Mystery Of Silver Mountain', '1984', 13, 'B', '<p>The Mystery Of Silver Mountain can be found as a type-in listing in the book of the same name, a free PDF of which is available to download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>\r\n<p>As well as the listing, the book contains an illustrated background story to the adventure. Some of the illustrations contain information that may aid the adventurer.</p>\r\n<p>Later published on Electron User Group PD Disc 59 in July 2001.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 3, '2019-06-01 19:11:44', '0000-00-00 00:00:00', 0, '2019-05-31 17:01:01', 2, 'N', 'Y', '0'),
(2172, NULL, NULL, 'Mystery Of The Lost Sheep (Parts 1 and 2)', '1986', 13, 'R', NULL, 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2017-10-03 14:36:08', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:50', 0, 'N', 'Y', NULL),
(2173, NULL, NULL, 'Necromancer', '1986', 13, 'M', 'Published in Electron User magazine volume 3, issue 5 in February 1986.\r\n<br>Published on the "Adventure Anthology" compilation, which was first advertised in Electron User volume 5, issue 8 in May 1988.\r\n<br>The compilation consisted of 4 adventures previously published in the pages of Electron User, PLUS "Johnny" by Bill Trevelyan which was previously unpublished.', 1, 1, NULL, 'D', NULL, 'Y', NULL, '', NULL, 2, '2017-12-18 13:42:10', '0000-00-00 00:00:00', 0, '2018-09-12 18:57:53', 2, 'N', 'Y', '0'),
(2174, NULL, NULL, 'New Start, Old Dreams', '1994', 13, 'P', '<p>Published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 1.</p>\r\n<p>Published on the 8BS Public Domain disc 32 in January 1994.</p>\r\n<p>Published on the 8BS Public Domain disc TBI-93</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 12:37:13', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:54', 0, 'N', 'Y', '0'),
