(2176, NULL, NULL, 'On The Way To The Interview', '1985', 13, 'B', '<p>Published in the book "Electron Programs" by Carl Graham.</p>\r\n<p>The book featured 2 adventure games, <a href="http://www.bbcmicro.co.uk/game.php?id=2176">On The Way To The Interview</a>, and <a href="http://www.bbcmicro.co.uk/game.php?id=2190">Planet Of Muton</a>.</p>\r\n<p>Later published on the 8BS Public Domain disc TBI-157</p>\r\n<p>Later published on the Electron User Group PD Disc 57 in April 2000.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-11 17:59:55', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:56', 0, 'N', 'Y', '0'),
(2177, NULL, NULL, 'Operation Kristos', '1986', 13, 'M', 'Published In the February 1986 issue of Computer & Video Games. Issue 52, in the "Book Of Games" supplement.', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2017-11-29 10:43:19', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:58', 0, 'N', 'Y', NULL),
(2178, NULL, 'The', 'Orb', '1985', 13, 'R', '<p>The Orb was probably first mentioned in the Spring 1985 supplement to A&amp;B Computing magazine</p>\r\n<p>It was later advertised in the March 1986 issue.&nbsp;The game was sold on <a href="index.php?search=Adventure+Crazy+collection+no.2&amp;on_C=on&amp;sort=a">Adventure Crazy No. 2</a>, a collection of adventure games which comprised Death In Poglovia, Puss In Boots, Secret Agent, The Orb, Mysterious Yeti, and Diamond Adventure.</p>', 1, 1, NULL, NULL, NULL, NULL, '', '', NULL, 2, '2019-01-21 14:55:30', '0000-00-00 00:00:00', 0, '2018-08-29 08:56:16', 2, 'N', 'Y', '0'),
