(2189, NULL, NULL, 'Plane Crash', '1988', 13, 'R', '<p><em>Plane Crash is the first release from this new software house dedicated to producing top rate adventures for the Electron and BBC Micro. In this three-part undertaking you have the misfortune to play the only survivor of a plane which crashed in a jungle. Your task is to first escape from the wreckage and then survive the rigours of your environment.</em> &mdash;Electron User magazine</p>\r\n<p><a href="https://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=12068#p153024">See Stardot</a> for more details about the game.&nbsp;</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 3, '2019-06-04 13:18:09', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:13', 0, 'N', 'Y', '0'),
(2190, NULL, NULL, 'Planet Of Muton', '1985', 13, 'B', '<p>Published in the book "Electron Programs" by Carl Graham.</p>\r\n<p>The book featured 2 adventure games, <a href="http://www.bbcmicro.co.uk/game.php?id=2176">On The Way To The Interview</a>, and <a href="http://www.bbcmicro.co.uk/game.php?id=2190">Planet Of Muton</a>.</p>\r\n<p>Later published on the 8BS Public Domain disc TBI-157</p>\r\n<p>Later published on the Electron User Group PD Disc 58 in May 2001.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-11 18:01:01', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:14', 0, 'N', 'Y', '0'),
(2191, NULL, NULL, 'Planetfall (AKA Planet Fall)', '1983', 36, 'R', '<p>This game was originally written for the Sharp MZ-80K computer by Tim Garden.</p>\r\n<p>It was translated for the BBC Micro by Ian Nicholls.</p>\r\n<p>The listings for both the Sharp and the BBC Micro were printed in the August 1983 issue of Computing Today magazine.</p>\r\n<p>The game was released commercially for the BBC Micro by ASP software, and advertised for sale in the same issue as the listing was printed! (August 1983).</p>', 2, 12, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2019-08-12 00:35:52', '0000-00-00 00:00:00', 0, '2017-11-12 16:15:58', 0, 'N', 'Y', '0'),
(2192, NULL, NULL, 'Please Find My Young ''Uns', '1989', 13, 'P', '<p>Published on BBC PD Disc 78.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-15 14:21:32', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:16', 0, 'N', 'Y', '0'),
(2193, NULL, 'The', 'Pobjoy Special', '1986', 13, 'R', '<p>This game was not listed in the magazine. <br />Commercially released on the "Adventure Crazy" Adventurescape disc, first advertised in the March 1986 issue. <br />The games included on the disc were: Jungle Adventure, 2002, Pobjoy Special, Island Adventure, Silicon Adventure, LiveAid, Snow Queen, Anthrosin, and Creepy Adventure.</p>', 1, 1, NULL, 'D', NULL, NULL, 'Adventurescape', '', NULL, 2, '2018-03-21 22:36:13', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:17', 0, 'N', 'Y', '0'),
