(2240, NULL, NULL, 'Test Of The Turnip', '1991', 13, 'P', '<p>Written with BAPS (The Bazzasoft Adventure Programming System).</p>\r\n<p>Contained on the BAPS disc were "All the colours of darkness", "House - it''s quite good really", "Test of the turnip", and "Eridan rescue" and the BAPS system itself.</p>\r\n<p>Published on BBC PD Disc 70.</p>\r\n<p>Published on the 8BS Public Domain disc TBI-189</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 12:47:46', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:38', 0, 'N', 'Y', '0'),
