(2242, NULL, NULL, 'Time Switch', '1983', 13, 'M', '<p>Published in Your Computer magazine, volume 3, issue 8, in August 1983. The listing was for the Sinclair Spectrum. The game was ported to the BBC Micro in 1989 by Jon Ripley.</p>\r\n<p>Later published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact, contained three discs of adventure games. This adventure is on disc 2.&nbsp;Later published on the 8BS Public Domain disc 48 in March 1996.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-08-13 13:42:08', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:44', 0, 'N', 'Y', '0'),
