(2250, NULL, 'The', 'Valley', '1982', 36, 'R', '<p>This is a BBC micro conversion of "The Valley", a game originally written for the Commodore PET computer by Henry Budgett, Peter Freebrey, Peter Green, and Ron Harris.</p>\r\n<p>The PET listing was first published in the April 1982 issue of Computing Today magazine.</p>\r\n<p>The commercial release by ASP Software for the BBC Micro was later in 1982.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2019-05-08 14:06:58', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:52', 0, 'Y', 'Y', '0'),
(2251, NULL, NULL, 'Video Classics (AKA Blip)', '1988', 474, 'R', '<p>This is a compilation of ''Pong'' like games.</p>\r\n<p>Tennis, Football, Squash, Solo Squash, Four Bat Blip, and Asterbliperoids.</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-04-29 00:56:59', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:52', 0, 'N', 'Y', '0'),
