(2256, NULL, 'The', 'White Barrows', '1982', 13, 'R', '<p>White Barrows is an adaptation of <a href="https://en.wikipedia.org/wiki/Hunt_the_Wumpus">Hunt The Wumpus</a>, the 1975 game by Gregory Yob.&nbsp;This game was later adapted for the Acorn Atom by Andrew Thomas and Gareth Callister.&nbsp;The Atom listing was then converted for the BBC Micro and printed in Personal Software magazine, issue 1, summer 1982.&nbsp;This was then expanded and released commercially in 1983 by ASP Software.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-08-13 13:22:20', '0000-00-00 00:00:00', 0, '2017-11-12 16:15:03', 0, 'N', 'Y', '0'),
