(2296, NULL, NULL, 'Chart Challenge', '1986', 29, 'R', '<p>The game needs to write some configuration data to the disc. To play offline, download the disc-image as usual but then disable write-protection in your emulator before running the game.</p>\r\n<p>The discs below contain additional questions. Insert the main game disc into drive 0 and one of these database discs into drive 1.</p>\r\n<ul>\r\n<li><a href="game.php?id=2297">Chart Challenge Database Disc 1</a></li>\r\n<li><a href="game.php?id=2298">Chart Challenge Database Disc 2</a></li>\r\n<li><a href="game.php?id=2299">Chart Challenge Database Disc 3</a></li>\r\n<li><a href="game.php?id=2300">Chart Challenge Database Disc 4</a></li>\r\n</ul>', 1, 2, NULL, 'D', NULL, NULL, NULL, 'Chart Challenge', '1', 3, '2018-12-03 11:43:19', '0000-00-00 00:00:00', 0, '2018-11-30 10:41:04', 3, 'N', 'Y', '0'),
(2297, NULL, NULL, 'Chart Challenge Database Disc 1', '1986', 567, 'R', '<p>This is an additional database disc for the Chart Challenge pop music quiz. The program writes configuration to disc before it starts the quiz. To play offline, download this disc-image and the <a href="game.php?id=2296">Chart Challenge</a> disc-image, and open them in an emulator. <a href="game.php?id=2296">Chart Challenge</a> needs to be inserted into drive 0, and this database disc needs to be in drive 1.</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, '', '', 3, '2018-12-03 11:42:10', '0000-00-00 00:00:00', 0, '2018-11-30 10:50:09', 3, 'N', 'Y', '0'),
