(2327, NULL, NULL, 'Cascade Cassette 50', '1983', 599, 'R', '<p>This compilation contains 50 very poor quality ''shovelware'' games.</p>\r\n<p>Later published on the 8BS Public Domain disc TBI-201 - although some versions of the games are slightly different.</p>', 1, 1, '', NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 09:33:07', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:44', 0, 'Y', 'Y', '0'),
(2328, NULL, NULL, 'Galaxias (AKA Intravoid)', '2011', 13, 'P', '<p>Originally written by Fergus McNeill and published for the Sinclair Spectrum by Delta 4 Software in 1986.</p>\r\n<p>Originally reviewed as "Intravoid", but was re-released as "Galaxias" after nothing more than changing the typeface.&nbsp;</p>\r\n<p>Ported to the BBC Micro in 2011 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="http://www.retrosoftware.co.uk/wiki/index.php?title=SGAP#Galaxias">here</a> and <a href="https://solutionarchive.com/game/id%2C628/Galaxias.html">here.</a></p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-04-28 14:19:01', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:27', 0, 'N', 'Y', '0'),
(2329, 1681, 'The', 'Hobbit [hack]', '1985', 13, 'L', '<p>Bugfixed version by Kieran Mockford. Needs 16K or 32K of Sideways RAM.</p>\r\n<p>More info&nbsp;<a href="http://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=13336&amp;sid=b3478452083306a9c3c930432edb851c">here</a></p>', 1, 1, NULL, 'D', '1 or 2 x Banks SWR Required', NULL, 'Universal Disc Version', NULL, NULL, 2, '2018-09-10 23:31:20', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:49', 0, 'N', 'Y', '0'),
(2330, NULL, 'The', 'Lord Of The Rings: Game One', '1985', 13, 'R', '<p>Needs 16K or 32K of Sideways RAM.</p>', 1, 1, NULL, 'D', '1 or 2 x Banks SWR Required', NULL, 'Universal Text Only', NULL, NULL, 2, '2018-07-15 22:31:34', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:27', 0, 'N', 'Y', '0'),
(2331, NULL, NULL, 'Project X: The Micro Man', '2012', 13, 'P', '<p>Originally written by Jon R. Lemmon and Tim Kemp, and published for the Sinclair Spectrum by Compass Software in 1985.</p>\r\n<p>Ported to the BBC Micro in 2012 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="https://solutionarchive.com/game/id%2C662/Project-X%3A+The+Micro+Man.html">here</a> and <a href="http://www.retrosoftware.co.uk/wiki/index.php?title=SGAP#Project-X:_The_Micro_Man">here.</a></p>', 1, 1, NULL, 'T', NULL, NULL, NULL, 'Project X', '1', 2, '2018-04-01 13:00:45', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:26', 0, 'N', 'Y', '0'),
(2332, NULL, NULL, 'Project X: The Micro Man II (The O Zone)', '2012', 13, 'P', '<p>Originally written by Jon R. Lemmon and Tim Kemp, and published for the Sinclair Spectrum by Compass Software in 1986.</p>\r\n<p>Ported to the BBC Micro in 2012 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="https://solutionarchive.com/game/id%2C415/O+Zone%2C+The.html">here</a> and <a href="http://www.retrosoftware.co.uk/wiki/index.php?title=SGAP#Micro_Man_II:_The_O_Zone">here.</a></p>', 1, 1, NULL, 'T', NULL, NULL, NULL, 'Project X', '2', 2, '2018-04-01 13:05:35', '0000-00-00 00:00:00', 0, '2017-05-06 20:42:44', 0, 'N', 'Y', '0'),
(2333, NULL, 'The', 'Wizard''s Citadel (AKA Runemagic Adventure 2)', '1984', 13, 'R', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, 'Runemagic:', 'Adventure 2', 1, '2017-04-06 20:31:29', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:59', 0, 'N', 'Y', NULL),
(2334, NULL, NULL, 'Escape From Solaris (AKA Galaxy''s Edge Part 2)', '1984', 13, 'R', '<p><a href="https://www.youtube.com/watch?v=N1bniZw7EBY">YouTube video</a> of two BBC Micros connected together, playing Escape From Solaris.</p>\r\n<p>More details&nbsp;about the game at <a href="https://ahopeful.wordpress.com/2018/04/12/escape-from-solaris-1984-by-graham-nelson/">Retroactive Fiction</a>.</p>\r\n<p><a href="game.php?id=2110">Galaxy''s Edge I: The Discovery</a> is also available.</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, 'Galaxy''s Edge', 'Part 2', 3, '2018-12-30 16:23:51', '0000-00-00 00:00:00', 0, '2018-08-29 08:55:06', 2, 'N', 'Y', '0'),
(2335, NULL, NULL, 'Adventure', '1993', 13, 'P', '<p>Published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 2.</p>\r\n<p>Published on the Acorn User subscriber''s disc. in July 1993.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-29 17:11:23', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:15', 0, 'N', 'Y', '0'),
(2336, NULL, NULL, 'Starship Adventure (AKA Space Adventure)', '1983', 13, 'M', '<p>Published in the September/October 1983 issue of A&amp;B Computing.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2019-10-19 11:18:08', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:25', 0, 'N', 'Y', '0'),
(2337, NULL, 'The', 'Opal Lily', '1984', 13, 'B', '<p>From the book <em>Intelligent Adventures for the Electron and BBC Microcomputers </em>by Noel Williams, published by McGraw Hill.</p>\r\n<p>** The game may be faulty.** &nbsp;More details <a href="https://stardot.org.uk/forums/viewtopic.php?f=9&amp;t=6770&amp;p=138107&amp;hilit=opal%20lily#p138107">at Stardot</a>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2018-08-01 18:20:20', '0000-00-00 00:00:00', 0, '2018-08-01 18:11:10', 3, 'N', 'Y', '0'),
(2338, NULL, NULL, 'Rendezvous', '1984', 13, 'B', '<p><em>Rendezvous</em> may be found as a type-in listing in <em>Computer Spy Games</em>, a free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>\r\n<p>As well as the listing the book contains a map showing all of the places you can visit, and it also lists all of the words you can use in the game.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-19 14:52:11', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:51', 0, 'N', 'Y', '0'),
(2339, NULL, NULL, 'Micro Puzzle (AKA Micropuzzle)', '1984', 13, 'B', '<p>Micro Puzzle&nbsp;may be found as a type-in listing in Weird Computer Games.&nbsp;A free PDF of the book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2019-04-19 14:33:01', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:40', 0, 'N', 'Y', '0'),
(2340, NULL, 'The', 'Darkness Of Raven Wood', '2017', 13, 'P', '<p><em>A letter from your childhood friend Raynard says that strange things are happening near the village where you grew up: &ldquo;Eldritch storms rage. C</em><em>hildren are missing. A</em><em>nd unholy creatures stalk the earth...&rdquo; Now Raynard too has vanished! Who or what is behind it all? Are you brave enough to unearth the secret that lies within The Darkness of Raven Wood?</em></p>\r\n<p>More details at <a href="http://johnblythe5.wixsite.com/rucksackgames">Rucksack Games</a>.&nbsp;</p>', 1, 1, NULL, 'D', NULL, NULL, 'V1.3', NULL, NULL, 3, '2019-10-02 14:39:08', '0000-00-00 00:00:00', 0, '2018-08-29 08:53:22', 2, 'N', 'Y', 'Y'),
(2341, NULL, 'The', 'Price Of Magik', '1986', 13, 'R', NULL, 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '2017-05-22 22:32:19', 0, 'N', 'Y', NULL),
