(2651, NULL, NULL, 'Stock Market', '1983', 496, 'R', '<p>The origins of this program can probably be traced back to an article in the May 1980 issue of Computing Today magazine.</p>\r\n<p>This article, by Anthony Fleet, detailed a flowchart for a Stock Market program for the <a href="https://www.ti59.com/">Texas Instruments TI59</a> programmable calculator.</p>\r\n<p>This article was re-visited in the December 1980 issue of Computing Today.</p>\r\n<p>S. Moppett authored a listing for the Research Machines <a href="https://en.wikipedia.org/wiki/Research_Machines_380Z">RML 380Z</a> computer.</p>\r\n<p>The BBC Micro version is much improved from these early versions, but carries on the tradition of Argus Press Software had for printing type-in listings that later became commercial releases.</p>\r\n<p>The author of the BBC Micro conversion is unknown at the time of writing.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 6, '', '', '', '', '', '', '', 2, '2019-09-24 22:26:33', '0000-00-00 00:00:00', 0, '2017-09-25 14:40:58', 0, 'N', 'Y', '0'),
(2652, NULL, NULL, 'Trailblazer', '2017', 33, 'P', '<p>More details at&nbsp;<a href="http://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=13328">Stardot Forums.</a> The <a href="https://github.com/dmcoles/TrailBlazer_BBC_Micro_Conversion">source for Trailblazer</a> has been published on github.</p>', 1, 1, 'O', 'D', '', '', '', '', '', 1, '2018-11-26 00:21:27', '0000-00-00 00:00:00', 0, '2018-08-13 10:18:17', 2, 'N', 'Y', '0'),
