(2659, NULL, NULL, 'Arkham-Innsmouth And Beyond', '1984', 13, 'B', '<p>Published in the "Virgin Computer Series" book "Adventures for your BBC Micro" by Alex Gollner, which contains the following description:</p>\r\n<blockquote>\r\n<p>This long and intricate adventure by Stephen Loughran is&nbsp;based on the fantasy writings of H. P. Lovecraft, who wrote eerie horror stories about mysterious long-dead civilisations and all-powerful evil gods out to destroy you at the mere mention of their name. Though not in the sword-and-sorcery vein, this scenario is just as exciting &mdash; anything might happen . . .</p>\r\n<p>Your aim is to get all the money you can, then find safety. The commands can be entered in upper or lower case. Instructions are included in the program.</p>\r\n<p>There is a feature for disc users &mdash; you can create macros. Macros are used when you wish to save a &lsquo;routine&rsquo;, such as the commands to go into a creature&rsquo;s lair and kill it. If you enter &lsquo;MACRO killcrea&rsquo;, enter the commands to kill the creature and then enter &lsquo;END MACRO&rsquo; &mdash; the routine will be stored on disc. This is useful if you go on to another part of the adventure and are &lsquo;killed&rsquo; because you can enter the creature&rsquo;s lair and kill it just by typing the command &lsquo;killcrea&rsquo;. These macros, are stored on disc &mdash; if you do not have a disc interface you need not enter the lines followed by a colon (:) which deal with macros.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-09 19:11:15', '0000-00-00 00:00:00', 0, '2017-11-13 13:05:42', 0, 'N', 'Y', '0'),
(2660, NULL, NULL, 'Connect Four (AKA Connect 4)', '1984', 525, 'M', 'Published in Your Computer Magazine volume 4 issue 3 in March 1984.', 1, 1, '', '', '', '', '', '', '', 2, '2017-12-06 10:57:39', '0000-00-00 00:00:00', 0, '2017-11-12 15:17:37', 0, 'N', 'Y', NULL),
(2661, NULL, NULL, 'Road Racer', '1984', 6, 'M', 'Published in Micro User Magazine vol.2 issue 4 in June 1984', 1, 1, '', '', '', '', '', '', '', 2, '2017-11-12 15:34:28', '0000-00-00 00:00:00', 0, '2017-11-12 15:17:57', 0, 'N', 'Y', NULL),
(2662, NULL, NULL, 'Pontoon', '1984', 520, 'M', '<p>Published in Beebug Magazine volume 3 issue 4 in August 1984. <br />Published in Elbug Magazine volume 1 issue 8 in July 1984.</p>', 1, 1, '', '', '', '', 'VB0.2', '', '', 2, '2019-01-24 11:03:46', '0000-00-00 00:00:00', 0, '2019-11-16 11:09:26', 2, 'N', 'Y', '0'),
(2663, NULL, NULL, 'Bugbusters', '1984', 13, 'B', '<p>Published in the "Virgin Computer Series" book Adventures for your BBC Micro by Alex Gollner, along with the following description:</p>\r\n<blockquote>\r\n<p>In this original game you have the chance to explore the innards of your computer, for it has started to go wrong! You can now discover what really makes your computer tick and what can cause it to malfunction.</p>\r\n<p>Fortunately, your great aunt has just given you one of her strange inventions &mdash; a shrink beam: Once you have shrunk to the right size you must carefully find your way into the computer; then, using all your faculties, you must repair it.</p>\r\n<p>This is an example of how adventures need not always involve dungeons!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-09 20:20:51', '0000-00-00 00:00:00', 0, '2017-11-13 13:12:05', 0, 'N', 'Y', '0'),
