(2667, 2717, NULL, 'Christmas Lights (AKA Candle Light)', '1986', 4, 'R', '<p>Part of <a href="http://bbcmicro.co.uk/game.php?id=2717">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 4, issue 10) in December 1986.&nbsp;Note that Micro User had used the "Christmas Crackers" name before, for <a href="game.php?id=2785">a different compilation</a> first released in 1983.</p>\r\n<p>The 1986 compilation comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:15:30', '0000-00-00 00:00:00', 0, '2017-11-21 21:54:51', 0, 'N', 'Y', '0'),
(2668, NULL, NULL, 'Know Your Own Psi-Q', '1984', 568, 'R', '', 1, 1, '', 'D', '', '', '', '', '', 2, '2017-11-12 15:56:51', '0000-00-00 00:00:00', 0, '2017-11-12 15:20:19', 0, 'N', 'Y', NULL),
(2669, NULL, NULL, 'Night School (AKA School''s Out)', '1984', 13, 'B', '<p>Published in the "Virgin Computer Series" book Adventures for your BBC Micro by Alex Gollner as "Night School". The book contains the following description:</p>\r\n<blockquote>\r\n<p>Just when you thought you had the school computer to yourself an underling of the headmaster calls you to his office. He accuses you of programming the computer system to randomly print smutty language on the terminals while the first years were having an Information Technology lesson.&nbsp; Although you are innocent your protestations fall on deaf ears. You are sentenced to a three-hour detention for the next three nights.</p>\r\n<p>As you have been a model pupil you have never stayed after school before &mdash; had you any inkling of what really went on at the school you would never have stayed until the end of the day. After dark your school undergoes a horrible transformation. Familiar objects turn nasty. Death stalks the school corridor. Will you escape with your life?</p>\r\n<p>Instructions are included in the program &mdash; your commands should be entered in lower case.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-10 21:22:11', '0000-00-00 00:00:00', 0, '2017-11-13 13:15:15', 0, 'N', 'Y', '0'),
(2670, NULL, NULL, 'Simon', '1983', 565, 'R', '', 1, 1, '', '', '', '', '', '', '', 2, '2017-11-12 16:00:57', '0000-00-00 00:00:00', 0, '2017-11-12 15:20:44', 0, 'N', 'Y', NULL),
(2671, NULL, NULL, 'Santa And The Snowman (AKA Santa And The Snowmen) (AKA Father Christmas vs The Snowman)', '1987', 525, 'M', '<p>Published in Micro User Magazine vol.5 issue 10 in December 1987</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-02-09 14:37:28', '0000-00-00 00:00:00', 0, '2019-11-16 19:11:41', 2, 'N', 'Y', '0'),
(2672, NULL, NULL, 'Pearl Diver', '1984', 13, 'B', '<p>Published in the "Virgin Computer Series" books "Adventures for your BBC Micro" by Alex Gollner.</p>\r\n<p>Based on a program written by Clive Gifford.</p>\r\n<p>The description inn the book reads:</p>\r\n<blockquote>\r\n<p>As you drain your last pint of the night at the pub you hear talk of pearls down in Bight cove. Disappointed with your meagre catch of fish in the straights of Dogger, you had come to the Seamen&rsquo;s Arms to drown your sorrows in ale. But this news of pearls has given you an aim &mdash; to go out early the next morning to see what you can find; who knows, you might return with a boatful of riches!</p>\r\n<p>When you arrive at the cove you must retrieve each oyster separately &mdash; the oysters are of such a size that you must collect them one by one. As you are only a poor fisherman you must make do with a small oxygen tank &mdash; enough just for 90 minutes of searching. Avoiding hazards costs time, but you may be lucky enough to find an old air tank on the sea bottom which will add a few extra minutes to your dwindling strength.</p>\r\n<p>In order to recover all five oysters you should map your journey through the deeps, or you may never see the sun again. The cove holds many dangers for the unwary diver . . . Good luck!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-09 20:28:37', '0000-00-00 00:00:00', 0, '2017-11-13 13:20:17', 0, 'N', 'Y', '0'),
(2673, NULL, NULL, 'Reversi', '1983', 504, 'M', 'Sold by Beebugsoft. First advertised in volume 2 issue 6 in November 1983.\r\n<br>Published in Elbug Magazine volume 1 issue 3 in January/February 1984.', 1, 1, '', '', '', '', 'VB1.1', '', '', 2, '2017-12-21 14:30:58', '0000-00-00 00:00:00', 0, '2017-11-12 15:21:35', 0, 'N', 'Y', '0'),
(2674, 2717, NULL, 'Snow Plough!', '1986', 1, 'M', '<p>Part of <a href="http://bbcmicro.co.uk/game.php?id=2717">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 4, issue 10) in December 1986.&nbsp;Note that Micro User had used the "Christmas Crackers" name before, for <a href="game.php?id=2785">a different compilation</a> first released in 1983.</p>\r\n<p>The 1986 compilation comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:15:49', '0000-00-00 00:00:00', 0, '2017-11-21 22:01:50', 0, 'N', 'Y', '0'),
(2675, NULL, NULL, 'Paras', '1984', 2, 'M', 'Published in the September 1984 issue of Acorn User. \r\n<br>Also given away free on the March 1986 Acorn User companion disc.', 1, 1, '', '', '', '', '', '', '', 2, '2017-11-24 10:22:58', '0000-00-00 00:00:00', 0, '2017-12-29 20:04:39', 2, 'N', 'Y', NULL),
(2676, NULL, 'The', 'Six Keys Of Tarkus (AKA The Seven Keys Of Tarkus)', '1984', 13, 'B', '<p>Published in the "Virgin Computer Series" books "Adventures for your BBC Micro" by Alex Gollner, which contains the following description:</p>\r\n<blockquote>\r\n<p>After many days of travel over the northern wastes, you have arrived at the mountains of Tarkus. Barren and windswept, these were once the home of a warrior race who perished long ago. The halls of Tarkus are your destination; there you must free an errant god&rsquo;s soul.</p>\r\n<p>Many years ago the people of Tarkus cast great and powerful spells over their kingdom to ward against the gods who wished to control their destiny. Once the Tarks had disappeared their land became the dungeon of the gods. Loki had angered Odin once too often &mdash; he had been taken to Tarkus by fighting men and locked inside a casket in the deepest room of the maze (the capital of Tarkus).</p>\r\n<p>Thousands of years later the gods decree that Loki has served his sentence and they choose you to be his liberator. You must go into their underground city and roam the labyrinth of chambers searching for the six keys that open Loki&rsquo;s box. Then you must find the hidden room and release Loki from his prison.</p>\r\n<p>A hint before you enter the halls of Tarkus: map your progress or you will lose your way and wander around Tarkus for ever! Good luck!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-09 20:15:50', '0000-00-00 00:00:00', 0, '2017-11-13 13:23:50', 0, 'N', 'Y', '0'),
(2677, NULL, NULL, 'Trouble In Paradise', '1984', 13, 'B', '<p>Published in the "Virgin Computer Series" book "Adventures for your BBC Micro" by Alex Gollner, which contains the following description:</p>\r\n<blockquote>\r\n<p>&lsquo;Z&rsquo; has sent you on your most deadly mission yet; as the Service&rsquo;s top agent you are the only one capable of handling the situation. You must go to your hotel room in Zakynthos and then discover what your mission is.</p>\r\n<p>This complicated adventure is set on the Greek island of Zante, where mysterious plots are afoot. If you do not act &lsquo;normally&rsquo; you will be found out immediately and shot as a spy. There are many red herrings; you must piece together the messages or you may end up dead. Watch your time and your strength closely &mdash; you will need both!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-10 21:25:58', '0000-00-00 00:00:00', 0, '2017-11-13 13:26:16', 0, 'N', 'Y', '0'),
(2678, NULL, NULL, 'Arcade Action', '1982', 599, 'R', '<p>This compilation comprises Invaders, Breakout, Dodgems, and Snake.</p>', 1, 1, '', '', '', '', 'V2.5', '', '', 2, '2019-10-28 09:19:19', '0000-00-00 00:00:00', 0, '2017-11-18 12:47:08', 0, 'Y', 'Y', '0'),
(2679, NULL, 'The', 'Magic Telephone (AKA The Magic Telephone Box) Part 1', '1986', 13, 'W', '<p>Please <a href="contact.php">contact us</a> if you have a copy of Part 2 of The Magic Telephone.</p>\r\n<p>A school favourite, Part 1 of The Magic Telephone was included on "MAPE Tape IV". <a href="https://stardot.org.uk/forums/viewtopic.php?f=7&amp;t=10924&amp;p=243112#p135001">More details</a> at Stardot.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-28 15:57:02', '2017-11-25 22:10:22', 2, '2017-11-25 22:14:17', 0, 'N', 'Y', '0'),
