(2696, NULL, NULL, 'Aircraft Landing Simulator (AKA Aircraft Lander)', '1983', 460, 'B', '<p>Originally authored by Paul Bailey for the Video Genie, and converted for the BBC Micro by James Byrne.</p>\r\n<p>The original Video Genie listing was published in Personal Computer World February 1983, and the "Summer 1983" issue 1 of Personal Computer Games magazine.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW Software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>Also Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> contained the following description:</p>\r\n<blockquote>\r\n<p>This program puts you in the position of a pilot faced with landing his aircraft safely on the airport runway. By using different control keys the plane has to be guided down at the right speed, and at the right time, to ensure safe arrival of all aboard.</p>\r\n<p>A continuous display provides a pilot''s eye view of the approaching runway. In addition, a number of instrument readings give essential details of such things as altitude, speed, direction, pitch, roll, and distance from the runway. Keys may be used to manoeuvre the aeroplane in terms of its speed, roll and pitch, the pilot''s efforts being reflected in the instrument readings. Realistic sound effects accompany the simulation, which will soon discover whether you can say with honesty "I''ll take good care of you!"</p>\r\n</blockquote>\r\n<p>The identical description was also contained in the book accompanying the <em>PCW Games Collection</em>, which also added the following:</p>\r\n<blockquote>\r\n<h3>Flying tips</h3>\r\n<p>The distance reading indicates the distance you are from the end of the runway. As the runway is 2000m long you must touch down when this reads 2000m or less. At touchdown, yaw speed must be between 45m/s and 55m/s. Your pitch and roll must be less than 3 degrees and since the runway is 100m wide, the deviation readout must be within +/- 150m. After touchdown, you can use the rudder to correct the direction of travel, and your brakes to slow down to zero.</p>\r\n<p>Your instruments give the following information:</p>\r\n<p style="padding-left: 30px;">SPEED airspeed in metres per second (m/s).<br />BEAR bearing is the direction in which yaw aircraft pointing: 0 = straight ahead, positive values to the right, negative to the left (in degrees).<br />PITCH negative values when the aircraft''s nose is pointing down, positive when up.<br />ROLL roll causes the banking to change, which alters the aircraft''s bearing; positive values clockwise, negative clockwise.<br />ALT height above ground in metres.<br />DIST distance from the far end of the runway in metres.<br />DEV sideways deviation from the centre of the runway.</p>\r\n<h3>Controls</h3>\r\n<p style="padding-left: 30px;">F = Roll to left<br />G = Maintain roll<br />H = Roll to fight<br />M = Nose up<br />K = Maintain pitch<br />O = Nose down<br />0-9 = Throttle control</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 17:04:59', '2017-12-04 20:44:04', 2, '2017-12-04 20:45:03', 0, 'N', 'Y', 'Y'),
