(2712, NULL, NULL, 'White Light', '2017', 3, 'P', '<p>An unofficial sequel to&nbsp;<a href="game.php?id=598">FireTrack</a>.</p>\r\n<p>The gameplay and style of the game is reminiscent of the 1984 arcade game&nbsp;<a href="https://www.youtube.com/watch?v=-JJPxRRjo_U">Star Force</a> from Tehkan.</p>\r\n<p><a href="http://www.retrosoftware.co.uk/wiki/index.php?title=White_Light">Release notes, dev diary, and more</a> at Retro Software.</p>', 1, 1, 'O', 'D', '', '', '', '', '', 2, '2019-06-10 11:01:59', '2017-12-12 13:05:24', 3, '2018-08-29 08:57:46', 2, 'N', 'Y', 'Y'),
