(2714, NULL, NULL, 'Lost Dutchman''s Gold', '1986', 13, 'P', '<p>Originally written by Teri Li in 1979. <br />Originally published by The Programmer''s Guild - then printed as a type-in listing for the TRS-80 in the July 1980 issue of SoftSide Magazine. <br />Ported to the BBC in 1986 by Franz and Marien Van Westen.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-08-14 22:59:44', '2017-12-28 11:40:49', 2, '2017-12-28 14:35:12', 2, 'N', 'Y', 'N'),
(2715, NULL, NULL, 'Temple Of Evil', '1985', 13, 'M', '<p>Published on the "Model B Computing" cassette number 9 in February/March 1985.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-08 20:02:27', '2017-12-28 11:44:09', 2, '2017-12-28 14:30:50', 2, 'N', 'Y', 'N'),
(2716, NULL, 'The', 'Oregon Trail', '1978', 13, 'M', '<p>Originally written by Don Rawitsch, Bill Heinemann, and Paul Dillenberger in 1971.</p>\r\n<p>This version is a port of the updated 1978 version which was published in the July/August issue of Creative Computing magazine.</p>\r\n<p>Ported to the BBC Micro by lurkio in 2017.</p>', 1, 1, '', '', '', '', 'B9', '', '', 2, '2019-03-19 18:28:31', '2017-12-28 13:43:48', 2, '2017-12-28 14:56:57', 2, 'N', 'Y', 'N'),
(2717, NULL, NULL, 'Christmas Crackers (Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, Name The Carol)', '1986', 599, 'R', '<p>First advertised for sale in Micro User magazine (volume 4, issue 10) in December 1986.&nbsp;Note that Micro User had used the "Christmas Crackers" name before, for <a href="game.php?id=2785">a different compilation</a> first released in 1983.</p>\r\n<p>The 1986 compilation comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 2, '', '', '', '', '', '', '', 2, '2018-10-29 17:41:44', '2017-12-28 15:14:46', 2, '2017-12-28 15:24:21', 2, 'N', 'Y', 'N'),
(2718, NULL, NULL, 'Acorn User One-Line Games (Escape From Voros, Lexxias, Race To Varpon, Storm Clouds Over Zaqqit, Zander (AKA Lurch))', '1987', 569, 'M', '<p>Published in the "Acorn Abuser''s Diary" section of Acorn User magazine between May and November of 1987, these games consist of a single line of BASIC code each. David Lawrence was credited as the author of the first game, which was retrospectively titled "Escape From Voros". Oscar Rune and Stan Froco were later named as the authors of Varpon and Lurch respectively, on the <a href="game.php?id=2757">Acorn User Games Disc</a>.</p>\r\n<p>The fifth game, Zander (a.k.a. Lurch), is a parody of the early Archimedes game Zarch (a.k.a. Lander). It''s extra-unplayable because it runs far too fast and you have to start hitting Return within the first second or you''ll <a href="https://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=14297&amp;p=190140&amp;hilit=crash+into+terrain#p190140">crash into terrain</a>.</p>\r\n<p>Escape From Voros: May 1987</p>\r\n<p>Lexxias: June 1987</p>\r\n<p>Race To Varpon: July 1987</p>\r\n<p>Storm Clouds Over Zaqqit: September 1987</p>\r\n<p>Zander (a.k.a. Lurch on the Acorn User Games Disc): November 1987</p>\r\n<p>Also note that Acorn User released another one-line game, titled Mastermind, which appeared on the <a href="game.php?id=2757">Acorn User Games Disc</a>. At time of writing, it is not known which issue (if any) of Acorn User the game appeared in.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-13 12:17:14', '2017-12-31 14:51:34', 2, '2017-12-31 14:52:31', 2, 'N', 'Y', 'N'),
(2719, NULL, NULL, 'Phoenix', '2017', 2, 'P', '<p>A conversion of <a href="https://en.wikipedia.org/wiki/Phoenix_(video_game)">the arcade game</a>.</p>\r\n<p><a href="http://www.retrosoftware.co.uk/forum/viewtopic.php?f=19&amp;t=909">More details</a>&nbsp;at Retro Software, and at&nbsp;<a href="http://www.stardot.org.uk/forums/viewtopic.php?f=57&amp;t=8416&amp;hilit=Phoenix">Stardot Forums.</a></p>', 1, 1, 'O', '', '', '', '', '', '', 3, '2019-01-21 21:20:46', '2018-01-02 14:57:29', 3, '2019-09-06 11:44:38', 2, 'N', 'Y', 'Y'),
(2720, NULL, NULL, 'RAM Wars', '1988', 656, 'M', '<p><span style="color: #333333; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px;"><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif;"><a href="http://www.stardot.org.uk/forums/viewtopic.php?f=32&amp;t=14334">More details</a></span></span>&nbsp;at Stardot.</p>\r\n<p>RAM Wars is a BBC Micro implementation of&nbsp;<a href="https://en.wikipedia.org/wiki/Core_War">Core War</a>.</p>\r\n<p>RAM Wars was published in The Micro User magazine, volume 5, issues 11 and 12, January and February 1988.</p>\r\n<p>Your Computer magazine published a version of this game in 1985 called <a href="game.php?id=3314">Core Wars</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-11-23 12:35:33', '2018-01-09 13:10:43', 3, '2018-03-08 13:21:05', 2, 'N', 'Y', 'Y'),
(2721, NULL, 'The', 'Revenge Of The Toothless Vampire', '1985', 13, 'M', '<p>Published in Games Computing magazine, issue 15, March 1985.</p>\r\n<p><a href="http://solutionarchive.com/game/id%2C445/">More details</a> at CASA.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-01-12 13:09:26', '2018-01-12 13:08:38', 3, '2018-03-08 13:21:25', 2, 'N', 'Y', '0'),
(2722, NULL, NULL, 'M25! (AKA M25 Adventure)', '19XX', 13, 'P', '<p>This is a 1 line game.</p>\r\n<p>A joke adventure where you have to turn off the M25...</p>\r\n<p>Published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 1.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-01-18 17:26:18', '2018-01-18 17:26:18', 2, '2018-01-18 17:27:05', 2, 'Y', 'Y', NULL),
