(2724, NULL, NULL, 'Mozaic Madness (AKA Tiles Puzzle)', '1991', 17, 'M', '<p>Published in Micro User Magazine vol.9 issue 8 in October 1991.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-01-22 13:15:11', '2018-01-22 12:34:23', 2, '2018-01-22 12:40:36', 2, 'N', 'Y', '0'),
(2725, NULL, NULL, 'Race Track (AKA Grand Prix)', '1984', 6, 'M', '<p>Published in Acorn Programs magazine December 1984. Issue 8.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-01-22 13:46:26', '2018-01-22 12:34:36', 2, '2018-01-22 12:40:55', 2, 'N', 'Y', '0'),
(2726, NULL, NULL, 'Robotank', '1984', 21, 'B', '<p>Originally authored by Bryn Phillips and converted to the BBC Micro by James Byrne</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collectio</a>n from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<blockquote>\r\n<p>Robotank is an original strategy game for the BBC Micro, The idea is to drive your tank around a battlefield, strewn with a number of targets. You have to destroy as many of them as possible in five missions.</p>\r\n<p>On starting the game the battlefield will be drawn, containing a number of targets including enemy tanks, huts and guns. Your Robotank will be placed at the bottom left of the screen.</p>\r\n<p>The idea of the game is to program the tank with a series of Logo style commands in order to destroy as many targets as possible. The available commands are:</p>\r\n<p style="padding-left: 30px;">F - Forward one length<br />R - Turn fight 90 degrees<br />L - Turn left 90 degrees<br />S - Shoot<br />P - Program complete - GO<br />D - Delete last instruction</p>\r\n<p>For example, the following simple program: FFFRSLFFS, would make the tank move forward three lengths, turn fight 90 degrees, shoot, ram left 90 degrees, move two lengths forward and shoot again.</p>\r\n<p>The maximum Robotank program is 40 commands, and once the tank has been started it cannot be stopped. If the tank crashes into any obstacles, the game will end; otherwise, you have five runs in which to destroy all the targets. The points value of the targets increases with each hit, so careful planning is required to achieve high scores.</p>\r\n</blockquote>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-04 16:23:40', '2018-01-22 12:34:51', 2, '2018-01-22 12:41:24', 2, 'N', 'Y', '0'),
(2727, NULL, NULL, 'Chocky Egg', '1984', 569, 'M', '<p>Published in issue 58 of Home Computing Weekly in April 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-01-22 13:29:52', '2018-01-22 12:35:05', 2, '2018-01-22 12:41:48', 2, 'N', 'Y', '0'),
(2728, NULL, NULL, 'Dragon Slayer', '1990', 36, 'M', '<p>Published on the Fast Access Disc vol. 2 issue 3 in 1990.</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2018-10-08 14:32:46', '2018-01-22 12:35:20', 2, '2018-10-12 11:49:45', 2, 'N', 'Y', '0'),
(2729, NULL, 'A', 'Day At The Races (AKA Race Day)', '1993', 497, 'M', '<p>Given away on the BBC Subscribers disc in Acorn Computing magazine (formerly The Micro User), volume 11, issue 8, in October 1993.</p>', 1, 10, '', '', '', '', '', '', '', 3, '2019-12-31 12:53:44', '2018-01-22 12:35:37', 2, '2019-12-30 18:15:57', 2, 'N', 'Y', '0'),
(2730, NULL, NULL, 'Target Practice', '1983', 2, 'B', '<p>Originally authored by Gordon Mills for the TRS-80 and published in Personal Computer World in January 1981. The program was converted for the BBC Micro by Leon Goodfriend.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The accompanying book contained the following description:</p>\r\n<blockquote>\r\n<p>This is a game for two players, in which the object is to obliterate 10 randomly placed targets with 15 missiles, the missile launcher moving across the bottom of the screen at variable speed.</p>\r\n<p>After providing their names, the players have to select the speed at which their missile launcher is to move: this can be anything from a gentle plod to a definite whoo-oosh! Missiles are launched by pressing a key; their journey towards the target and, with luck and skill, the eventual explosion, are accompanied by some realistic sound effects. A count of how many missiles each player has left is shown throughout.</p>\r\n</blockquote>', 2, 2, '', '', '', '', '', '', '', 2, '2019-05-10 17:16:16', '2018-01-22 12:35:54', 2, '2018-01-22 12:43:18', 2, 'N', 'Y', 'Y'),
(2731, NULL, NULL, 'Stunt Driver', '1984', 6, 'M', '<p>Published in Acorn Programs magazine June/July 1984. Issue 4.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-01-22 13:45:57', '2018-01-22 12:36:09', 2, '2018-01-22 12:43:44', 2, 'N', 'Y', '0'),
