(2734, NULL, NULL, 'Tea-Bag Terror (AKA Tea Bag Terror)', '2015', 1, 'P', '<p>Based on Money Maze by Roland Waddilove, which was published in Electron User magazine, volume 1, issue 9, in June 1984, and later released by Alternative Software on the Triple Decker 10 compilation.</p>', 1, 1, '', '', '', 'Y', '', '', '', 3, '2019-08-12 11:06:27', '2018-01-22 12:37:06', 2, '2018-01-22 12:45:00', 2, 'N', 'Y', '0'),
