(2737, NULL, NULL, '3D Pentominoes (AKA Polyominoes)', '1988', 17, 'M', '<p>Published in the October 1988 issue of Acorn User.</p>\r\n<p>The Acorn User Games Disc lists Don Scales as the author of the game. The listing credits David Lawrence "from an idea by Don Scales". It also names the game Polyominoes on the main menu.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-01-30 12:43:44', '2018-01-22 12:38:05', 2, '2018-01-22 12:46:17', 2, 'N', 'Y', '0'),
