(2755, NULL, NULL, 'Granny''s Garden', '1983', 405, 'R', '<p>People of a certain age may remember Granny''s Garden, Flowers of Crystal, Dragon World, and Box of Treasures from school in the 1980s.</p>\r\n<p>These games from 4Mation Software cannot be played online, or downloaded, as 4Mation still enforce copyright on their titles.</p>\r\n<p>Granny''s Garden is still for sale at&nbsp;<a href="http://www.4mation.co.uk/retro/retrogranny.html">4mation.co.uk</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-07-08 00:05:11', '2018-01-26 16:42:45', 2, NULL, 0, 'N', 'Y', '0'),
(2756, NULL, NULL, 'Bomber (AKA Beebug Bomber)', '1982', 2, 'M', '<p>Published in Beebug Magazine volume 1 issue 2 in May 1982.</p>', 1, 1, '', '', '', '', 'V1.1', '', '', 2, '2018-01-29 14:25:16', '2018-01-29 14:24:41', 2, '2018-03-06 11:37:02', 2, 'Y', 'Y', '0'),
(2757, NULL, NULL, 'Acorn User Games Disc', '1988', 599, 'R', '<p>This disc was first advertised for sale in Acorn User magazine in October 1988.</p>\r\n<p>It consists of previously published Acorn User games:&nbsp;<a href="game.php?id=2254">Warlord</a> (Peter Voke), <a href="game.php?id=738">Wizalon</a> (David Lawton), <a href="game.php?id=391">Run Silent, Run Deep</a> (Phil Martin), <a href="game.php?id=1207">Castle of Nightmares</a> (Mark de Weger), <a href="game.php?id=1077">Quadline</a> (David Acton), <a href="game.php?id=2737">3D Pentominoes (AKA Polyominoes)</a> (David Lawrence/Don Scales), <a href="game.php?id=2718">Race to Varpon</a> (Oscar Rune), <a href="game.php?id=1486">Maze</a> (David Lawrence), Mastermind (Orson Fact), and&nbsp;<a href="game.php?id=2718">Lurch</a> (Stan Froco).</p>\r\n<p>Orson Fact is a made-up name. It is an anagram of Stan Froco.</p>\r\n<p>All of the <a href="game.php?id=2718">one-line games</a> previously appeared in the Acorn User "Acorn Abuser''s Diary" section, but at time of writing it is not known which issue (if any) the Mastermind game was published in.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-13 14:45:50', '2018-01-30 12:28:38', 2, '2018-02-12 12:54:45', 2, 'N', 'Y', '0'),
(2758, NULL, NULL, 'Beeb Patience', '1983', 38, 'B', '<p>Originally authored by Richard Still for the Commodore PET and published in Personal Computer World in March 1983. The program was converted to the BBC Micro by Benny Notarianni.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The book accompanying the Best of PCW software for the BBC Micro contained the following description:</p>\r\n<blockquote>\r\n<p>The user plays a game of Patience on the screen. The object is to place each suit in ascending order on its respective pile.</p>\r\n<p>Instructions are displayed, then the main program is called. (It is not possible to look at the instructions again without rewinding the tape.) The single pack is laid out in the form of a ''Harp''. The cards may be moved from one column to another or new cards are dealt from the stack. As soon as an Ace becomes available, it may be used to start a file.</p>\r\n<p>No false moves or cheating are allowed! Perhaps a ''Cheat'' facility could be added for desperate players?</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-22 14:57:49', '2018-02-04 12:39:01', 2, '2018-10-12 11:50:24', 2, 'N', 'Y', '0'),
(2759, NULL, NULL, 'Tea-Bag Terror 2 (AKA Tea Bag Terror 2)', '2015', 11, 'P', '', 1, 1, '', '', '', 'Y', '', '', '', 2, '2018-02-07 12:48:12', '2018-02-04 12:47:15', 2, '2018-09-10 11:05:27', 2, 'N', 'Y', '0'),
