(2762, NULL, NULL, 'Crown Green (AKA Crown Green Bowls)', '1984', 519, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-02-09 14:51:37', '2018-02-04 13:12:54', 2, '2018-02-04 13:16:51', 2, 'N', 'Y', '0'),
