(2772, NULL, NULL, 'Master Spy (AKA MasterSpy)', '1984', 17, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-02-09 14:51:18', '2018-02-08 11:14:53', 2, '2018-02-08 11:35:45', 2, 'N', 'Y', '0'),
(2773, NULL, NULL, 'Convoy', '1983', 2, 'B', '<p>Originally authored by Jeff Aughton for the Commodore PET, and published in Personal COmputer World in January 1981. The program was converted for the BBC Micro by James Byrne.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<blockquote>\r\n<p>You are the commander of a large land-based gun which must be used to shell a convoy of submarines. The submarines are trying to find their way through some narrow straits and your task is to destroy them all before they escape your range. If you successfully destroy a fleet of subs, then you can go on to try your aim at larger convoys.</p>\r\n<p>You aim your gun by controlling its elevation and bearing. The elevation of your gun affects how far the shells travel, and the bearing affects their direction. Instructions on which keys are used to effect this control appear on the screen when the program is first run.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 17:08:25', '2018-02-08 11:15:36', 2, '2018-02-08 11:36:11', 2, 'N', 'Y', '0'),
