(2802, NULL, NULL, 'Adventure 200', '1982', 13, 'R', '<p>"OVER 200 PLACES to explore. Written in machine code and using advanced data compression techniques it squeezes a true fixed-map adventure into just 16K &ndash; all held in ram &ndash; no extra cassette reads or books of text. Unlike a randomly generated maze type game this is a real test of your tactical skill. It starts easy but the further you progress the more dangerous and difficult the problems become as you use objects around you to overcome obstacles and you are the hero! Flexible command format allows abbreviation multiple word lines." (<em>sic</em>)</p>\r\n<p>&nbsp;&nbsp;&nbsp;&mdash; <a href="https://archive.org/stream/ComputerAndVideoGamesIssue018Apr83/Computer_And_Video_Games_Issue_018_Apr_83#page/n110/mode/1up/">Advertisement</a> in Computer And Video Games magazine, issue 10, April 1983</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-12 10:51:38', '2018-02-19 21:30:46', 2, '2018-03-08 13:20:40', 2, 'Y', 'Y', '0'),
(2803, 366, NULL, 'Elite-A', '1997', 3, 'L', '<p>This is Angus Duggan''s enhancement of the <a href="game.php?id=366">original Elite</a> by Ian Bell and David Braben.&nbsp;<a href="http://knackered.knackered.org/angus/beeb/elite.html">Documentation</a>&nbsp;of the changes and enhancements is available.</p>\r\n<p>Permission to publish the mod was given in 1997.</p>\r\n<p>&nbsp;</p>', 1, 1, 'O', 'D', '', '', '', 'Elite', '4', 3, '2018-12-28 19:57:05', '2018-02-25 17:29:21', 2, '2018-02-25 17:33:34', 2, 'N', 'Y', '0'),
