(2827, NULL, NULL, 'Minefield (AKA Mines!)', '1984', 1, 'M', '<p>Published in "Big K." magazine issue 5 in August 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-06 17:09:47', '2018-03-06 11:47:35', 2, '2018-03-06 17:43:49', 2, 'N', 'Y', '0'),
(2828, NULL, NULL, 'Sevens', '1984', 38, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>\r\n<p>The game later appeared as part of <a href="game.php?id=2018">9 Classic Card And Board Games No. 2</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-05 11:43:40', '2018-03-06 11:49:08', 2, '2018-03-06 17:44:30', 2, 'N', 'Y', '0'),
(2829, NULL, NULL, 'Klingon''s Revenge', '1984', 550, 'M', '<p>Published on the "Model B Computing" cassette number 7 in October 1984.</p>', 1, 1, '', '', '', '', '', 'Model B Computing Cassette', '07', 2, '2018-03-06 17:15:57', '2018-03-06 11:50:36', 2, '2018-10-15 18:01:43', 2, 'N', 'Y', '0'),
(2830, NULL, NULL, 'Victorian Peg (AKA All Change)', '1985', 498, 'M', '<p>Published in issue 118 of Home Computing Weekly in June 1985.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-06 17:19:37', '2018-03-06 11:51:47', 2, '2018-03-06 17:44:52', 2, 'N', 'Y', '0'),
(2831, 1423, NULL, '3D Noughts & Crosses', '1982', 34, 'M', '<p>This is an early version (V1) of the game.</p>\r\n<p>The listing was published in Beebug magazine, volume 1, issue 1, in April 1982. Also sold by Beebugsoft along with <a href="game.php?id=2568">Moon Lander</a>, as Games 2. First advertised in volume 1, issue 4, although it may have been advertised on a separate leaflet slightly earlier.&nbsp;Later published on the Elbug magazine introductory cassette in 1983.&nbsp;First advertised in Elbug, volume 1, issue 1, but available via the Orbit user group before this.</p>', 1, 2, '', '', '', '', 'V1', '', '', 3, '2019-08-13 13:33:35', '2018-03-07 11:30:04', 2, '2018-03-07 21:34:20', 2, 'N', 'Y', '0'),
(2832, 1158, NULL, 'City Bomber', '1991', 2, 'P', '<p>This is an alternative version of the game, that features a different loading screen.</p>\r\n<p>Published on the 8BS Public Domain disc 09 in February 1991. <br />Also published on the Micro User Magazine subscribers disc vol.10 issue 1 in March 1992. (Credited to JJF PD).</p>\r\n<p>Published on the BBC PD Disc 15.</p>\r\n<p>Later published on the Electron User Group PD Disc 45 in September 1999.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-12 09:35:46', '2018-03-07 11:30:21', 2, '2018-03-07 21:34:43', 2, 'N', 'Y', '0'),
(2833, 478, NULL, 'Evil Invaders [hack] (AKA IJK Invaders)', '2000', 454, 'L', '<p>This is a modified version of IJK Software''s Model B version of&nbsp;<a href="game.php?id=478">IJK Invaders</a> Originally written by P.B. Cridland.</p>\r\n<p>It was modified by D.G. Beardsmore in the year 2000.</p>\r\n<p><span style="color: #333333; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px;">Also published on the 8BS Public Domain disc TBI-178</span></p>\r\n<p><span style="color: #333333; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px;"><strong>Note:</strong> In the original release of this game, the author''s surname appears as Bearsmore. He has contacted us to say he somehow managed to mis-spell his own name! It is in fact Beardsmore.</span></p>\r\n<p><span style="color: #333333; font-family: Helvetica Neue, Helvetica, Arial, sans-serif;">Daniel BEARDSMORE kindly provided us with an updated disc image.&nbsp;</span></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-24 22:00:59', '2018-03-07 11:30:38', 2, '2019-06-24 17:43:17', 2, 'N', 'Y', '0'),
(2834, 10, NULL, 'Monstas - The Upgrade For Monsters [hack]', '1984', 4, 'L', '<p>Extra levels and extra features for the classic <a href="game.php?id=10">Monsters</a></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-01 18:12:47', '2018-03-07 11:30:57', 2, '2018-03-07 21:35:25', 2, 'N', 'Y', '0'),
(2835, 45, NULL, 'Moon Raider', '1983', 3, 'R', '<p>This is the Electron version of the game, that has a different screen layout to the BBC Micro version.</p>\r\n<p>Moon Raider was included on the Acorn Electron version of "Play It Again Sam 05" in place of Fortress.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2018-11-26 21:45:57', '2018-03-07 11:31:17', 2, '2018-03-07 21:35:45', 2, 'N', 'Y', '0'),
(2836, 1828, NULL, 'Mr. Miner', '1987', 466, 'L', '<p>This is a re-coded, faster version of&nbsp;<a href="game.php?id=1828">Mr. Miner</a> that was originally published in Electron User magazine volume 4, issue 12 in September 1987.</p>\r\n<p>Re-coded by Richard Dimond, and published on the Electron User Group PD Disc 23 in December 1995.</p>', 1, 1, '', 'D', '', 'Y', '', '', '', 2, '2018-10-10 22:36:33', '2018-03-07 11:31:31', 2, '2018-09-13 09:13:42', 2, 'N', 'Y', '0'),
(2837, 4, NULL, 'Painter (AKA Demon Decorator)', '1983', 1, 'R', '<p style="text-align: left;">This is an early version of the game. It was&nbsp; later re-titled&nbsp;<a href="game.php?id=4">Demon Decorator</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-24 16:11:26', '2018-03-07 11:31:56', 2, '2018-08-17 14:19:23', 2, 'N', 'Y', '0'),
(2838, 576, 'The', 'Train Game ''91', '1991', 21, 'M', '<p>This is an updated, completely re-written version of the original Train Game by Peter Balch, that was published in the January 1984 issue of Acorn User.</p>\r\n<p>This new updated version was written by Dave Lawrence, and was published in the October 1991 issue.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-07 21:17:32', '2018-03-07 11:32:25', 2, '2018-03-07 21:37:27', 2, 'N', 'Y', '0'),
(2839, 1815, NULL, 'U.S. Invaders (AKA US Invaders) (AKA U.S.S. Endeavour) (AKA USS Endeavour)', '1986', 454, 'L', '<p>This is an alternative version of&nbsp;<a href="game.php?id=1815">U.S.S. Endeavour</a> which was published in Micro User Magazine vol.3 issue 12 in February 1986</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-19 16:21:18', '2018-03-07 11:32:53', 2, '2018-03-07 21:37:57', 2, 'N', 'Y', '0'),
(2840, 759, NULL, 'Wall ''Em In (AKA Brick ''Em In)', '1982', 1, 'R', '<p>This is an alternative version of "Brick ''Em In" from Software For All.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-08 12:57:39', '2018-03-07 11:33:25', 2, '2018-03-07 21:38:16', 2, 'N', 'Y', '0'),
(2841, 290, NULL, 'Citadel Item Randomiser', '2018', 5, 'L', '<p>Breathes new life into the classic&nbsp;<a href="game.php?id=290">Citadel</a>&nbsp;by randomising the locations of objects in the game.&nbsp;</p>\r\n<p><a href="http://www.stardot.org.uk/forums/viewtopic.php?f=1&amp;t=14318">More details</a> at Stardot.</p>', 1, 1, 'O', '', '', '', '', '', '', 3, '2019-12-26 15:29:27', '2018-03-11 23:39:41', 3, '2018-08-29 08:52:48', 2, 'N', 'Y', '0'),
(2842, NULL, NULL, 'Sugar Smash', '2016', 17, 'P', '<p>"A BBC Micro game in the confection destruction tradition, released at Sundown 2016."</p>\r\n<p><a href="http://web.archive.org/web/20181224005333/http://crtc.tv/">More details</a> at CRTC.</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-12 11:03:42', '2018-03-31 02:43:13', 3, '2018-08-29 08:56:59', 2, 'N', 'N', 'Y'),
(2843, NULL, NULL, 'Prince of Persia', '2018', 5, 'P', '<p><a href="https://en.wikipedia.org/wiki/Prince_of_Persia">Prince of Persia</a> was originally created in the 1980s by Jordan Mechner for the Apple II, with music composed by Francis Mechner.</p>\r\n<p>The game was ported to the BBC Master in 2018 by Kieran Connell et al.</p>\r\n<p><a href="https://bitshifters.github.io/posts/prods/bs-pop-beeb.html">More details</a> at Bitshifters.</p>\r\n<p>&nbsp;</p>', 1, 1, '', 'D', '', '', '', '', '', 3, '2018-04-01 12:51:25', '2018-03-31 15:06:02', 3, '2019-03-10 18:08:02', 2, 'N', 'N', 'Y'),
(2844, NULL, NULL, 'Magic Castle', '2012', 13, 'P', '<p>Originally written by Graeme Yeandle, and published for the Sinclair Spectrum by Gilsoft International in 1983.</p>\r\n<p>Ported to the BBC Micro in 2012 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="https://solutionarchive.com/game/id%2C342/Magic+Castle.html">here</a> and <a href="http://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=5318">here.</a></p>', 1, 1, '', 'T', '', '', '', '', '', 2, '2018-04-01 12:34:15', '2018-04-01 12:23:09', 2, '2018-04-01 12:32:57', 2, 'N', 'Y', '0'),
(2845, NULL, NULL, 'Subsunk', '2012', 13, 'P', '<p>Originally written by Peter Torrance and C. Liddle, and published for the Sinclair Spectrum by Firebird Software in 1985.</p>\r\n<p>Ported to the BBC Micro in 2012 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="https://solutionarchive.com/game/id%2C524/Subsunk.html">here</a> and <a href="http://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=5288">here.</a></p>', 1, 1, '', 'T', '', '', '', '', '', 2, '2018-04-01 13:01:24', '2018-04-01 12:37:27', 2, '2018-04-01 12:46:33', 2, 'N', 'Y', '0'),
(2846, NULL, '', 'Maze Of Madness', '2018', 13, 'P', '<p>A solvable demo of a very cruel puzzle idea.</p>\r\n<p>More details <a href="http://solutionarchive.com/game/id%2C7659/Maze+of+Madness.html">at CASA</a>, <a href="http://www.stardot.org.uk/forums/viewtopic.php?f=57&amp;t=14871&amp;p=199409#p199364">at Stardot</a>, at <a href="https://ahopeful.wordpress.com/2018/04/24/maze-of-madness-2018-a-torment/">Retroactive Fiction</a>, and at <a href="http://ifdb.tads.org/viewgame?id=qffy5phbtkpgxkia">IFDB</a>.</p>', 1, 1, '', '', '', '', '1.2', '', '', 3, '2019-07-17 19:25:11', '2018-04-16 22:08:10', 3, '2020-01-03 19:15:06', 3, 'N', 'Y', '0'),
(2847, NULL, '', 'Darkside (AKA Dark Side)', '1990', 454, 'U', '', 1, 1, '', '', '', '', '', '', '', 2, '2018-04-18 09:29:25', '2018-04-18 09:26:46', 2, '2018-04-18 09:27:24', 2, 'N', 'Y', '0'),
(2848, NULL, '', 'Eternity', '2000', 17, 'P', '<p>Based on the <a href="https://en.m.wikipedia.org/wiki/Eternity_puzzle">Eternity</a>&nbsp;puzzle of the same name. Famous for its million pound prize give-away.</p>\r\n<p>Published on the Electron User Group PD Disc 55 in December 2000.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-10 19:03:05', '2018-04-18 09:34:18', 2, '2018-08-13 10:23:21', 2, 'N', 'Y', '0'),
(2849, NULL, '', 'Klacz', '1990', 17, 'P', '<p>Published on BBC PD Disc "Games#5".</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-04-18 09:40:48', '2018-04-18 09:39:24', 2, '2018-10-15 18:01:27', 2, 'N', 'Y', '0'),
(2850, NULL, '', 'Centipede', '2018', 2, 'P', '<p>A conversion of&nbsp;<a href="https://en.wikipedia.org/wiki/Centipede_(video_game)">the arcade game</a>. More details at <a href="http://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=13819">Stardot Forums</a>.</p>\r\n<p>&nbsp;</p>', 1, 1, 'O', 'D', '', '', '', '', '', 3, '2019-01-21 21:17:27', '2018-05-02 08:25:57', 2, '2018-08-13 10:22:48', 2, 'N', 'Y', 'Y'),
(2851, 88, '', 'Tarzan Boy [hack] (AKA Tarzan)', '1984', 4, 'L', '<p>This is the BBC version of <a href="game.php?id=88">Tarzan</a> but with the Electron version of the loader, which called the game Tarzan Boy instead of Tarzan.</p>', 1, 1, 'O', '', '', '', '', '', '', 2, '2018-06-18 13:36:26', '2018-05-02 13:20:07', 2, '2018-06-18 13:25:04', 2, 'N', 'Y', '0'),
(2852, NULL, '', 'Block Slider', '1985', 17, 'M', '<p>Published on the Electron Computing issue 4 cassette in November 1985.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2018-05-02 14:03:44', '2018-05-02 13:20:28', 2, '2018-05-02 14:32:50', 2, 'N', 'Y', '0'),
(2853, 3013, '', 'Break-Up', '1982', 18, 'R', '<p>Featured on a 3 game compilation "Games Pack 1".</p>\r\n<p>The games included were: <a href="game.php?id=2853">Break-Up</a>, <a href="game.php?id=1308">Robot</a>, and <a href="game.php?id=2863">Spacefight</a></p>\r\n<p>See also: <a href="game.php?id=3013">Breakthrough</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-22 13:41:21', '2018-05-02 13:20:44', 2, '2018-05-02 14:33:14', 2, 'N', 'Y', '0'),
(2854, NULL, '', 'City Bomber', '1984', 2, 'M', '<p>Published in Acorn Programs magazine June/July 1984. Issue 4.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-05-02 14:30:07', '2018-05-02 13:21:02', 2, '2018-05-02 14:33:45', 2, 'N', 'Y', '0'),
