(2862, NULL, '', 'Yams', '1984', 145, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>', 2, 4, '', '', '', '', '', '', '', 2, '2018-05-02 14:19:15', '2018-05-02 13:23:14', 2, '2018-05-02 14:37:33', 2, 'N', 'Y', '0'),
(2863, NULL, '', 'Spacefight', '1982', 21, 'R', '<p>Featured on a 3 game compilation "Games Pack 1".</p>\r\n<p>The games included were: <a href="game.php?id=2853">Break-Up</a>, <a href="game.php?id=1308">Robot</a>, and <a href="game.php?id=2863">Spacefight</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-19 16:46:04', '2018-06-02 10:24:53', 2, '2018-06-02 15:26:06', 2, 'N', 'Y', '0'),
(2864, 667, '', 'Anarchy Zone [hack] (Fast Loader)', '1988', 454, 'L', '<p>This hacked version of&nbsp;<a href="game.php?id=667">Anarchy Zone</a> has a faster loading routine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-19 16:00:10', '2018-06-18 13:31:35', 2, '2018-10-15 15:36:03', 2, 'N', 'Y', '0'),
(2865, 25, '', 'Chuckie Egg [hack] (Extra Colours)', '2005', 4, 'L', '<p>This is a hacked verion of Doug Anderson''s <a href="game.php?id=25">Chuckie Egg</a> that shows more colours on screen.</p>\r\n<p>The modification was made by Rich Talbot-Watkins in 2005. See <a href="https://stardot.org.uk/forums/viewtopic.php?f=1&amp;t=586&amp;hilit=extra+colours">this thread</a> on Stardot forums.</p>', 1, 4, '', '', '', '', 'Unofficial release', '', '', 3, '2018-11-10 14:28:40', '2018-06-18 13:45:27', 2, '2019-09-06 11:22:37', 2, 'N', 'Y', '0'),
(2866, 1538, '', 'Down Fall (AKA Downfall) (AKA Invasion) (AKA Invasion Of The Aliens)', '1983', 454, 'M', '<p>Published in Beebug Magazine volume 2 issue 1 in April 1983. Listed as "Invasion".<br />Published in Elbug Magazine volume 1 issue 5 in April 1984. Listed as "Invasion of the Aliens".</p>\r\n<p>Published in Big K magazine issue 1 in April 1984. Listed as "Downfall".</p>\r\n<p>Please note that in April 1983, Beebug magazine lists the author of the game as Alan Webster. The April 1984 edition of Elbug lists the author as Alan Webster, but in April 1984, "Big K" magazine has the listing credited to "Jonathan Adams".</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-07-09 00:31:00', '2018-06-18 13:52:01', 2, '2018-06-18 13:52:53', 2, 'Y', 'Y', '0'),
(2867, 894, '', 'Helter Skelter (Tape version)', '1990', 569, 'R', '<p>This is the tape version of <a href="game.php?id=894">Helter Skelter</a> and features a different loading screen.</p>', 1, 2, '', 'D', '', '', '', '', '', 2, '2018-06-19 16:56:37', '2018-06-18 14:12:24', 2, '2018-10-15 15:36:35', 2, 'N', 'Y', '0'),
(2868, 114, '', 'Galaxy Wars [pre-release]', '1982', 454, 'U', '<p>This is an early, or pre-release version of <a href="game.php?id=114">Galaxy Wars</a></p>', 1, 1, 'O', '', '', '', '', '', '', 2, '2018-06-20 16:20:20', '2018-06-18 14:19:27', 2, '2018-06-18 14:20:47', 2, 'N', 'Y', '0'),
(2869, NULL, '', 'Labyrinth', '1984', 1, 'R', '<p>Some players experienced weird effects on their <a href="https://en.wikipedia.org/wiki/Cathode_ray_tube">CRT</a> screens with Labyrinth&nbsp;from Acornsoft.&nbsp;This version of the game has been slightly tweaked to make the display more forgiving for some CRT monitors/TVs.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-09-23 14:52:33', '2018-06-18 14:24:13', 2, '2018-08-24 17:24:29', 2, 'N', 'Y', '0'),
