(2874, NULL, '', 'Welcome Tape / Welcome Disc', '1981', 599, 'R', '<p>This is the disc version of the Welcome package that came with the BBC Micro.</p>\r\n<p>It is a collection of simple utility programs and games, which demonstrate various features of the computer.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-20 17:14:39', '2018-06-25 14:39:06', 2, '2018-08-29 08:57:23', 2, 'Y', 'Y', '0'),
(2875, 2874, '', 'Adventure (BBC Master Welcome Disc)', '1986', 13, 'R', '<p>This adventure appeared on the Welcome tape/disc for the BBC Master 128.</p>\r\n<p>It has been altered to run in Mode 7 so it will work on a standard BBC Model B as well as a Master.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-20 17:13:42', '2018-06-25 14:55:55', 2, '2018-06-25 14:56:47', 2, 'N', 'Y', 'Y'),
