(2879, NULL, '', 'Beebug One-Line Games (Asterisk Tracker; a Truffle Hunt clone; and a treasure hunt)', '1984', 569, 'M', '<p>These three one-line games were published in issue 7, volume 3, of Beebug magazine in December 1984. The source-code for each game consists of a single line of (<a href="https://archive.org/stream/BBCUG/BBCMUG#page/n485/mode/2up">abbreviated</a>) BBC BASIC.</p>\r\n<p>Published in Elbug magazine, volume 2, issue 2, in December 1984.</p>\r\n<p>More details <a href="https://stardot.org.uk/forums/viewtopic.php?f=2&amp;t=15319#p207744">at Stardot</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-13 12:07:34', '2018-07-05 23:12:52', 3, '2018-08-29 08:52:27', 2, 'Y', 'Y', '0'),
(2880, NULL, '', 'Bee Beater (AKA Beebeater) (AKA Gobble The Goodies)', '1983', 1, 'R', '', 1, 1, 'O', '', '', '', '', '', '', 2, '2018-08-29 20:49:55', '2018-07-27 18:47:26', 3, '2018-08-29 08:52:05', 2, 'N', 'Y', '0'),
(2881, NULL, '', 'One Room (AKA Oneroom)', '1983', 13, 'B', '<p>One Room might be the first room-escape game. It might even be the first one-room text adventure game. What''s certain is that it was written in 32K Extended Color BASIC for the TRS-80 Color Computer and published in the <a href="https://archive.org/stream/RainbowBookAdventures/Rainbow%20Book%20Adventures#page/n59/mode/2up">Rainbow Book Of Adventures</a> in 1983.&nbsp;</p>\r\n<p>The game was ported to BBC BASIC for the BBC Micro computer in 2018.</p>\r\n<p>More details on&nbsp;<a href="https://www.youtube.com/watch?v=FuJQqBVZGnw">YouTube</a>, at&nbsp;<a href="https://ahopeful.wordpress.com/2018/08/10/one-room-1983-the-first-one-room-game/">Retroactive Fiction</a>, at&nbsp;<a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=15340&amp;p=208505&amp;hilit=one%20room#p208505">Stardot</a>, at&nbsp;<a href="http://ifdb.tads.org/viewgame?id=8mby8zffji4ah3di">IFDB</a>, at&nbsp;<a href="http://solutionarchive.com/game/id%2C7761/One+Room.html">CASA</a>, and at&nbsp;<a href="https://www.intfiction.org/forum/viewtopic.php?f=4&amp;t=26431#p142646">IntFiction.org</a>.&nbsp;</p>', 1, 1, '', '', '', '', 'B23', '', '', 3, '2019-12-31 12:59:17', '2018-08-10 17:08:10', 3, '2019-12-31 12:50:16', 3, 'N', 'Y', 'Y'),
(2882, 96, '', 'Frak!', '1986', 4, 'R', '<p>This is the original Acorn Electron version of Frak from Aardvark Software.</p>', 1, 1, '', 'T', '', 'Y', 'V2.1', '', '', 2, '2018-09-11 16:03:32', '2018-08-26 10:19:44', 2, '2018-09-13 15:29:05', 2, 'N', 'Y', '0'),
(2883, NULL, '', 'Lighthouse Adventure', '1983', 13, 'B', '<p>Lighthouse adventure is a text adventure game written in BASIC for the TRS-80 Color Computer. It was published in the <a href="https://archive.org/stream/RainbowBookAdventures/Rainbow%20Book%20Adventures#page/n23/mode/2up">Rainbow Book Of Adventures</a> in 1983.&nbsp;</p>\r\n<p>The game was <a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=15340&amp;p=213068#p212560">ported</a> to BBC BASIC for the BBC Micro computer in 2018.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>In the late 1700''s an old English ship carrying jewels and gold was seized by pirates in a violent storm. The crew, weak and sick from the long journey, could not properly defend the ship and her invaluable cargo. The pirates killed everyone on board and set sail for America.</p>\r\n<p>&nbsp; Months later, they arrived off the coast of a New England peninsula and smuggled the priceless gold on shore. They quickly found a hiding place for the treasure. According to the legend, no one ever found the smugglers or the treasure, but most people believe the gold is located in or near the lighthouse. Over the years, many have tried unsuccsessfully to find the legendary gold, but either quit, or died in the quest.</p>\r\n<p>&nbsp; This exciting adventure leads you on a magical hunt to find the smugglers hideout, take the treasure and make your getaway. You will encounter many tips along the journey, and here''s a helpful one before you begin: The British call it a "trolley", but in America, we call it a "dolly".</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2020-01-03 11:33:19', '2018-08-27 11:25:02', 2, '2020-01-02 18:36:26', 3, 'N', 'Y', '0'),
(2884, NULL, '', 'Tea Shop (AKA Teashop)', '1983', 496, 'W', '', 1, 4, '', '', '', '', '', '', '', 3, '2019-06-30 11:52:44', '2018-08-30 21:28:40', 2, '2018-08-30 21:30:52', 2, 'N', 'Y', '0'),
(2885, NULL, '', '8-Bit Software One-Line Games', '1993', 569, 'P', '<p>All of these games were released by 8-Bit Software in 1993-1994.&nbsp;The original dates of the various programs are not known.</p>\r\n<p>The game Short also appeared on the Acorn Computing cover disc for volume 11, issue 7, in September 1993.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-13 12:15:58', '2018-08-31 13:36:21', 2, '2018-08-31 13:39:09', 2, 'N', 'Y', '0'),
(2886, NULL, '', 'Space Grab', '2016', 11, 'P', '<p>According to in-game text, the game was inspired by <a href="https://en.wikipedia.org/wiki/Fast_Food_(1982_video_game)">Fast Food</a> on the Atari 2600.</p>', 1, 1, '', '', '', 'Y', '', '', '', 3, '2019-08-12 11:01:24', '2018-09-03 17:34:16', 2, '2018-09-03 17:35:08', 2, 'N', 'Y', '0'),
(2887, NULL, '', 'Under The Mortuary', '1986', 5, 'M', '<p>Published over four issues of Popular Computing Weekly magazine: volume 5, issues 6, 7, 8, and 9 (February 6th, 13th, 20th, and 27th, 1986).</p>\r\n<p>In <a href="https://www.linkedin.com/in/suniljagota/">his LinkedIn profile</a>, the author Sunil Jagota says, "I wrote my first flight simulator at the age of 14 and had written and published my first arcade adventure game written in 6502 machine code by the time I was 15. I am still just as passionate about technology as I was then."</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-09-05 19:13:10', '2018-09-03 17:34:28', 2, '2018-09-03 17:36:06', 2, 'N', 'Y', 'N'),
(2888, NULL, '', 'Demo Adventure (From The Computer & Video Games Book Of Adventure)', '1983', 13, 'B', '<p>This listing is found in <em>The Computer &amp; Video Games Book of Adventure</em> published by <em>Melbourne House</em> in 1983.</p>\r\n<p>The original listing was buggy. This version has been fixed.</p>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-06 00:50:00', '2018-09-04 13:25:00', 2, '2018-09-04 13:25:51', 2, 'N', 'Y', '0'),
