(2894, NULL, '', 'Which-Way', '1984', 31, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-09-05 19:37:58', '2018-09-05 19:34:00', 2, '2018-09-05 19:34:57', 2, 'N', 'Y', '0'),
(2895, NULL, '', 'Frak! [hack]', '1989', 4, 'L', '<p>This is a modification of the original Acorn Electron version of Aardvark Software''s Frak.&nbsp;This hack from 1989 gives the player many ways to cheat!&nbsp;The cheats come from the commercially releases Cheat It Again Joe 4 disc, sold by Zentrix Software. (The first three Cheat It Again Joe cheat compilations were published by Impact Software.) All the Cheat It Again Joe tapes and discs were the brainchild of Mark Gidley.</p>', 1, 1, '', 'T', '', 'Y', '', '', '', 3, '2020-01-02 14:15:43', '2018-09-11 16:03:06', 2, '2018-09-13 15:26:00', 2, 'N', 'Y', '0'),
(2896, NULL, '', 'Silverton House', '1985', 13, 'B', '<p>Silverton House is a text adventure game written in BASIC for the TRS-80 Color Computer. It was published in the <a href="https://archive.org/stream/secondrainbowboo00char#page/n219">Second Rainbow Book Of Adventures</a> in 1985.&nbsp;</p>\r\n<p>The game was <a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=15666&amp;p=214278&amp;hilit=silverton#p214278">ported</a> to BBC BASIC for the BBC Micro computer in 2018.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-14 09:03:42', '2018-09-12 17:53:08', 2, '2018-09-12 17:57:57', 2, 'N', 'Y', '0'),
(2897, NULL, '', 'Mystery Of The Java Star', '1984', 13, 'R', '<p>See EveryGameGoing.com for&nbsp;<a href="http://www.everygamegoing.com/egg/landingItem/index/machine_type_group_default_folder/electron/publisher_folder/shards/format_folder/tapes/item_title/Mystery-Of-The-Java-Star">instructions and more</a>.</p>\r\n<p>Mystery Of The Java Star is only compatible with machines that have PAGE set at &amp;E00, such as a BBC Master 128.</p>\r\n<p>(The BBC Micro version of the game was originally released on cassette-tape. It <em>can''t</em> easily be run on&nbsp;floppy disc with a standard BBC Micro Model B. <a href="https://stardot.org.uk/forums/viewtopic.php?f=1&amp;t=15714&amp;p=215389#p215251">More details</a> at Stardot.)</p>', 1, 1, '', 'D', '', '', '', '', '', 3, '2019-08-04 23:40:19', '2018-09-24 09:45:18', 2, '2018-10-12 20:54:36', 1, 'N', 'N', 'Y'),
