(2911, 2717, '', 'Jet-Pack Santa (AKA Jet Set Santa)', '1986', 4, 'R', '<p>Part of <a href="http://bbcmicro.co.uk/game.php?id=2717">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 4, issue 10) in December 1986.&nbsp;Note that Micro User had used the "Christmas Crackers" name before, for <a href="game.php?id=2785">a different compilation</a> first released in 1983.</p>\r\n<p>The 1986 compilation comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:15:06', '2018-10-01 11:17:27', 2, '2018-10-06 10:59:58', 2, 'N', 'Y', '0'),
