(2945, 25, '', 'Chuckie Cheat (AKA Chuckie Egg II) (AKA Chuckie Egg 2) [hack]', '1984', 4, 'L', '<p>Extra levels for the classic <a href="game.php?id=25">Chuckie Egg</a>.</p>', 1, 4, '', '', '', '', 'Unofficial release', '', '', 3, '2019-08-12 09:12:56', '2018-11-01 17:03:39', 2, '2019-08-09 22:25:32', 2, 'N', 'Y', '0'),
(2946, 25, '', 'Chuckie Egg Professional Edition (AKA Chuckie Egg 2010) [hack]', '2010', 4, 'L', '<p>Extra levels and extra features for the classic <a href="game.php?id=25">Chuckie Egg</a>.</p>\r\n<p>This version of the game is a combination of <a href="index.php?search=chuckie+egg&amp;sort=b">various</a> patches and hacks, plus joystick support by Pitfall Jones.</p>', 1, 4, 'O', '', '', '', '', '', '', 3, '2019-12-26 15:27:27', '2018-11-01 18:27:07', 2, '2018-11-01 18:31:43', 2, 'N', 'Y', '0'),
(2947, NULL, '', 'Ludo', '1987', 518, 'M', '<p>Published in Micro User Magazine vol.5 issue 3 in May 1987</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-11-12 16:53:11', '2018-11-12 16:51:10', 2, '2019-11-29 22:16:20', 2, 'N', 'Y', '0'),
(2948, NULL, '', 'Goldmine (AKA Gold Mine)', '1985', 21, 'M', '<p>Published in issue 27 of Input magazine. Page 830.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-12 16:58:19', '2018-11-12 16:56:43', 2, '2018-11-12 16:57:21', 2, 'N', 'Y', '0'),
