(2950, NULL, '', 'Fisherman Fred', '1984', 487, 'M', '<p>Published in Games Computing magazine, issue 1, January 1984. Corrections to the listing were printed in issue 3, March 1984.</p>', 1, 1, '', '', '', '', 'V4', '', '', 2, '2019-06-24 22:30:15', '2018-11-12 17:08:22', 2, '2019-06-20 17:20:36', 2, 'N', 'Y', '0'),
(2951, NULL, '', 'Patience', '1984', 38, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>\r\n<p>The game later appeared as part of <a href="game.php?id=2017">9 Classic Card And Board Games No. 1</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-09 08:53:26', '2018-11-12 17:17:55', 2, '2018-11-12 17:18:33', 2, 'N', 'Y', '0'),
(2952, 25, '', 'Chuckie Egg 2009 (Level-editor) [hack]', '2009', 4, 'L', '<p>This is Dave Edwards''s original Acorn Electron release of Chuckie Egg 2009, which comes with eight new levels for the classic <a href="game.php?id=25">Chuckie Egg</a>. The new levels were designed with the included level-editor, which was also created by Dave Edwards. The level-editor is compatible with the BBC Master, but&nbsp;<em>not</em>&nbsp;with the Model B.</p>\r\n<p>Chuckie Egg 2009 was published on the 8BS public-domain disc TBI-185.</p>\r\n<p>The new levels (<em>without</em> the level-editor) were also published on the Electron User Group PD Disc 70 in 2009. They are available as&nbsp;<a href="game.php?id=1840">a standalone game</a>, which is compatible with the BBC Micro Model B.</p>', 1, 1, '', '', '', 'Y', '', '', '', 3, '2019-12-26 15:24:46', '2018-11-13 11:55:29', 3, '2018-11-13 12:07:25', 3, 'N', 'N', 'Y'),
(2953, NULL, '', 'Odd One Out', '1989', 29, 'M', '<p>Published in Micro User Magazine vol.7 issue 3 in May 1989</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-11-13 16:48:59', '2018-11-13 16:48:59', 2, '2019-11-29 22:16:40', 2, 'N', 'Y', NULL),
(2954, NULL, '', 'Serpents', '1983', 1, 'M', '<p>The game listing was published in the April 1983 issue of Personal Computing Today. Vol.1, No.9.</p>\r\n<p>It was later published in the winter 1983 issue of Personal Software magazine.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-05-10 10:30:40', '2018-11-13 17:12:27', 2, '2018-11-13 17:13:57', 2, 'N', 'Y', '0'),
(2955, NULL, '', 'Pentiles', '1983', 17, 'R', '<p>Alan Gray published a <a href="http://bbcmicro.co.uk/game.php?id=1376">similar game</a> in Beebug Magazine volume 11 issue 5 in October 1992.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-27 14:29:41', '2018-11-13 17:17:30', 2, '2018-11-13 17:18:09', 2, 'N', 'Y', '0'),
(2956, NULL, '', 'Simon (AKA Pattern Memory)', '1982', 565, 'M', '<p>Published in Your Computer Magazine volume 2 issue 10 in October 1982.</p>\r\n<p><strong>This game is very difficult to play on a modern keyboard because of the different layout of the cursor keys to those on a BBC Micro.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-13 17:28:43', '2018-11-13 17:27:02', 2, '2018-11-13 17:27:41', 2, 'N', 'Y', '0'),
(2957, NULL, 'The', 'Times Crossword Program: The Times Jubilee Puzzles 1932 to 1987', '1988', 17, 'R', '<p><a href="http://www.everygamegoing.com/egg/landingItem/index/machine_type_group_default_folder/electron/publisher_folder/akom/format_folder/3_5_discs/item_title/The-Times-Crosswords-Jubilee-Puzzles/">Full instructions</a> at EveryGameGoing.com.</p>\r\n<p>The crosswords themselves are copyright (c) News International PLC.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-12-03 16:35:49', '2018-11-19 19:34:23', 2, '2018-11-19 19:36:01', 2, 'N', 'Y', '0'),
