(2966, NULL, '', 'Traditional Board Games (Three Men''s Morris, Ba-Awa, Ming-Mang, Six Men''s Morris, Fox And Geese, Tablut)', '1984', 34, 'R', '<p>This was a compilation featuring 6 games:</p>\r\n<p>Three Men''s Morris, Ba-Awa, Ming-Mang, Six Men''s Morris, Fox And Geese, and Tablut.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-23 10:55:58', '2018-11-23 10:51:24', 2, '2018-11-23 10:51:59', 2, 'N', 'Y', '0'),
