(2968, NULL, '', 'Mornington Crescent', '1985', 21, 'M', '<p>Published in The Micro User magazine, volume 3, issue 2, in April 1985.</p>\r\n<p>More details at&nbsp;<a href="https://stardot.org.uk/forums/viewtopic.php?t=8436#p90689">Stardot</a> and at <a href="http://www.dirtyfeed.org/2015/04/acorn-fools-day/">Dirty Feed</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-11-28 20:53:21', '2018-11-28 17:57:30', 3, '2018-11-28 18:04:51', 3, 'N', 'Y', '0'),
(2969, NULL, '', 'Planet Nubium', '2018', 4, 'P', '<p><em>Everything on Planet Nubium &mdash; the weather, the economy, the transport systems, and a myriad of gadgets &mdash; is controlled by a supercomputer. But it&rsquo;s malfunctioning! You must negotiate levels and collect objects to make the password that reboots the machine. A rocket will propel your character upwards and gravity will pull you back down again. Avoid the guardians and keep an eye on the limited fuel. After collecting all the objects, return to the spaceship to advance to the next level.</em></p>\r\n<p>Planet Nubium is a new, original game for the BBC Master.&nbsp;<a href="https://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=15729#p215577">More details</a> at Stardot.</p>', 1, 1, '', '', '', '', '1.7', '', '', 3, '2019-10-02 14:11:20', '2018-11-30 13:52:24', 3, '2019-07-01 16:47:08', 2, 'N', 'N', 'Y'),
