(2974, NULL, '', 'Babysitter', '1984', 1, 'M', '<p>Published in Acorn Programs magazine June/July 1984. Issue 4.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-10 10:27:42', '2018-12-10 10:26:10', 2, '2018-12-10 10:28:21', 2, 'N', 'Y', '0'),
