(2976, NULL, '', 'Bomber (AKA Cavern Bomber)', '1984', 3, 'M', '<p>Published in "Big K." magazine issue 8 in November 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-10 10:37:24', '2018-12-10 10:36:53', 2, '2018-12-10 10:38:27', 2, 'N', 'Y', '0'),
(2977, NULL, '', 'Chomper', '1983', 1, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>Converted to the BBC Micro by Colin Tanner.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This is an interesting variation of a game we caught sight of in an arcade a while back. It''s got a maze, power pills, a ghost and things that go chomp in the night. The first program defines the graphics, and then CHAINs the main program, which must of course be the next program on the tape.</p>\r\n</blockquote>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:13:01', '2018-12-10 10:50:10', 2, '2018-12-10 10:50:55', 2, 'N', 'Y', '0'),
(2978, NULL, '', 'Golf', '1985', 465, 'M', '<p>Published on the Electron Computing issue 5 cassette in late 1985.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2018-12-10 10:56:39', '2018-12-10 10:56:23', 2, '2018-12-10 10:57:18', 2, 'N', 'Y', '0'),
(2979, NULL, '', 'Join ''Em Up', '1984', 525, 'M', '<p>Published in Acorn Programs magazine June/July 1984. Issue 4.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-12-10 11:01:50', '2018-12-10 10:58:49', 2, '2018-12-10 12:09:01', 2, 'N', 'Y', '0'),
(2980, NULL, '', 'Logo-Tank', '1987', 21, 'M', '<p>Published in Micro User Magazine vol.5 issue 5 in July 1987</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-10 11:07:36', '2018-12-10 11:05:07', 2, '2018-12-10 11:06:13', 2, 'N', 'Y', '0'),
(2981, NULL, '', 'Patience', '1988', 38, 'M', '<p>Published in Beebug Magazine volume 6 issue 9 in March 1988.</p>', 1, 1, '', '', '', '', 'VB1.09', '', '', 2, '2018-12-10 11:11:52', '2018-12-10 11:09:21', 2, '2019-11-29 22:17:15', 2, 'N', 'Y', '0'),
(2982, NULL, '', 'Quadrangle', '1983', 525, 'B', '<p>Original program by Eileen Baghoomians and Steven Fawthrop for the TRS-80 computer, and published in Personal Computer World in August 1982. This program was adapted for the BBC Micro by Paul Borrett.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The book accompanying the Best of PCW software for the BBC Micro contained the following description:</p>\r\n<blockquote>\r\n<p>This is an original, colourful game of the Connect 4 and Othello ilk.</p>\r\n<p>The game is played on a 7 by 6 grid, with coloured blocks, the object being to place four of your blocks at the corners of a square before your opponent. Blocks may only be placed on top of each other; they cannot hang in mid-air, and the squares formed may be as small of as large as the grid allows.</p>\r\n<p>The program allows for one player to try and beat the computer, or for two players to play each other. If you require advice at any time the computer is very kindly programmed to help you - just press ''H''.</p>\r\n<p>Users with a 32K BBC B model with disc unit will need to alter the memory position by entering: PAGE=&amp;E00 (RETURN) before typing in the listing.</p>\r\n</blockquote>', 1, 2, '', 'D', '', '', '', '', '', 2, '2019-05-10 17:11:28', '2018-12-10 11:16:28', 2, '2018-12-10 11:21:07', 2, 'N', 'Y', '0'),
(2983, NULL, '', 'Snake (AKA Black Adder)', '1984', 1, 'M', '<p>Published in Your Computer Magazine volume 4 issue 5 in May 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-10 11:34:48', '2018-12-10 11:30:48', 2, '2018-12-10 11:33:13', 2, 'N', 'Y', '0'),
(2984, NULL, '', 'Squash (AKA Embryo Squash)', '1983', 18, 'M', '<p>The game listing was published in the February 1983 issue of Personal Computing Today, vol. 1 no. 7.</p>\r\n<p>This was a bare-bones listing that you were encouraged to improve by yourself.</p>\r\n<p>In that spirit, the game has been tweaked slightly from the original listing, to make it more playable!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 10:29:55', '2018-12-10 11:36:40', 2, '2018-12-10 11:39:40', 2, 'N', 'Y', '0'),
(2985, NULL, '', 'Tank Battle (AKA Battle Of The Tanks)', '1984', 473, 'M', '<p>Published in Games Computing magazine, issue 8, August 1984.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-12-10 11:51:40', '2018-12-10 11:49:58', 2, '2018-12-10 11:50:44', 2, 'N', 'Y', '0'),
(2986, NULL, '', 'Targets', '1991', 2, 'P', '<p>Published on BBC PD Disc 83, and BBC PD Games#7</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-10 11:59:14', '2018-12-10 11:53:40', 2, '2018-12-10 11:58:24', 2, 'N', 'Y', '0'),
(2987, NULL, '', 'Terror Terrain', '1983', 569, 'B', '<p>Published in the Virgin Computer Series book More Games For Your BBC Micro by Alex Gollner.</p>\r\n<blockquote>\r\n<p>In this program, also written by Hugh Gollner, you are on a mission to collect valuable orb stones from the dark caves of the planet Orbus. However, your ship&rsquo;s deflectors have broken down. You have to avoid the rocks and aliens or your mission is over. The program contains full instructions.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:41:09', '2018-12-10 12:01:33', 2, '2018-12-10 12:08:28', 2, 'N', 'Y', '0'),
(2988, NULL, '', 'Wall Smash (AKA Two-Wall Smash)', '1984', 18, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>This game, patterned after one written by Mike O''Neill, is a two-wall version of the popular arcade game which is often called ''Breakout''.</p>\r\n<p>The aim of the game is to destroy all the bricks in the walls by controlling the ball with your bat. The bat moves horizontally at the bottom of the screen. The ball moves at two different angles, and there are three bat sizes. The bat gets smaller as the game progresses - after a certain number of hits, when the ball reaches the second wall and when the ball hits the top of the screen.</p>\r\n<p>The colour of the brick determines how much it is worth. The high score displayed on the screen, next to the current score. The number of the ball in play is also shown. The high score is updated at the end of each game.<u></u></p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:42:25', '2018-12-10 12:15:06', 2, '2018-12-10 12:21:17', 2, 'N', 'Y', '0'),
(2989, NULL, '', 'Wilt', '1984', 514, 'W', '<p>A favourite in schools!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-05 10:50:52', '2018-12-10 12:34:22', 2, '2018-12-10 12:35:08', 2, 'N', 'Y', '0'),
(2990, NULL, '', 'Bobsleigh', '1983', 6, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>In this game you have to steer your blue bobsleigh down a random course that winds its way past fir trees. You can choose whether to try a course that is easy to manoeuvre or one that is difficult. (There are actually five levels of difficulty which govern the width of the course.) If you crash you&rsquo;ll hear a dismal tone and that round of the game is over. Play this game to see how adept you are at keeping on course.</p>\r\n<h3>How to play</h3>\r\n<p>The bobsleigh starts off at the top of the course and the course automatically moves past it. You have to steer the bobsleigh using the right and left arrow keys to ensure that you do not crash into the edges of the course. At the beginning of the game you have to select the difficulty level for the game. This governs the width of the course with 1 producing the widest, and therefore easiest, and 5 the narrowest, and most difficult.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:56:03', '2018-12-10 13:53:36', 2, '2018-12-10 13:54:56', 2, 'N', 'Y', '0'),
(2991, NULL, '', 'Cosmos', '1984', 454, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>In this exciting game you are flying over a moving landscape which produces a very good 3-D effect. You have to try and shoot as many alien birds as possible within a limited time. Full instructions are within the game.</p>\r\n<p>You move your sights around the galaxy until you spot one of the birds. The birds will try to evade your lethal weaponry.<u></u></p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:41:59', '2018-12-10 13:53:53', 2, '2018-12-10 13:55:32', 2, 'N', 'Y', '0'),
(2992, NULL, '', 'Space Invaders (AKA Invaders)', '1983', 454, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>How could we write a Bumper Book of programs without including the classic Invaders games? Well, here it is complete with shields and Mothership and a screen full of the dreaded Aliens.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:12:36', '2018-12-10 13:54:07', 2, '2018-12-10 13:56:08', 2, 'N', 'Y', '0'),
(2993, NULL, '', 'Torpedo Run', '1984', 2, 'B', '<p>Published in the book "BBC micro programs in BASIC" from Newnes technical books, which contains the following description:</p>\r\n<blockquote>\r\n<p>Here is a great game for those who like shooting games. We suppose the player to be torpedo officer or captain of a warship. He has three torpedo tubes numbered left to right, each with a magazine of nine torpedoes. An infinite array of enemy ships is constantly parading from right to left of the screen. These are of different types, proceeding at different speeds at different distances up the screen. The player simply presses the numeric key 1, 2 or 3 according to which torpedo tube he wishes to fire. The track of the torpedo is then seen progressing up the screen until it either hits a ship or disappears over the horizon. Only one torpedo may be in motion at once and of course the player cannot fire more than the specified nine torpedoes from each tube. At all times there is a visual indication of how many torpedoes remain for each tube, and of the player''s score.</p>\r\n<p>Scoring depends entirely upon difficulty. That is to say, the leftmost torpedo tube (if successful) scores less than the rightmost. Similarly, slower and larger targets score less than swift small ones, and targets crossing near the bottom of the screen score less than those on the horizon. Thus the game is a real test of skill. The game ends when the player runs out of torpedoes, and the computer retains details of the best six scores and their scorers.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-08 20:33:11', '2018-12-10 13:54:22', 2, '2018-12-10 13:56:36', 2, 'N', 'Y', '0'),
(2994, NULL, '', 'Transylvanian Adventure (AKA Dracula''s Castle)', '1984', 13, 'M', '<p>Published in Games Computing magazine, issue 8, August 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-11 16:55:57', '2018-12-11 16:55:57', 2, '2020-02-14 13:28:40', 2, 'N', 'Y', NULL),
(2995, NULL, '', 'Drive', '1983', 6, 'M', '<p>Published in issue 10 of Laserbug user group magazine in March 1983.</p>\r\n<p>This game may not be playable without a joystick. JSBeeb (the JavaScript BBC Micro emulator) does not currently emulate a joystick so it might not be possible to play this game online. Try using a desktop emulator or a real BBC Micro.</p>', 1, 1, 'R', '', '', '', '', '', '', 3, '2019-08-12 10:38:35', '2018-12-11 18:14:56', 2, '2019-08-08 17:30:36', 2, 'N', 'Y', '0'),
(2996, NULL, '', 'Map Quiz', '1983', 29, 'M', '<p>Published in the October 1983 issue of Personal Computer World magazine (PCW).</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The book accompanying the PCW Games Collection contained the following description:</p>\r\n<blockquote>\r\n<p>Map Quiz is a simple geography quiz in which you are asked 15 questions about the location of towns in England, Scotland and Wales. A dot appears on the map and you have to guess which own it is by choosing from the five names that are provided. All you have to do is press the number of the answer that you think is correct, then sit back!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2018-12-12 12:09:37', '2018-12-11 18:15:17', 2, '2018-12-11 18:16:45', 2, 'N', 'Y', '0'),
(2997, NULL, '', 'Othello', '1985', 31, 'M', '<p>Published in Micro User Magazine vol.3 issue 4 in June 1985</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-11 23:19:40', '2018-12-11 18:15:31', 2, '2018-12-14 15:37:46', 2, 'N', 'Y', '0'),
(2998, NULL, '', 'Grand Prix', '1983', 6, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The listing as printed in the book was faulty, and quite a lot of work has been done to make the game playable as intended by the author.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>After all this intergalactic warfare, you''ll find it refreshing to return to Earth and struggle to cope with a fleet of helicopters whose pilots are committed to wiping out your fair city. Thankfully you''re in control of the metropolitan laser tower, and it''s up to you to shoot down the bombs before they hit the city. You''ll get points for every bomb you hit, and whilst you can wipe out a chopper if you feel so inclined, you will not add to your tally by so doing. You move your laser sight with the cursor keys, and the game is over once one of the bombs finds a clear path to the ground or the laser tower itself is destroyed.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:12:12', '2018-12-11 18:15:45', 2, '2018-12-14 15:38:11', 2, 'N', 'Y', '0'),
(2999, NULL, '', 'Cosmic Invaders', '1984', 454, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>Here is a complete implementation of space invaders. Even though it is written in BASIC, and uses MODE 7 graphics, you''ll be amazed to see how faithful it is to the arcade original.</p>\r\n<p>Full instructions are included in the game, which was written by Mark Bucknell. There are a number of options you can trigger, such as ''freeze/unfreeze'' and turning the sound on or off. The SHIFT key is used to fire.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:41:29', '2018-12-11 18:16:00', 2, '2018-12-11 18:20:25', 2, 'N', 'Y', '0'),
(3000, NULL, 'The', 'Vespozian Incident (AKA The Vespozian Affair)', '1984', 13, 'M', '<p>Originally written for the Dragon 32 by Keith Campbell and Terry Pratt. (Titled ''The Vespozian Affair'').</p>\r\n<p>Converted for the BBC Micro by Steve Willis. (Titled ''The Vespozian Incident'').</p>\r\n<p>The game was published in the Computer &amp; Video Games Yearbook 1984. Versions were printed for the Dragon 32, Sinclair Spectrum 48K, BBC Micro 32K, and Atari 400/800 .</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-19 20:15:51', '2018-12-19 20:03:31', 2, '2018-12-19 20:14:08', 2, 'N', 'Y', '0'),
(3001, NULL, '', 'Podd', '1983', 405, 'R', '<p>Podd can <a href="http://www.acornelectron.co.uk/info/electron/acornsoft_ask/Podd.html">click links for more info</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-12-20 19:46:33', '2018-12-20 19:31:30', 3, '2018-12-20 19:33:04', 3, 'N', 'Y', '0'),
(3002, NULL, '', 'Cargo', '19XX', 405, 'R', '<p><a href="gameimg/discs/3002/CargoBasicInstructions.txt">A summary of the instructions</a> is available. (Thanks, <a href="https://stardot.org.uk/forums/viewtopic.php?f=2&amp;t=15509&amp;p=211680&amp;hilit=Cargo#p211680">Stardot</a>.)</p>\r\n<p><a href="http://www.flaxcottage.com/Educational/ShowPackage.asp?p=98">More details</a> at the Educational Software Archive.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-12-22 19:40:08', '2018-12-22 19:20:21', 3, '2018-12-22 19:22:39', 3, 'N', 'Y', '0'),
(3003, NULL, '', 'Breakout', '1982', 18, 'M', '<p>Published In the August 1982 issue of Computer &amp; Video Games. Issue 10</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-29 14:26:30', '2018-12-29 14:05:27', 2, '2018-12-29 14:08:22', 2, 'Y', 'Y', '0'),
(3004, NULL, '', 'Heli-Bomber', '1983', 2, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>Original program by Robert Erskine, converted for the BBC Micro by Ian Thomas.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>After all this intergalactic warfare, you''ll find it refreshing to return to Earth and struggle to cope with a fleet of helicopters whose pilots are committed to wiping out your fair city. Thankfully you''re in control of the metropolitan laser tower, and it''s up to you to shoot down the bombs before they hit the city. You''ll get points for every bomb you hit, and whilst you can wipe out a chopper if you feel so inclined, you will not add to your tally by so doing. You move your laser sight with the cursor keys, and the game is over once one of the bombs finds a clear path to the ground or the laser tower itself is destroyed.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:11:48', '2018-12-29 14:05:59', 2, '2018-12-29 15:01:51', 2, 'N', 'Y', '0'),
(3005, NULL, '', 'Froggy Go Home', '1983', 4, 'B', '<p>Published in the book More Games For Your BBC Micro by Virgin Books Ltd, which contains the following description:</p>\r\n<blockquote>\r\n<p>This program, written by Hugh Gollner, is in two parts. To play the game you must initially type in the first part and save it; then type in the second, longer part and save that too. Once you have done that rewind the tape to the beginning. You can then load and run the program by typing CHAIN""</p>\r\n<p>The first part of the program defines the user-defined characters and gets the computer ready for the next part. It also includes the instructions. Once you have read these it will load and run the next part and then you can start playing!</p>\r\n<p>In this version of the well-known arcade game you have to move a small helpless frog into its home. This may sound simple, but first the frog has to negotiate a busy four-lane motorway and then cross a fast-flowing river by jumping from log to log as they float by.</p>\r\n<p>But even with your help, can this brave young frog survive whirlpools that suddenly change the direction of the river? And if so, can he still get home before nightfall?</p>\r\n<p>PRESS ANY KEY TO GO ON!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:41:46', '2018-12-29 14:06:34', 2, '2018-12-29 14:12:02', 2, 'N', 'Y', '0'),
(3006, NULL, '', 'Rings (AKA Hungarian Rings)', '1983', 17, 'M', '<p>Published in issue 14 of Laserbug user group magazine in July 1983.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-29 15:31:46', '2018-12-29 15:27:05', 2, '2018-12-29 15:30:45', 2, 'N', 'Y', '0'),
(3007, NULL, '', 'Squish', '1982', 18, 'M', '<p>Published in "Personal Software" magazine issue 1, Summer 1982.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-29 15:45:47', '2018-12-29 15:40:16', 2, '2019-01-03 15:54:44', 2, 'N', 'Y', '0'),
(3008, NULL, '', 'Surround', '1982', 1, 'M', '<p>Published in "Personal Software" magazine issue 1, Summer 1982.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-29 15:52:33', '2018-12-29 15:52:05', 2, '2018-12-29 15:53:49', 2, 'N', 'Y', '0'),
(3009, NULL, '', 'Tank Battle', '1983', 2, 'M', '<p>Published In the May 1983 issue of Computer &amp; Video Games. Issue 19.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-12-29 15:59:06', '2018-12-29 15:58:21', 2, '2018-12-29 16:00:54', 2, 'N', 'Y', '0'),
(3010, NULL, '', '3D Maze', '1984', 1, 'M', '<p>Published in Acorn Programs magazine April/May 1984. Issue 3.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-30 12:08:48', '2018-12-30 10:30:30', 2, '2018-12-30 10:39:02', 2, 'N', 'Y', '0'),
(3011, NULL, '', 'Alien Invaders', '1983', 454, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>Two types of alien ships are heading towards earth and you have to defend civilisation as we know it. Your task is daunting you have to ensure that none of the aliens get within firing range of earth. The point of no return is marked with a &lsquo;X&rsquo; on the left of the screen. Once any of the advancing ships pass this point the game is over &minus; you will have lost. Your only hope is to wipe out all the aliens with your missiles. Every missile that hits its target increases your chance of saving the world.</p>\r\n<p>This game is especially exciting to play because of the use of a two-tone throbbing sound that decreases in pitch as the invaders get closer. If you play this game on a colour TV you&rsquo;ll see that the ships are red and yellow.</p>\r\n<h3>How to play</h3>\r\n<p>You can move your missile launcher to left and right using the appropriate arrow keys. Press the up arrow key to fire a missile. You score points for every alien you hit, the ones further away from you accounting for more points than the nearer ones. The game is over when you have destroyed all the invaders or when the nearest remaining ones reach the point marked by the &lsquo;X&rsquo;.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:55:44', '2018-12-30 10:30:52', 2, '2018-12-30 10:39:54', 2, 'N', 'Y', '0'),
(3012, NULL, '', 'Bomber Command (AKA Bomb Raid)', '1984', 2, 'B', '<p style="text-align: justify;">Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description.</p>\r\n<blockquote>\r\n<p>In this program, based on one by Gwyn Dewey, you are in control of an aeroplane which has to make an emergency landing. Unfortunately, in order to land you must destroy the buildings which are in your way.</p>\r\n<p>There are full instructions within the program. Here''s the listing so you can throw your weight (and a few bombs) about.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:41:11', '2018-12-30 10:31:16', 2, '2018-12-30 10:40:48', 2, 'N', 'Y', '0'),
(3013, NULL, '', 'Breakthrough (AKA Break-Up)', '1982', 18, 'M', '<p>Published in Personal Software magazine, issue 1, summer 1982.</p>\r\n<p>An almost identical listing was published in Which Micro &amp; Software Review magazine, issue 7, in February 1983.</p>\r\n<p>A very similar game was published on <a href="game.php?id=2853">Games Pack 1 from Charles Murton</a> which had small improvements, such as bat size and a joystick option, but was essentially the same code.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-12 10:29:09', '2018-12-30 10:31:39', 2, '2019-08-09 21:30:20', 2, 'Y', 'Y', '0'),
(3014, NULL, '', 'Brick Layer (AKA Bricklayer)', '1983', 454, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>You are in control of a small aircraft which flies across the top of the screen. From the bottom of the screen, a large wall is being built up which will eventually fill the whole of the playing area. The object of the game is to drop men out of the aircraft, aiming to plummet them through gaps in the wall to the bottom of the screen. If a man should hit any part of the wall then a life will be lost. In order to create gaps for the men to drop through and to prevent the wall advancing too far up the screen, you also have the option of dropping bombs which blow sections of the wall away.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:11:31', '2018-12-30 10:32:01', 2, '2018-12-30 10:42:48', 2, 'N', 'Y', '0'),
(3015, NULL, '', 'Capture The Quark', '1983', 31, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>What on earth is a &lsquo;quark&rsquo;? Well may you ask that question, but to find out you&rsquo;ll have to play this game. Here are just a few clues. The game is played on an eight-by-eight checkered board and the object of the game is to trap the quark and prevent him from reaching the bottom of the board. To do this you have two, three or four (determined at random) pieces, or &lsquo;quatlins&rsquo;, which can be moved diagonally one square at a time and only up the board. The quark also moves diagonally but he can move both forwards and backwards.</p>\r\n<h3>How to play</h3>\r\n<p>At the beginning of the game your quatlins (two, three or four of them according to the luck of the draw) are ranged along the bottom line and the quark is at the top of the board. It is your move first. You&rsquo;ll notice that one of your quatlins is displayed in different colours from the rest. This is the piece that is ready to move. If you want to move another piece hit any key and control will pass to the next piece in an anti-clockwise direction. Try pressing keys to see this in operation. When you are ready to move a piece press the left arrow key if you want to move diagonally forward left and the right arrow key if you want to move diagonally forward right. Once you have moved, the quark will make his move automatically and its your turn again. The BBC Micro will display a message when the game is won, either by you or the quark, but if you want to resign before this, type &ldquo;R&rdquo;. Just in case you hit this key by mistake you will be given the chance to reconsider and will have to answer &ldquo;Y&rdquo; or &ldquo;N&rdquo; to the question &ldquo;Resign?&rdquo;.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:55:30', '2018-12-30 10:32:26', 2, '2019-09-06 11:12:02', 2, 'N', 'Y', '0'),
(3016, NULL, '', 'Ghost Lane', '1984', 4, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contained the following description:</p>\r\n<blockquote>\r\n<p>In this game, based loosely on the popular arcade game in which you have to get a frog across a busy highway, you have to help a number of ghosts (who have wandered out of yet another popular arcade game) across four lanes of traffic.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:40:51', '2018-12-30 10:32:54', 2, '2018-12-30 10:44:46', 2, 'N', 'Y', '0'),
(3017, NULL, '', 'Grand Prix', '1984', 467, 'M', '<p>Published In the July 1984 issue of Computer &amp; Video Games. Issue 33.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-30 13:06:06', '2018-12-30 10:33:16', 2, '2018-12-30 10:45:39', 2, 'N', 'Y', '0'),
(3018, NULL, '', 'Moon Reskue (AKA Moon Mission)', '1983', 45, 'M', '<p>Published In the December 1983 issue of Computer &amp; Video Games. Issue 26.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-30 12:18:56', '2018-12-30 10:33:47', 2, '2018-12-30 10:46:49', 2, 'N', 'Y', '0'),
(3019, NULL, '', 'Oxygen', '1982', 1, 'M', '<p>Published in issue 05 of Laserbug user group magazine in October 1982.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-30 11:06:45', '2018-12-30 10:34:09', 2, '2018-12-30 10:47:53', 2, 'N', 'Y', '0'),
(3020, NULL, '', 'Pro - Golf (AKA Pro Golf)', '1983', 465, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette states the program was originally written by Jeff Aughton, and converted for the BBC Micro by Ray Derby.</p>\r\n<p>It also contained the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This program provides a simulated round of golf. You must use</strong><br /><strong>your skill and judgement to decide which club to use in each</strong><br /><strong>situation and how hard to hit the ball. Remember to use club 19,</strong><br /><strong>your putter, when you are on the green. Other instructions are</strong><br /><strong>displayed when the game is run. See you in the clubhouse!</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-28 18:08:23', '2018-12-30 10:34:58', 2, '2018-12-30 10:48:51', 2, 'N', 'Y', '0'),
(3021, NULL, '', 'Pteragon', '1982', 2, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 1, No. 21 (9th September 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-30 13:00:40', '2018-12-30 10:35:20', 2, '2018-12-30 10:49:48', 2, 'N', 'Y', '0'),
(3022, NULL, '', 'Puzzle (AKA Puzzle Program)', '1982', 17, 'M', '<p>Published in issue 06 of Laserbug user group magazine in November 1982.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-12-30 12:54:57', '2018-12-30 10:35:51', 2, '2018-12-30 10:51:09', 2, 'N', 'Y', '0'),
(3023, NULL, '', 'Scribble', '1984', 40, 'B', '<p>Published in the book <em>BBC Micro Programs in Basic</em> from <em>Newnes Technical Books</em>, which contains the following description:</p>\r\n<blockquote>\r\n<p>Scribble is a game for any number of players up to six, and has much in common with Scrabble, Lexicon and similar word games. The object is to make words, for which the computer awards points, the first player reaching a score of 200 points being the winner.</p>\r\n<p>On his or her turn, the player may do one of three things: (a) shuffle the letter pool, (b) take a letter from the pool and add it to his hand, or (c) make a word from the letters in his hand. To shuffle the pool, the player simply presses RETURN. To take up a letter from the pool, the letter is typed. The computer removes the letter from the pool and adds it to those in the player''s hand, then selects another letter for the pool. To play a word, the player types the whole word and presses RETURN. The computer checks that the word is possible from the letters in the hand, and if so, asks if any other player objects to the word or to its spelling. If all is well, the score is calculated and the letters are removed from the player''s hand.</p>\r\n<p>Please note very carefully that the score for a word depends upon (a) the individual values of the letters making up the word, (b) the length of the word, with longer words scoring heavily, and (c) the number of letters remaining in the hand; the more letters left unused, the greater the penalty. At the extreme, it is just possible to play a short word, have a lot of letters left over and so be awarded a negative score!</p>\r\n<p>There are ''jokers'' in the form of ''*'', which have no value but which may be used in place of any letter. To pick up such a joker, the ''*'' must be typed. On the other hand, to play a word containing a joker, the player does not include ''*'', but types the whole word as he or she wishes it to be. The computer first checks for normal letters and if one or more short, checks for jokers.</p>\r\n<p>Before and after each player''s move there is a timed delay for thought and observation, but players may move the game on swiftly by pressing RETURN. Finally, the number of times that each player may shuffle the letter pool is limited, dependent upon the number of players.</p>\r\n</blockquote>', 1, 6, '', '', '', '', '', '', '', 1, '2019-01-08 19:51:22', '2018-12-30 10:36:13', 2, '2018-12-30 10:52:16', 2, 'N', 'Y', '0'),
(3024, NULL, '', 'Sea Sub', '1984', 2, 'B', '<p>Key controls for in-browser play: &nbsp;<strong>A</strong>&mdash;left &nbsp; &nbsp;&nbsp;<strong>S</strong>&mdash;right</p>\r\n<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>You are the submarine at the bottom of the screen in the game, and your task is to destroy all the ships as they sail overhead. You are fighting against the clock all through the game, and have only one minute to accomplish your mission.</p>\r\n<p>You move your sub left and right with the CAPS LOCK and CTRL keys, and fire using the RETURN key. The smaller the ship, the faster it travels, and the points you score are related to the size of the ship and how far away from you it is. You can only fire one torpedo at a time.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-05-31 18:59:51', '2018-12-30 10:36:37', 2, '2019-05-31 19:00:32', 3, 'N', 'Y', '0'),
(3025, NULL, '', 'Slide', '1984', 17, 'B', '<p>Published in the book "BBC micro programs in BASIC" from Newnes technical books.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This program is a computer implementation of those little plastic puzzles that you can buy, in which the user slides the pieces one at a time into the only available space. The object of the exercise is to arrange them in their natural order:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;A&nbsp;</td>\r\n<td>&nbsp;B&nbsp;</td>\r\n<td>&nbsp;C&nbsp;</td>\r\n<td>&nbsp;D&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;E&nbsp;</td>\r\n<td>&nbsp;F&nbsp;</td>\r\n<td>&nbsp;G&nbsp;</td>\r\n<td>&nbsp;H&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;I&nbsp;</td>\r\n<td>&nbsp;J&nbsp;</td>\r\n<td>&nbsp;K&nbsp;</td>\r\n<td>&nbsp;L&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;M&nbsp;</td>\r\n<td>&nbsp;N&nbsp;</td>\r\n<td>&nbsp;O&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>The advantage of this implementation over the plastic type is that every start condition is totally random and it is amazingly fast. Also, as a special dispensation, but only once per game, the user may swap any two letters, which is useful of course if you get into a situation you cannot see your way out of. Finally, the computer counts your moves and gives you a grading when - or if - you complete the puzzle.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 1, '2019-01-08 19:40:50', '2018-12-30 10:36:59', 2, '2018-12-30 10:55:06', 2, 'N', 'Y', '0'),
(3026, NULL, '', 'Space Traffic', '1983', 20, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>As you travel about in the midst of an asteroid belt recovering lost satellites (well, someone has to do it), you are assailed by missiles and enemy spacecraft which you can either dodge or attack. Movement is either to left or right using the Z and X keys and your cannon can be fired with the M key, although this will lose you points.</p>\r\n<p>The satellites are collected by manoeuvering your spaceship into them and points are gained for each one which you manage to recover. Collision with other objects results in destruction, although you are allocated five lives at the start of each game.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:11:20', '2018-12-30 10:37:20', 2, '2019-09-06 11:12:49', 2, 'N', 'Y', '0');
INSERT INTO `games` (`id`, `parent`, `title_article`, `title`, `year`, `genre`, `reltype`, `notes`, `players_min`, `players_max`, `joystick`, `save`, `hardware`, `electron`, `version`, `series`, `series_no`, `lastupdater`, `lastupdated`, `created`, `creator`, `imgupdated`, `imgupdater`, `compat_a`, `compat_b`, `compat_master`) VALUES
(3027, NULL, '', 'Sprint 1', '2018', 467, 'P', '<p>This is an emulator of the 1978 game Sprint 1 from Kee Games. More info <a href="https://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=16238&amp;p=223543&amp;hilit=sprint#p223543">here</a>.</p>\r\n<p>This game may not be playable without a joystick. JSBeeb (the JavaScript BBC Micro emulator) does not currently emulate a joystick so it might not be possible to play this game online. Try using a desktop emulator or a real BBC Micro.</p>', 1, 1, 'R', '', '', '', '', '', '', 3, '2019-08-12 10:37:27', '2018-12-30 10:37:43', 2, '2019-08-09 09:47:59', 2, 'N', 'Y', '0'),
(3028, NULL, '', 'Asteroid Dodge', '1983', 20, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 2, No. 40 (6th October 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-02 16:18:42', '2019-01-02 15:27:32', 2, '2019-01-03 14:46:11', 2, 'N', 'Y', '0'),
(3029, NULL, '', 'Derby Day', '1983', 497, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This is a very simple betting game with an impressive and convincing horse race display plus an appropriate musical accompaniment. The tune is &lsquo;Camptown Races&rsquo; and if you&rsquo;ve ever heard it before, you&rsquo;re sure to recognise it. If you want to show off the graphics and sound capabilities of your BBC Micro this program provides a good demonstration.</p>\r\n<h3>How to play</h3>\r\n<p>At the beginning of the game you are allocated a hundred chips. You have to bet on which horse will come in first and must decide how much to stake (the odds are five to one, so if you win having placed 20 you will receive 100). The BBC Micro keeps a tally of your winnings and losses and will tell you if you go broke. During the race, the horse you have backed stands out from the rest of the field &minus; it is the white one. The race is run automatically and so there&rsquo;s nothing you can do to make your horse win except cheer it along.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:55:16', '2019-01-02 15:27:55', 2, '2019-01-03 14:46:30', 2, 'N', 'Y', '0'),
(3030, NULL, '', 'Dropout', '1984', 454, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>Full instructions for this dynamic game, based on an idea by Paul Toland, are included in the program. Aliens are stacked above you, ready to fall when their stack is full. You can shoot an alien at any time, but the lower they are when hit, the more points they are worth.</p>\r\n<p>The difficulty level determines the speed with which the aliens appear above you. The program includes a high-score feature.<u></u></p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:39:58', '2019-01-02 15:28:11', 2, '2019-01-03 14:46:49', 2, 'N', 'Y', '0'),
(3031, NULL, '', 'Flying Geese', '1983', 2, 'B', '<p>Original program by Michael Bews, converted for the BBC Micro by Colin Tanner.</p>\r\n<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>It''s time to don your tweeds, grease up your shotgun and head for the marshes. The geese are back from the north and the freezer is empty. Don''t worry about the corpses - your faithful hound will deal with those after the game is over. Just blast away with your shooter and notch up a handsome tally.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:11:02', '2019-01-02 15:28:50', 2, '2019-01-03 14:47:09', 2, 'N', 'Y', '0'),
(3032, NULL, '', 'Four In A Row', '1982', 34, 'M', '<p>Published in issue 04 of Laserbug user group magazine in August/September 1982.</p>', 1, 2, '', '', '', '', '', '', '', 2, '2019-01-02 16:29:15', '2019-01-02 15:29:11', 2, '2019-01-03 14:47:27', 2, 'N', 'Y', '0'),
(3033, NULL, '', 'Golf', '1983', 465, 'M', '<p>Published In the February 1983 issue of Computer &amp; Video Games. Issue 16.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-02 18:08:10', '2019-01-02 15:29:26', 2, '2019-01-04 14:44:02', 2, 'N', 'Y', '0'),
(3034, NULL, '', 'Light Cycles', '1984', 1, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contained the following description:</p>\r\n<blockquote>\r\n<p>In this fast-moving game you have to ride your light cycle around the screen avoiding the computer''s cycle and making sure you don''t run over the trail left by either your own bike or the computer''s. The aim of the game is to enclose the computer so that it cannot move. It, of course, is trying to do the same thing to you.</p>\r\n<p>You control your cycle as follows:</p>\r\n<ul>\r\n<li>: To move up.</li>\r\n<li>/ To move down.</li>\r\n<li>Z To move left.</li>\r\n<li>X To move right.</li>\r\n</ul>\r\n<p>If you hold down the SHIFT key, your cycle will move twice as fast, which gives you the chance of riding through trails. However, this option should not be tried lightly because it is programmed to work only around 50 per cent of the time.</p>\r\n<p>Light Cycles was written by Neal Cavalier-Smith.</p>\r\n</blockquote>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:39:27', '2019-01-02 15:30:04', 2, '2019-01-03 14:48:05', 2, 'N', 'Y', '0'),
(3035, NULL, '', 'Meteoroids', '1984', 20, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>Here''s a neat little program in which you must pilot your V - Wing spacecraft through a field of asteroids. You use the ''X'' and ''Z'' keys to move yourself right and left. At the end of the game (when you hit an asteroid) you''ll be told the number of ''light years'' you have managed to traverse.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:39:08', '2019-01-02 15:30:22', 2, '2019-01-03 14:48:32', 2, 'N', 'Y', '0'),
(3036, NULL, '', 'Minelay (AKA Mine Lay)', '1983', 1, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>Minelay is a maze game in which your hero runs about collecting 5 eggs and avoiding the deadly mines which are scattered randomly about the maze. A fiendish little ''minelayer'' scuttles around the screen in hot pursuit. Contact with this persistent creature results in instant death. Here is the good news. A number of axes are dotted around the playing area which the player can pick up and carry around. Each axe can be used both to break through maze walls and also to fend off direct attacks by the minelayer.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:10:49', '2019-01-02 15:31:18', 2, '2019-01-03 14:48:49', 2, 'N', 'Y', '0'),
(3037, NULL, '', 'Mutant Rats (AKA Giant Rats)', '1983', 1, 'B', '<p>Original program by Paul Stanley, converted for the BBC Micro by Ian Thomas.</p>\r\n<p>Published in the book "Sixty Programs for the BBC Micro" by Pan Books Ltd. In association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>The object of Giant Rats is to direct a man through a maze to reach the girl, whilst being pursued by a killer rat. You have a displayed time limit in which to move before the girl mutates - and if you are unlucky she will unpredictably change places with the rat! If the rat should reach the girl first, she will disappear altogether. At the beginning of the game you are shown the positions of up to four randomly placed mines which you must try to memorise since they will remain invisible for the remainder of the game.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-08 16:05:03', '2019-01-02 15:31:35', 2, '2019-01-03 14:49:10', 2, 'Y', 'Y', '0'),
(3038, NULL, '', 'One Armed Bandit', '1983', 462, 'M', '<p>Published in issue 12 of Laserbug user group magazine in May 1983.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-02 16:16:25', '2019-01-02 15:31:52', 2, '2019-01-03 14:49:31', 2, 'N', 'Y', '0'),
(3039, NULL, '', 'Pot Shot', '1983', 2, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This game provides the ideal type of target practice. However many times you score a direct hit, the magic bird continues to fly on, allowing you to take aim and fire again and again. The elements of this game are simple &minus; a blue sky with a single white cloud, a bird winging its way from left to right and your rifle sight. The object is straightforward &minus; to line up the sight with the bird and shoot it &minus; but in practice its not that simple. Every time you fire, your rifle &lsquo;kicks&rsquo; to one side or the other so you have to re-align your sight for your next shot and the bird (and your sight too) disappears behind the cloud when they reach it. A total of five birds fly across the sky and there is no limit to the number of hits you can score &minus; your total for each bird and the whole game are displayed at the end. There is a convincing sound every time you fire your rifle and a distinctive bell-like sound when you hit the bird.</p>\r\n<h3>How to play</h3>\r\n<p>To hit the target you have to line the cross point of your sight up with the centre of the bird. Use all four arrow keys to move your sight and press &lsquo;F&rsquo; to fire. There are five birds in all and you may hit each one as often as you can.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:55:02', '2019-01-02 15:32:07', 2, '2019-01-03 14:49:52', 2, 'N', 'Y', '0'),
(3040, NULL, '', 'Simon', '1984', 565, 'M', '<p>Published In the February 1984 issue of Computer &amp; Video Games. Issue 28 in the ''Book of games'' supplement.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-02 15:58:32', '2019-01-02 15:32:24', 2, '2019-01-03 14:50:07', 2, 'N', 'Y', '0'),
(3041, NULL, '', 'Nightdrive (AKA Night Drive)', '1983', 6, 'M', '<p>Published in issue 8 of Home Computing Weekly in April 1983.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-04 16:48:37', '2019-01-04 14:48:39', 2, '2019-01-04 17:30:23', 2, 'N', 'Y', '0'),
(3042, NULL, '', 'Zombies', '1983', 1, 'B', '<p>The original program was by P. Barker for the Commodore PET, and published in Personal Computer World in June 1983. The program was converted for the BBC Micro by Daniel Lucas.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The book accompanying the Best of PCW software for the BBC Micro contained the following description:</p>\r\n<blockquote>\r\n<p>In this game you are trapped in a graveyard at midnight, and all the Zombies are crawling out of their graves to try and catch you! Your task is to run around the graveyard trying to make all the Zombies fall back into their graves. If you fail and you get caught by a Zombie you will be ''Zombified'', which is a fate worse than death...</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 17:17:50', '2019-01-04 14:48:52', 2, '2019-01-04 16:32:41', 2, 'N', 'Y', '0'),
(3043, NULL, '', 'Rainbow Squash', '1983', 18, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This is a colourful version of the popular computer squash game which is also enhanced by the addition of sound &minus; a cheery beep every time the ball bounces either on the sides of the court or against the bat, and a dismal tone every time a ball goes out of play. Its other feature is that as you improve in skill the game gets more difficult and if you then start to get worse it gets easier. This means that your BBC Micro will always give you a challenge that is suited to your ability &minus; which makes it the perfect partner.</p>\r\n<h3>How to play</h3>\r\n<p>At the start of the game the bat is at the bottom of the screen and in the centre. You control the left and right movement of the bat by pressing the appropriate arrow keys. Every time you make two hits in succession the position of the bat changes &minus; it moves nearer to the top of the screen &minus; which makes returning the ball more difficult. If you then miss a shot the ball will move back one position, making it easier. You score a point for every hit and you will be served a total of 10 balls. Information about the number of balls played and hits scored is displayed on the screen continuously.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:54:42', '2019-01-04 14:49:17', 2, '2019-01-07 15:37:27', 2, 'N', 'Y', '0'),
(3044, NULL, '', 'Fox & Hounds (AKA Fox And Hounds)', '1982', 31, 'M', '<ul>\r\n<li>Published in "Personal Software" magazine issue 1, Summer 1982.</li>\r\n</ul>\r\n<p>The magazine states this program was converted for the BBC Micro from a program originally written by Paul Williams.</p>\r\n<p>The original article by Paul Williams,&nbsp; which contained a listing for the Commodore PET computer,&nbsp; can be found in the October 1980 issue of Computing Today magazine.&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-24 23:42:21', '2019-01-04 14:49:37', 2, '2019-01-04 16:34:41', 2, 'N', 'Y', '0'),
(3045, NULL, '', 'Racer', '1984', 467, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>In this game, on a racing track designed by Scott Vincent, you must drive your car around the circuit as quickly as you can without crashing. The faster you go, the more your score increases.</p>\r\n<p>The game ends when your car skids off the track and mounts the grass. Obviously, at higher speeds the car tends to skid more when turning. If you go too fast, you''ll lose control. The car starts off at around ten miles an hour.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:38:39', '2019-01-06 19:45:23', 2, '2019-01-07 15:37:02', 2, 'N', 'Y', '0'),
(3046, NULL, '', 'Squares', '1993', 31, 'P', '<p>Published on the HeadFirst Public Domain Disc 10.</p>', 1, 2, '', '', '', '', '', '', '', 2, '2019-01-06 20:13:51', '2019-01-06 19:45:53', 2, '2019-01-07 15:38:06', 2, 'N', 'Y', '0'),
(3047, NULL, '', 'Camel Race (AKA Desert Race)', '1985', 497, 'M', '<p>Published in issue 103 of Home Computing Weekly in March 1985.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-06 20:43:06', '2019-01-06 19:46:23', 2, '2019-09-06 11:16:11', 2, 'N', 'Y', '0'),
(3048, NULL, '', 'Knights Tour', '1998', 17, 'P', '<p>Published on the 8BS Public Domain disc 61 in February 1998.</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-01-06 21:08:13', '2019-01-06 19:47:01', 2, '2019-01-07 15:35:57', 2, 'N', 'Y', '0'),
(3049, NULL, '', 'Obstacle Course', '1982', 1, 'M', '<p>Published in "Personal Software" magazine issue 1, Summer 1982.</p>\r\n<p>The magazine states this program was based on a program for the Commodore PET by Mark Michalowski and G. Lowry.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-12 11:40:03', '2019-01-06 19:47:29', 2, '2019-01-07 15:36:48', 2, 'N', 'Y', '0'),
(3050, NULL, '', 'Noughts & Crosses (AKA Noughts And Crosses) (AKA OXO)', '1983', 534, 'B', '<p>Copyright (c) 1982 Michael Bews. and converted for the BBC Micro by Colin Tanner.</p>\r\n<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>The classic game, played against the computer. But in our version the computer can be beaten!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:09:40', '2019-01-06 19:47:58', 2, '2019-01-07 15:36:31', 2, 'N', 'Y', '0'),
(3051, NULL, '', 'Battleships', '1983', 34, 'M', '<p>Published in the November/December 1983 issue of A&amp;B Computing.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-06 21:36:13', '2019-01-06 19:49:17', 2, '2019-01-07 15:34:59', 2, 'Y', 'Y', '0'),
(3052, NULL, '', 'Ski Run', '1984', 479, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>In this program you have to steer your skier down the ski-slope, dodging the trees as you go. Your speed increases as you progress down the slope. If you move off the side, you''ll see yourself reappear on the other side of the screen. If you drop off the bottom of the world, you''ll reappear on the top of the screen. The ''Z'' keys moves you left, and the ''/'' moves you right. The skier automatically moves down unless he is moving across the slope. The time for the completed run will be shown at the end of the game.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:38:21', '2019-01-06 19:49:44', 2, '2019-01-07 15:37:45', 2, 'N', 'Y', '0'),
(3053, NULL, '', 'Tanx', '1983', 473, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.&nbsp;</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p><strong>Tanx is a two player game in which two guns are placed on either side of a range of randomly generated hills. Each player takes turns in attempting to hit the gun on the other side by entering the angle and velocity of fire. The winner is the player with the highest score after a total of seven hits have been made. Your best chance of success is to use the smallest possible angle of elevation for a given velocity and, at higher speeds, it may be possible to fire through one of the hills.</strong></p>\r\n</blockquote>\r\n<p>&nbsp;</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-08-31 14:13:22', '2019-01-07 15:24:10', 2, '2019-01-07 15:38:24', 2, 'N', 'Y', '0'),
(3054, NULL, '', 'Leapfrog', '1982', 17, 'M', '<p>Published in "Personal Software" magazine issue 1, Summer 1982.</p>\r\n<p>The magazine states this program was converted for the BBC Micro from an original program for the Commodore PET by Seamus Dunn.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-12 11:41:57', '2019-01-07 15:25:51', 2, '2019-01-07 15:36:14', 2, 'N', 'Y', '0'),
(3055, NULL, '', 'Beasty Bugs', '1989', 31, 'M', '<p>Published in Micro User Magazine vol.6 issue 11 in January 1989</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-07 15:32:15', '2019-01-07 15:28:19', 2, '2019-01-07 15:35:15', 2, 'N', 'Y', '0'),
(3056, NULL, '', 'Solitaire Maze', '1984', 17, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>Here''s a game for the very patient and skilled. Written initially by Mike O''Neill and modified by Ian Hutt, Solitaire Maze challenges you to a game of strategy.</p>\r\n<p>You control between one and five circular pieces. There is an equal number of diamond-shaped pieces which do not move during the game. The object of the exercise is to move your pieces around the maze so that ultimately each one covers a different diamond.</p>\r\n<p>A timer runs while the program is underway. This tells you how long it took to complete the latest game, and the fastest time so far.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:38:02', '2019-01-07 15:58:19', 2, '2019-01-12 11:08:29', 2, 'N', 'Y', '0'),
(3057, NULL, '', 'Moon Lander', '1983', 0, 'B', '<p>Originally written for the Sinclair Spectrum by Robert Erskine, and converted for the BBC Micro by Colin Tanner.</p>\r\n<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News. The book contains the following description:</p>\r\n<blockquote>\r\n<p>This is an up-market real-time lander program which gives you an opportunity to grapple with the problems which face a space-lagged cruiser commander returning home after a long haul. The object of the exercise is to land your craft on the chillingly small landing-pad at the bottom of the screen. Precision is the name of the game, because if your rate of descent is greater than -5 you and your crew are gonners. A word of warning: if you over-fire your rockets you''ll disappear into hyperspace until returning back on screen, plummeting to your doom unless you''ve been doing some nifty blind flying to slow your descent.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:06:43', '2019-01-07 15:58:32', 2, '2019-01-12 11:08:57', 2, 'N', 'Y', '0'),
(3058, NULL, '', 'Derby Day (AKA Derby)', '1984', 497, 'B', '<p>Published in the book "BBC micro programs in BASIC" from Newnes technical books. The book contains the following description:</p>\r\n<blockquote>\r\n<p>Another old favourite, especially when a group of friends congregate and shout themselves hoarse cheering on their fancied nag. Up to six can play, each starting with &pound;100. The ''meet'' starts a 2.00 pm and goes on until 6.00 pm, with a race every 15 minutes'' game time, stopping sooner if any player runs out of cash. There is a pool of 20 horses, each with its own handicap. Only six horses are randomly selected out of the pool, so the possible permutations of horses running against each other are enormous. In addition, after every race the winning horse has its handicap increased - as per Jockey Club rules - while the others have theirs reduced. Similarly, Honest Joe the bookie will shorten the odds on winning horses and lengthen them on losers. The result is that it is a good test of judgement and skill at picking winners.</p>\r\n<p>The first screen gives the title and asks for the number of players. The second screen seeks each player''s name and then we move into the game loop, which consists of three more screens. The first is the Honest Joe. We are given the number of six horses, their names and odds, each player in turn is asked for his or her bet - the number of the horse backed and the amount.</p>\r\n<p>The next screen is the race proper, and comprises four broad bands of green representing sections of the course. For verisimilitude we add posts and rails, a winning post and the start line, behind which we see the six horses and riders. On pressing RETURN, the names disappear and six horses race forward. As they reach the right edge of one section, they appear at the left edge of the one above, continuing in this way until one reaches the finish. The name of the winning horse is thrown on the screen and the action is frozen while players argue, if they feel like it - although it won''t do them any good!</p>\r\n<p>The final screen addresses each player by name and gives news of what happened to their bet and their current cash state. If all have cash the game time is advanced and we return to Honest Joe Bloggs to place bets for the next race.</p>\r\n</blockquote>', 1, 6, '', '', '', '', '', '', '', 2, '2019-01-12 11:26:20', '2019-01-07 15:59:05', 2, '2019-01-12 11:09:24', 2, 'N', 'Y', '0'),
(3059, NULL, '', 'Poker', '1984', 38, 'M', '<p>The game listing was published in the March 1984 issue of Computing Today magazine.</p>\r\n<p>**Please note: the listing may have problems and may not play accurate Poker in all situations**&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-12 17:11:00', '2019-01-07 15:59:18', 2, '2019-01-12 11:09:52', 2, 'N', 'Y', '0'),
(3060, NULL, '', 'Laser Attack', '1983', 454, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This is a very exciting and fast moving space fight game that uses sound effects and some rather unusual graphics techniques to good effect. The screen is treated as if it were a spherical universe. So, if you go off the top of the screen you re-appear at the bottom, and if you go off at the right, you re-appear at the left. This game is a race against the clock. You have a hundred seconds in which to annihilate the enemy ship with your infallible laser weapon &minus; the chase is on.</p>\r\n<h3>How to play</h3>\r\n<p>At the beginning of this game you have to select a difficulty factor. This governs the unpredictability of the enemy ship&rsquo;s course and the number of stars that appear. The stars act as obstacles in this game. If you hit one you will be deflected at random so the fewer there are the easier it is to steer your course. Your ship moves continuously and is shaped like an arrowhead and can point in any of eight directions. Every time you press any key it turns clockwise through 45 degrees. The enemy is a revolving cartwheel-shaped disc that meanders through space. To fire your laser press the &lsquo;up arrow&rsquo; key. Your weapon will fire in a straight line from the point of your arrow. If you hit the enemy ship it will disintegrate with appropriate sound and visual effects. The time taken is constantly displayed at the top left of the screen and when it reaches 100 your time is up.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:54:27', '2019-01-07 16:08:34', 2, '2019-01-12 11:10:22', 2, 'N', 'Y', '0'),
(3061, NULL, '', 'Reversi', '1984', 31, 'M', '<p>Published In the February 1984 issue of Computer &amp; Video Games. Issue 28</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-07 16:15:07', '2019-01-07 16:14:17', 2, '2019-01-12 11:10:52', 2, 'N', 'Y', '0'),
(3062, NULL, 'The', 'School Of Death (AKA School Of Death)', '1984', 13, 'M', '<p>Published in Games Computing magazine, issue 1, January 1984.</p>\r\n<p>The listing was for the ORIC-1 but was in a standard BASIC, so has been ported to the BBC Micro in 2019.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-15 17:00:48', '2019-01-15 17:00:48', 2, '2019-01-15 17:02:56', 2, 'N', 'Y', 'Y'),
(3063, NULL, '', 'Snake', '1984', 1, 'B', '<p>Published in the book The Electron Gamesmaster from Granada Technical Books (Granada Publishing Ltd). See the book for a lengthy explanation of the program, which includes the following:</p>\r\n<blockquote>\r\n<p>Even this simple game involving a snake is quite addictive! This is not to say that there&rsquo;s no scope both for improvement and innovation, but overall the game is a great success and has a speed and interest normally only found in assembly language games.</p>\r\n</blockquote>', 1, 1, '', '', '', 'Y', '', '', '', 3, '2019-04-19 14:30:35', '2019-01-15 17:10:04', 2, '2019-01-15 17:25:30', 2, 'N', 'Y', '0'),
(3064, NULL, '', 'Pac-Track (AKA Pac-Trac)', '1983', 1, 'B', '<p>Published in the book Games For Your BBC Micro by Virgin Books Ltd. It contains the following description:</p>\r\n<blockquote>\r\n<p>In this game your maze-man is off on another adventure. His aim is to eat up all the blocks but he is in some difficulty because, as he moves around, he leaves a trail of blocks he cannot digest and he cannot therefore retrace his path. You have 90 seconds to eat up all the blocks.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:42:29', '2019-01-15 17:10:30', 2, '2019-01-15 17:28:32', 2, 'N', 'Y', '0'),
(3065, NULL, '', 'Solo Dogfight (AKA Dogfight)', '1983', 473, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book notes that this program was originally by Robert Erskine and converted for the BBC Micro by Ian Thomas. It contains the following description:</p>\r\n<blockquote>\r\n<p>Up in the wild blue yonder, you and the enemy ace are duelling above the trenches. Swoop down on the foe, hang on his tail, catch him unawares from below, with your trusty Brownings spitting leaden death. All good clean fun, but watch for the wraparound!</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-13 13:24:24', '2019-01-15 17:10:48', 2, '2019-01-15 17:55:57', 2, 'N', 'Y', '0'),
(3066, NULL, '', 'Canfield Patience', '1990', 38, 'M', '<p>Published in Micro User Magazine vol.8 issue 5 in July 1990</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-15 17:40:49', '2019-01-15 17:11:14', 2, '2019-01-15 17:42:12', 2, 'N', 'Y', '0'),
(3067, NULL, '', 'Greyhound Derby (AKA Greyhound Derby Stakes)', '1983', 497, 'M', '<p>Published in issue 38 of Home Computing Weekly in November 1983.</p>', 1, 5, '', '', '', '', '', '', '', 2, '2019-01-18 18:17:41', '2019-01-15 17:11:39', 2, '2019-01-21 09:05:46', 2, 'N', 'Y', 'Y'),
(3068, NULL, '', 'Ultima', '1983', 31, 'M', '<p>Published in the Spring 1983 issue of Personal Software magazine in February 1983.</p>\r\n<p><a href="game.php?id=1925">Another version</a> of this game would later be published in Micro User magazine, in July 1990.</p>\r\n<p>This variation on Chess was invented in 1962 by Robert Abbott. It was originally called <a href="https://en.wikipedia.org/wiki/Baroque_chess">Baroque Chess</a>, but was changed to Ultima at the suggestion of his publisher.</p>\r\n<p>&nbsp;</p>\r\n<p>Some variations to the rules exist.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-05-08 13:28:13', '2019-01-21 09:06:26', 2, '2019-01-21 09:10:21', 2, 'N', 'Y', '0'),
(3069, NULL, '', 'Sea Attack', '1984', 11, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 3, No. 9 (1st March 1984).</p>', 1, 4, '', '', '', '', '', '', '', 2, '2019-01-21 09:28:28', '2019-01-21 09:06:45', 2, '2019-01-21 09:09:40', 2, 'N', 'Y', '0'),
(3070, NULL, '', 'Sharp Shooter', '1984', 473, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>In this fun program, based on an idea from Ant Hurrion, you control the man on the right of the cacti on your screen. You must shoot it out with the computer gunman.</p>\r\n<p>The winner is the marksman who first gains 100 points. There are several levels of difficulty, and you''re able to choose the level at which you''ll start play at the start of the game.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:37:46', '2019-01-21 09:07:00', 2, '2019-02-04 17:34:15', 2, 'N', 'Y', '0'),
(3071, NULL, '', 'Frogling', '1984', 4, 'B', '<p>Published in the book The Electron Gamesmaster from Granada Technical Books (Granada Publishing Ltd). &nbsp;The book contains the following description:</p>\r\n<blockquote>\r\n<p>A frog plays a central role in this as well as in last chapter&rsquo;s game. Frogling is a version of the classic arcade game of Frogger. The object of the game is to get a frog safely across a busy road, dodging oncoming traffic, and then across a fast flowing river, by jumping on floating logs The implementation of this game in BASIC provides an opportunity to explain and experiment with a type of animation that relies on scrolling.</p>\r\n</blockquote>', 1, 1, '', '', '', 'Y', '', '', '', 3, '2019-04-19 14:29:57', '2019-01-21 09:07:15', 2, '2019-01-21 09:09:20', 2, 'N', 'Y', '0'),
(3072, NULL, 'The', 'Tombs Of Arkenstone', '1984', 13, 'W', '<p>An educational adventure/RPG used in schools.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-01-24 15:47:16', '2019-01-24 15:40:48', 2, '2019-01-24 15:48:02', 2, 'N', 'Y', '0'),
(3073, NULL, '', 'Dungeon Of Doom', '1984', 36, 'B', '<p>Dungeon Of Doom was published as a type-in listing in the book Write Your Own Fantasy Games For Your Microcomputer, a free PDF of which is available from&nbsp;<a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a>.</p>\r\n<p>A big thank-you to&nbsp;<a href="https://github.com/bchiha/dungeon-of-doom">Brian</a>, who typed in and improved the listing, uploaded instructions for playing the game, and designed the character and dungeon levels.</p>', 1, 1, '', 'D', '', '', '', '', '', 3, '2019-09-28 09:43:11', '2019-01-27 17:41:10', 3, '2019-01-31 15:50:40', 3, 'N', 'Y', '0'),
(3074, NULL, '', 'Venusians', '1983', 454, 'M', '<p>The listing was published in the Load Runner computer comic, issue 8, dated September 29th 1983, published by ECC.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:48:07', '2019-02-04 11:15:35', 2, '2019-02-04 11:40:33', 2, 'N', 'Y', '0'),
(3075, NULL, '', 'Spider And Fly', '1983', 11, 'B', '<p>Published in the book Games For Your BBC Micro by Virgin Books Ltd. It contains the following description:</p>\r\n<blockquote>\r\n<p>You are a very hungry spider, hanging from a thread on the left-hand side of the screen, whose main aim in life is to get your lunch. When six rather fat flies come into view, you have 99 seconds to munch your way through as many of them as you can. Use the &lsquo;&lsquo;Y&rsquo;&rsquo; key to go up and the &lsquo;&lsquo;B&rsquo;&rsquo; key to go down.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:43:13', '2019-02-04 11:15:54', 2, '2019-02-04 11:40:14', 2, 'N', 'Y', '0'),
(3076, NULL, '', 'Master Code (AKA Mastercode)', '1983', 17, 'R', '<p>Published on the three-game compilation Games Of Deduction. The games included were 3D Maze, Colour Cube, and Master Code.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:49:18', '2019-02-04 11:16:09', 2, '2019-02-04 11:37:51', 2, 'N', 'Y', '0'),
(3077, NULL, '', 'Saucer Encounter', '1984', 45, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>In this challenging game, based on an idea by Garry Wilson, you are working in real time, trying to land your spacecraft on the flying saucer which moves across the bottom of the screen.</p>\r\n<p>When the game is underway, the screen is dotted with randomly plotted stars, and there''s even a right bracket for a moon. Fuel is being consumed all the time, and you must land on the saucer before all the fuel has been used up. Your '' pilot rating'' depends, in part, on how little fuel you used up to land successfully. Crash landings do not acquire a rating.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:36:52', '2019-02-04 11:16:27', 2, '2019-02-04 11:39:11', 2, 'N', 'Y', '0'),
(3078, NULL, '', 'Field-Gun', '1983', 546, 'M', '<p>Published in Your Computer magazine, volume 3, issue 1, in January 1983.</p>', 2, 2, '', '', '', '', '', '', '', 3, '2019-04-19 14:50:36', '2019-02-04 11:16:42', 2, '2019-02-04 11:37:08', 2, 'Y', 'Y', '0'),
(3079, NULL, '', 'Nine Hole Golf', '1983', 465, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<blockquote>\r\n<p>This is a colour graphics game that combines both driving and putting and even includes the hazard of bunkers. You play around a nine hole course with two stages at each hole &minus; the fairway and the green. When you RUN it notice how, in the first stage, the golfer makes his swing and how the ball flies through the air.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 17:31:51', '2019-02-04 11:16:56', 2, '2019-02-04 11:38:33', 2, 'N', 'Y', '0'),
(3080, NULL, '', 'Bouncing Bug', '1983', 1, 'B', '<p>Bouncing Bug may be found as a type-in listing in Understanding Computer Graphics.&nbsp;A free PDF of the book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:51:42', '2019-02-04 11:17:11', 2, '2019-02-04 11:35:53', 2, 'N', 'Y', '0'),
(3081, NULL, '', 'Woodworm', '1984', 1, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing, which contains the following description:</p>\r\n<blockquote>\r\n<p>Picture yourself as a woodworm. If you look like me, that is not hard to do. All you have to do is eat your way across the screen. For the purposes of this game, you must think of the screen as a large chunk of wood. The wood is made up of three types of timber: hard, medium strength and soft. The three types are shown by different colours on the screen: red for the hardest wood, yellow for the medium grade and green for the soft.</p>\r\n<p>You must cross the screen in the shortest time possible. Bear in mind that eating through tough wood is more time-consuming and tiring than munching on the softer stuff. Woodworm is based on a program by J. Bull. Full instructions are within the program.</p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:36:32', '2019-02-04 11:17:25', 2, '2019-02-04 11:41:10', 2, 'N', 'Y', '0'),
(3082, NULL, '', 'Cycles', '1984', 1, 'M', '<p>Published in Acorn Programs magazine, issue 2, February/March 1984.</p>', 2, 2, '', '', '', '', '', '', '', 3, '2019-04-19 14:51:00', '2019-02-04 11:17:38', 2, '2019-02-04 11:36:31', 2, 'N', 'Y', '0'),
(3083, NULL, '', 'Minefield', '1984', 1, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>In Minefield, written by Neal Cavalier-Smith, you use the ''Z'',</strong><br /><strong>''X'', ''*'' and ''?'' keys to move yourself around the screen, in which</strong><br /><strong>you have to manoeuvre your tank across the minefield to get to</strong><br /><strong>the other side.</strong><br /><strong>Once you get safely to the right hand-side of the screen,</strong><br /><strong>you''ll be given the chance of tackling a more difficult field.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:43:01', '2019-02-08 09:29:22', 2, '2019-02-15 09:22:45', 2, 'N', 'Y', '0'),
(3084, NULL, '', 'On The Adventure Trail (AKA Egypt Adventure)', '1984', 13, 'B', '<p>From the book Adventures With The BBC Microcomputer. Translated from the Dutch Op Avontuur Met De BBC by Wichert van Engelen.</p>\r\n<p>The English translation is by Elizabeth McConologue.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:46:47', '2019-02-08 09:29:59', 2, '2019-02-11 09:38:17', 2, 'N', 'Y', '0'),
(3085, NULL, '', 'Save The Whale', '1983', 1, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee, and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p style="padding-left: 60px;"><strong>This is a moving graphics game for conservationists! The object of the</strong><br /><strong>game is to ensure that the whale survives to swim on in arctic seas.</strong><br /><strong>You have to outwit the eskimos who are hunting the whale in their</strong><br /><strong>kayaks. If they run into the icebergs they will have to abandon their</strong><br /><strong>hunt so you must lure them towards these obstacles by moving the</strong><br /><strong>whale in such a way that, in approaching it, the eskimos crash.</strong></p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-13 13:43:15', '2019-02-08 09:30:15', 2, '2019-02-08 15:23:11', 2, 'N', 'Y', '0'),
(3086, NULL, '', 'Virus', '1983', 1, 'B', '<p>The original program was written by Allan And Sue Vining for the Commodore PET, and published in Personal Computer World in September 1982. The program was converted for the BBC Micro by Brian Jones.</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;"><strong>A light cycle by any other name would shine as bright!</strong><br /><strong>&nbsp;&nbsp;&nbsp;&nbsp; This fast-moving game casts you in the role of avenging</strong><br /><strong>antibody, protecting your pound of flesh from an invading virus.</strong><br /><strong>&nbsp;&nbsp;&nbsp;&nbsp; Both you and the virus move around the screen leaving trails,</strong><br /><strong>and you must use the cursor keys to trap the virus without running</strong><br /><strong>into anything yourself, but beware, if you succeed then you are</strong><br /><strong>faced with two viruses.</strong></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 17:17:05', '2019-02-08 09:30:28', 2, '2019-02-08 15:23:31', 2, 'N', 'Y', '0'),
(3087, NULL, '', 'Bladedancer (AKA Blade Dancer)', '1993', 36, 'R', '<p>Requires Sideways RAM.&nbsp;<a href="https://stardot.org.uk/forums/viewtopic.php?f=13&amp;t=13839">More details</a> at Stardot.</p>\r\n<p>This game is unavailable. The author is known to be in possession of what is probably the only surviving copy of the game, but repeated offers of help to archive it have been rebuffed.</p>', 1, 1, '', '', 'SWR', '', '', '', '', 2, '2019-11-20 09:57:51', '2019-02-08 19:58:33', 3, NULL, 0, 'N', 'Y', '0'),
(3088, NULL, '', 'Alien Attack (AKA Alien Attackers)', '1982', 454, 'M', '<p>Published in Personal Software magazine, issue 1, Summer 1982.</p>\r\n<p>The magazine states this program was based on a program by Henry Budgett And David Sinfield.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:45:18', '2019-02-11 09:38:56', 2, '2019-02-11 09:41:55', 2, 'N', 'Y', '0'),
(3089, NULL, '', 'Buzzy Bee', '1983', 569, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">In Buzzy Bee you control a small bird which pecks away at the stems of a</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">row of plants which are gradually growing towards the top of the screen.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">If any of the plants should reach the top a bee will drop down and take</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the nectar and you have lost the game.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">The bird can be moved from left to right by using the Z and X keys and</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the ''M'' key will cause it to peck, although none of the stems can be</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">pecked twice in succession.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:27:29', '2019-02-11 09:39:08', 2, '2019-02-11 09:42:14', 2, 'N', 'Y', '0'),
(3090, NULL, '', 'Duck Shoot', '1983', 2, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The book states the program is by Brian Jones and J.A. Maris from an original program by B. Philips.</p>\r\n<p>The original listing, for the Sharp MZ-80K was published in Personal Computer World in August 1981.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette contained the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This game allows you to play the part of an early morning duck</strong><br /><strong>hunter. When the sun comes up all the ducks will fly away, so you</strong><br /><strong>have to shoot the sun back down when it rises. You can move left</strong><br /><strong>and right among the rushes at the bottom of the screen using the G</strong><br /><strong>and J keys. H is used to fire.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 17:09:23', '2019-02-11 09:39:24', 2, '2019-02-11 09:42:34', 2, 'N', 'Y', '0'),
(3091, NULL, '', 'Mushroom Mania', '1986', 2, 'M', '<p>Published over two issues of Popular Computing Weekly magazine: volume 5, issues 36 and 37 (September 4th and September 11th 1986).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-02-11 10:14:53', '2019-02-11 09:39:39', 2, '2019-02-11 09:42:56', 2, 'N', 'Y', '0'),
(3092, NULL, '', 'Tennis', '1988', 18, 'M', '<p>Published in Electron User magazine, volume 5, issue 10, in July 1988.</p>', 2, 2, '', '', '', 'Y', '', '', '', 3, '2019-04-19 14:44:40', '2019-02-11 09:39:56', 2, '2019-02-11 09:43:14', 2, 'N', 'Y', '0'),
(3093, NULL, '', 'Invader Blaster', '1983', 453, 'B', '<p>Published in the book Games For Your BBC Micro by Virgin Books Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>The aim of this game is to destroy the space invaders who</strong><br /><strong>appear above the runway you see in front of you. You are</strong><br /><strong>controlling a galactic patrol ship which has left and right,</strong><br /><strong>and up and down controls. As you move your controls</strong><br /><strong>down, the horizon moves up, and vice-versa.</strong><br /><strong>The runway in front of you shows where the target is</strong><br /><strong>going to appear. You know it will be appearing about 600</strong><br /><strong>metres above the runway. The crafty space invaders,</strong><br /><strong>however, create bogus UFOs which appear all over the</strong><br /><strong>screen &mdash; you have to get the real space invader.</strong><br /><strong>On the screen you are given your x, y, and z</strong><br /><strong>coordinates. Your y co-ordinate gives your height above</strong><br /><strong>the ground in metres. Your x co-ordinate gives your</strong><br /><strong>distance away from the centre of the runway in metres.</strong><br /><strong>Your z co-ordinate tells you how far you''ve gone.</strong><br /><strong>If it takes you 10,000 metres (10 km) to destroy the</strong><br /><strong>alien, you will be blown up by the invisible mines it lays;</strong><br /><strong>because you are travelling at about 100 metres per</strong><br /><strong>second, it means you&rsquo;ve got just over 1&frac12; minutes to</strong><br /><strong>destroy the alien. Your controls are &lsquo;Y&rsquo; to go up, &lsquo;B&rsquo; to</strong><br /><strong>godown, &lsquo;Z&rsquo; to go left and &lsquo;X&rsquo; to go right. To fire, you press</strong><br /><strong>the space bar.</strong><br /><strong>The problem is that at the high speed you are travelling</strong><br /><strong>your velocity from left to fight and up and down is continually</strong><br /><strong>changing because of wind resistance. You must</strong><br /><strong>surmount these difficulties by deft use of your controls.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:38:31', '2019-02-15 09:23:41', 2, '2019-02-15 09:31:58', 2, 'N', 'Y', '0');
INSERT INTO `games` (`id`, `parent`, `title_article`, `title`, `year`, `genre`, `reltype`, `notes`, `players_min`, `players_max`, `joystick`, `save`, `hardware`, `electron`, `version`, `series`, `series_no`, `lastupdater`, `lastupdated`, `created`, `creator`, `imgupdated`, `imgupdater`, `compat_a`, `compat_b`, `compat_master`) VALUES
(3094, NULL, '', 'Snazzy Snake', '1983', 1, 'B', '<p>The listing for this game was published in the book Quality Programs For The BBC Micro from Micro Press.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Just for a change, here''s a reaction-speed game. You are control-</strong><br /><strong>ling the movement of a snake in an enclosed area. The snake is</strong><br /><strong>moving constantly -- you can''t do anything to alter that; what</strong><br /><strong>you can control is its direction. But even here the game differs</strong><br /><strong>significantly from most direction-control games, in that you</strong><br /><strong>control the snake''s direction from its point of view, rather than</strong><br /><strong>yours. You use the left and right arrow keys, but they don''t mean</strong><br /><strong>screen-left and screen-right -- they mean the snake''s left and the</strong><br /><strong>snake''s right, regardless of which way the snake is facing. This is</strong><br /><strong>a very good exercise in visualisation.</strong></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 21:03:06', '2019-02-15 09:23:56', 2, '2019-02-15 09:34:49', 2, 'N', 'Y', '0'),
(3095, NULL, '', 'Motocross (AKA Moto-Cross and Stunt-Cycle)', '1983', 471, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Motocross consists of two games. In the first a motorcycle races across</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the screen from left to right, continuing down through several leves, and</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">must leap over obstacles placed in its path.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">In the second game, Stunt-Cycle, the motorcycle leaps over a line of</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">buses and must be landed on the other side without loss of control. After</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">each successful leap the number of buses is increased.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:22:21', '2019-02-15 09:24:12', 2, '2019-02-15 09:51:01', 2, 'N', 'Y', '0'),
(3096, NULL, '', 'Zombie', '1984', 1, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book states the game is based on a program by Raymond Blake.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Now you can take on the challenge of Zombie in this exciting</strong><br /><strong>version of the game based on a program by Raymond Blake.</strong><br /><strong>You are stranded on an island of cannibal zombies. Your</strong><br /><strong>only hope of escape is to lure them into the pot-holes scattered</strong><br /><strong>about the island. The trees on the island hinder the progress of</strong><br /><strong>both man and zombie, and falling into a pot-hole means eternal</strong><br /><strong>entrapment.</strong><br /><strong>The game is made more difficult by the fact that you can</strong><br /><strong>move in only four directions. The zombies can not only move</strong><br /><strong>up, down, right and left, but can also move diagonally.</strong><br /><strong>You need not panic, however, as the zombies are pretty</strong><br /><strong>short-sighted and this gives you a distinct edge with your 20/20</strong><br /><strong>vision.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:16:57', '2019-02-15 09:24:27', 2, '2019-02-15 10:01:34', 2, 'N', 'Y', '0'),
(3097, NULL, '', 'Ant Hill', '1984', 1, 'B', '<p>Published in the book The Electron Gamesmaster from Granada Technical Books (Granada Publishing Ltd).</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Ant Hill is a simple but effective program that involves the animation</strong><br /><strong>of a number of objects. The basic idea of the game is to guide a man</strong><br /><strong>through tunnels that belong to an ant colony with the aim of reaching</strong><br /><strong>and destroying the nest of eggs located at the deepest point. The</strong><br /><strong>difficulty of this task is increased by having to work within a time limit</strong><br /><strong>and by having to avoid soldier ants positioned at each level of the</strong><br /><strong>tunnels. Thee major problem in implementing a game of this sort lies in</strong><br /><strong>animating a number of objects, the man and all the soldier ants, at the</strong><br /><strong>same time. As well as dealing with this particular problem this chapter</strong><br /><strong>also develops some of the standard methods that will be used without</strong><br /><strong>further comment in subsequent chapters.</strong></p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2019-04-23 18:34:49', '2019-02-15 09:24:41', 2, '2019-02-15 10:04:50', 2, 'N', 'Y', '0'),
(3098, NULL, '', 'Mirror Tile', '1983', 17, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:<span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;"><strong><br /></strong></span></span></p>\r\n<blockquote>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Although your BBC Micro opens up lots of new possibilities for</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">games, it&rsquo;s good to know that it can also conjure up old favourites.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Mirror Tile is a colourful and versatile version of a game that is</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">conventionally played on a small board with the pieces slotted into one</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">another and into their surrounding frame. This construction is vital to</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the game, the object of which is to rearrange the pieces to match a</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">given pattern &minus; hence it&rsquo;s title &lsquo;Mirror Tile&rsquo;.</span></span></strong></p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:00:11', '2019-02-15 09:24:54', 2, '2019-02-15 10:10:19', 2, 'N', 'Y', '0'),
(3099, NULL, '', '3D Brainstorm', '1983', 17, 'B', '<p>Published in the book Brainteasers For The BBC And Electron Computers, published by Phoenix Publishing Associates.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong>If you feel like some brainstorming, how about this three-dimensional</strong><br /><strong>game for two players. It is like three-dimensional</strong><br /><strong>noughts and crosses, except it has the</strong><br /><strong>advantage that all faces can be seen at a glance.</strong><br /><strong>Nine cubes are displayed on the screen and each face of</strong><br /><strong>each cube is divided into nine squares. Your aim is to</strong><br /><strong>colour in a row or column of squares in which you have</strong><br /><strong>coloured in the same square. For example, in the screen</strong><br /><strong>show above, the red player has coloured in a row of</strong><br /><strong>squares on the top left hand cube. Also the yellow player</strong><br /><strong>has coloured in all the top left-hand squares on the faces</strong><br /><strong>on the front of the central cube, so he has both a row and</strong><br /><strong>column of squares coloured in.</strong></p>\r\n<p>&nbsp;</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-04-23 18:47:38', '2019-02-15 12:47:55', 2, '2019-02-15 15:47:24', 2, 'N', 'Y', '0'),
(3100, NULL, '', 'Labyrinth', '1984', 45, 'M', '<p>Published in Acorn Programs magazine, issue 8, December 1984.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:38:24', '2019-02-15 12:48:12', 2, '2019-09-06 11:17:58', 2, 'N', 'Y', '0'),
(3101, NULL, '', 'Jaws', '1984', 1, 'B', '<p>Jaws may be found as a type-in listing in Weird Computer Games.&nbsp;A free PDF of the book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:32:03', '2019-02-15 12:48:24', 2, '2019-02-15 15:48:10', 2, 'N', 'Y', '0'),
(3102, NULL, '', 'Cheshire Cats And Other Nasties!', '1983', 454, 'B', '<p>Originally written by Paul Stanley and converted for the BBC Micro by Colin Tanner.</p>\r\n<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Cast adrift in space, and without fuel, you have only a beam weapon with</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">which to defend yourself against the hostile nasties that assail you from all</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">sides.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Your craft can be spun around to the left and right with the Z and X keys.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Your beam is fired with RETURN, and if you''re really desperate, you can</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">always do your disappearing act by pressing your SPACE bar and visiting</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the void for a while.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:32:00', '2019-02-25 09:17:59', 2, '2019-09-09 11:08:24', 2, 'N', 'Y', '0'),
(3103, NULL, '', 'Knightsbridge', '1983', 31, 'B', '<p>Published in the book Games For Your BBC Micro, published by Virgin Books Ltd.</p>\r\n<p>An almost identical listing was also published in the book Games BBC Computers Play, published by Interface Publications, also in 1983, which gives Tim Hartnell as the author.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Knightsbridge is a game played on a seven by seven board, with each player</strong><br /><strong>having seven chess knights as pieces (which explains the name). The</strong><br /><strong>computer throws a die which determines which piece the human player must</strong><br /><strong>move, then it throws a die for itself to determine which piece it must move. All</strong><br /><strong>pieces move like knights in chess (and you are not allowed to cheat) and a</strong><br /><strong>piece is captured by the opponent landing on top of it. The first player to</strong><br /><strong>capture five of the opponent''s pieces wins.</strong><br /><strong>You move the indicated piece by telling the computer which square you wish to</strong><br /><strong>end up in. The board is labelled one to seven along the top and bottom, and</strong><br /><strong>from seven to one down the sides, as you can see from the sample run. You</strong><br /><strong>enter the number along the side (e.g. 6) then the number along the top (e.g. 4)</strong><br /><strong>as a single number (i.e, 64) to move your piece onto square number 64. You</strong><br /><strong>will be swiftly chastised if you try to cheat. You can concede at any time by</strong><br /><strong>entering 99 when asked for your move.</strong></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:24:28', '2019-02-25 09:25:37', 2, '2019-11-30 15:00:35', 2, 'N', 'Y', '0'),
(3104, NULL, '', 'Leap Frog', '1984', 27, 'B', '<p>Published in the book The Electron Gamesmaster from Granada Technical Books (Granada Publishing Ltd).</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Leap Frog is a game that involves full two-dimensional animation. That</strong><br /><strong>is, one of the objects in the game, the frog, moves both horizontally and</strong><br /><strong>vertically at the same time. (This should be compared to Ant Hill in the</strong><br /><strong>last chapter where the objects only moved either horizontally or</strong><br /><strong>vertically.) In addition, a number of other interesting animation</strong><br /><strong>techniques are used to create a fascinating display using surprisingly</strong><br /><strong>few BASIC statements. The game itself is both fun to watch and play</strong><br /><strong>and provides a host of possibilities for variations.</strong></p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2019-04-23 18:32:09', '2019-02-25 09:34:39', 2, '2019-02-25 09:40:55', 2, 'N', 'Y', '0'),
(3105, NULL, '', 'Mandala', '1984', 31, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Based on Draughts, this game pits you (the round, mandala like pieces)<br />against the BBC Micro''s pieces (which look a little<br />like Chess knights). You move diagonally, as in Draughts, and<br />you capture by jumping over the opponent''s piece into an<br />empty square beyond. There are no multiple jumps. Each piece<br />can move in any direction (that is, forwards or backwards on<br />the diagonal).<br />You start off in the corner of the board, rather than along<br />the sides as in ordinary Draughts. You defeat your trusty BBC<br />Micro if you manage to capture seven of its pieces before it<br />manages to capture seven of yours. The computer will concede<br />the game if it decides you have such a lead that it could never<br />catch up.<br />You''ll find the game runs very quickly, and the computer''s<br />response time increases a little as the game progresses. You<br />move by entering a four-digit number, made up from the<br />number across the top then down the side of the piece you''re<br />moving, then the number across the top then down the side of<br />the square you''re moving to.<br /></span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:13:43', '2019-02-25 09:44:03', 2, '2019-02-25 09:48:45', 2, 'N', 'Y', '0'),
(3106, NULL, '', 'Noughts And Crosses', '1983', 34, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Noughts and crosses is a perennial favourite because it is a simple</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">game of strategy. The problem with playing it against a computer is</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">that the computer can be programmed so that the person challenging it</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">can never win. However, this program makes your BBC Micro an</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">opponent who can be beaten. The BBC Micro will make sensible</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">moves but is not infallible so it is worth playing on until you beat it.</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">It&rsquo;s actually a very good way of learning about game-playing strategy.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:03:32', '2019-02-25 09:52:39', 2, '2019-02-25 09:53:19', 2, 'N', 'Y', '0'),
(3107, NULL, '', 'Pelmanism', '1983', 38, 'M', '<p>Published in Your Computer magazine, volume 3, issue 5, in May 1983.</p>\r\n<p>The article was written by "Woodward and Berry", with no first names given.</p>', 2, 2, '', '', '', '', '', '', '', 3, '2019-04-19 14:28:16', '2019-02-25 10:02:59', 2, '2019-02-25 10:05:22', 2, 'N', 'Y', '0'),
(3108, NULL, '', 'Postman', '1983', 1, 'B', '<p>The program was originally written by Paul Stanley and converted for the BBC Micro by "Graham/Thomas". [N.B. "Thomas" will be Ian Thomas, and Graham will be a surname, although no first name is known. --Lee]</p>\r\n<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">In Postman you have a limited time in which to collect a letter from a post</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">box and deliver it to the house without being caught by the dog. The</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">number of post boxes can be varied for each game and letters must be</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">collected from the one which is currently flashing.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:30:02', '2019-02-25 10:11:19', 2, '2019-02-25 10:22:13', 2, 'N', 'Y', '0'),
(3109, NULL, '', 'Rubik''s Cube', '1983', 17, 'B', '<p>The listing for this game was published in the book Quality Programs For The BBC Micro from Micro Press.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This program demonstrates the BBC Micro''s graphics capability</strong><br /><strong>by modelling the cube. A condensed version of a full cube-solver</strong><br /><strong>written by Robert Browning. It permits the user to twist the cube</strong><br /><strong>at will, or to set it rotating randomly.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 20:55:03', '2019-02-25 10:34:01', 2, '2019-02-25 10:43:36', 2, 'N', 'Y', '0'),
(3110, NULL, '', 'Space War', '1986', 550, 'M', '<p>Published over three issues of Popular Computing Weekly magazine, volume 5, issues 32, 33, and 34 (August 7th, 14th and 21st, 1986).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:27:41', '2019-02-25 10:52:32', 2, '2019-02-25 12:10:11', 2, 'N', 'Y', '0'),
(3111, NULL, '', 'Cannibal Island', '1984', 13, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 40 (4th October 1984).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:26:56', '2019-03-07 16:06:20', 2, '2019-03-07 16:13:53', 2, 'N', 'Y', '0'),
(3112, NULL, '', 'Stunt Car Racer', '2019', 6, 'P', '<p>Originally written by Geoff Crammond and released in 1989 for the Commodore Amiga and Atari ST.</p>\r\n<p>Ported to the BBC Master in 2019 by Kieran Connell and the Bitshifters Collective. BBC Master artwork by John Blythe.</p>\r\n<p><a href="https://bitshifters.github.io/posts/prods/bs-scr-beeb.html">More details</a> at Bitshifters.</p>', 1, 1, '', 'D', '', '', '1.1', '', '', 2, '2019-03-25 15:23:28', '2019-03-10 17:53:13', 2, '2019-03-25 15:24:19', 2, 'N', 'N', 'Y'),
(3113, NULL, '', 'Eliminate', '1984', 10, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Now that the maze has vanished, the ghost are on the run.</strong><br /><strong>In this great arcade game, your mission is to seek out and destroy.</strong><br /><strong>There are two enemies on the screen, and you can pick either one of them to eliminate.</strong><br /><strong>You do this by running over it.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:04:20', '2019-03-29 10:17:18', 2, '2019-03-29 10:22:33', 2, 'N', 'Y', '0'),
(3114, NULL, 'The', 'Great Wall', '1985', 4, 'M', '<p>The listing was published in Popular Computing Weekly, volume 4, No. 12 (21st March 1985).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:25:04', '2019-03-29 10:17:38', 2, '2019-03-29 10:22:55', 2, 'N', 'Y', '0'),
(3115, NULL, '', 'Othello', '1983', 504, 'P', '<p>This game was written by David Griffin in 1983, but first saw the light of day on his <a href="https://www.ee.ucl.ac.uk/~dgriffin/bbc/">website</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-28 17:24:55', '2019-03-29 10:17:53', 2, '2019-03-29 10:23:38', 2, 'N', 'Y', '0'),
(3116, NULL, '', 'Robot', '1983', 1, 'B', '<p>The listing for this game was published in the book Quality Programs For The BBC Micro from Micro Press.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>In the far future, the sport of the rich is electronic gladiatorial</strong><br /><strong>combat. One particularly nasty form of this involves throwing a</strong><br /><strong>human into an arena with a robot which is programmed to kill</strong><br /><strong>him or her. In this program you are that human.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 20:47:25', '2019-03-29 10:18:07', 2, '2019-03-29 10:23:59', 2, 'N', 'Y', '0'),
(3117, NULL, '', 'Rocket Attack', '1983', 2, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette states the program was originally written by John Gooderson for the TRS-80 computer, and published in Personal Computer World in April 1981. The program was converted for the BBC Micro by Philip Lindsay.</p>\r\n<p>It also contained the following description:</p>\r\n<p style="padding-left: 60px;"><strong>A game for up to four people, acting as commanders of their own</strong><br /><strong>missile launching sites. Their task &ndash; to defend a nuclear power</strong><br /><strong>station against a rocket attack: all they have to do is to shoot down</strong><br /><strong>the rockets!</strong><br /><strong>&nbsp;&nbsp;&nbsp;&nbsp; The Commander can control his missile by using the numeric</strong><br /><strong>keys 1-5, and the space bar; the former guide the missile''s</strong><br /><strong>left/right bearing, and the latter gives it emergency boost as it</strong><br /><strong>nears its target. Failure to hit the rocket means that the power</strong><br /><strong>station under threat is likely to have a lump knocked out of it! Each</strong><br /><strong>Commander can volunteer for up to three postings on active</strong><br /><strong>service, assuming that the strain is not too great. End-of-posting</strong><br /><strong>reports are produced which give success/failure ratings,</strong><br /><strong>together with recommendations as to the Commander''s future</strong><br /><strong>career development!</strong></p>', 1, 4, '', '', '', '', '', '', '', 2, '2019-05-10 17:14:39', '2019-03-29 10:18:22', 2, '2019-03-29 10:24:21', 2, 'N', 'Y', '0'),
(3118, NULL, '', 'Taipei', '1991', 34, 'M', '<p>Published in Micro User magazine, volume 9, issue 8, in October 1991.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:17:41', '2019-03-29 10:18:34', 2, '2019-03-29 10:24:38', 2, 'N', 'Y', '0'),
(3119, NULL, 'The', 'Grid', '1984', 454, 'M', '<p>Published in the March 1984 issue of Practical Computing magazine (volume 7, issue 3).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-03-29 13:48:28', '2019-03-29 10:18:50', 2, '2019-03-29 10:23:18', 2, 'N', 'Y', '0'),
(3120, NULL, '', 'World War 1 (AKA WW1)', '1983', 2, 'M', '<p>Published in the November 1983 issue of Practical Computing magazine (volume 6, issue 11).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-03-29 10:30:45', '2019-03-29 10:19:20', 2, '2019-03-29 10:24:59', 2, 'N', 'Y', '0'),
(3121, NULL, '', 'Alien Lander', '1983', 569, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 19 (12th May 1983).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 14:17:02', '2019-03-30 12:51:16', 2, '2019-08-05 11:19:42', 2, 'N', 'Y', '0'),
(3122, NULL, '', 'Artillery', '1983', 546, 'B', '<p>The listing for this game was published in the book Quality Programs For The BBC Micro from Micro Press.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This game is for two players, each of whom is in charge of a gun.</strong><br /><strong>The guns are on opposite sides of the screen, generally with some</strong><br /><strong>interesting terrain between them, and each player is trying to hit</strong><br /><strong>the other player''s gun. Before the missile can be fired the player</strong><br /><strong>must decide how much powder to put in the gun, and at what</strong><br /><strong>angle to fire.</strong></p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-04-23 20:41:33', '2019-03-30 12:51:28', 2, '2019-03-30 12:53:21', 2, 'N', 'Y', '0'),
(3123, NULL, '', 'Exocet', '1983', 2, 'B', '<p>Originally authored by Robert Erskine and converted for the BBC Micro by Colin Tanner (C.R.T.)</p>\r\n<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">A group of enemy ships randomly make their way across the horizon, and</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">it''s up to you to sink as many of them as possible by firing missiles using</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the space bar. A mobile sight is printed slightly below the line of the</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">horizon. There are three sizes of enemy ships, and the smaller the target</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the more points you score for a hit. Occasionally the enemy''s electronic</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">defence system will succeed in confusing you missile and deflecting it</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">from its course.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:25:17', '2019-03-30 12:51:41', 2, '2019-03-30 12:54:05', 2, 'N', 'Y', '0'),
(3124, NULL, '', 'Sub (AKA Submarine)', '1983', 2, 'M', '<p>Published in the July 1983 issue of Practical Computing magazine (volume 6, issue 7).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-03-30 12:58:06', '2019-03-30 12:51:53', 2, '2019-03-30 12:54:44', 2, 'N', 'Y', '0'),
(3125, NULL, '', 'Treasure Island', '1983', 21, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<blockquote>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Find the hidden treasure before the pirate ship reaches the island. This</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">game has all the ingredients of high adventure. A desert island,</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">peopled by natives both hostile and friendly, gold buried at the spot</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">marked &lsquo;X&rsquo; on the map, quicksands that spell danger to the unlucky</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">treasure-seeker and even Long John Silver&rsquo;s parrot. While you hunt</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">for the booty the pirate ship is heading towards the island and once the</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">pirates land you are certain to be captured. The game is displayed in</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">colour graphics and has sound effects as well.</span></span></strong></p>\r\n</blockquote>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 13:00:47', '2019-03-30 12:52:08', 2, '2019-03-30 12:55:19', 2, 'N', 'Y', '0'),
(3126, NULL, '', 'Flowers Of Crystal', '1984', 405, 'R', '<p>People of a certain age may remember Granny''s Garden, Flowers of Crystal, Dragon World, and Box of Treasures from school in the 1980s.</p>\r\n<p>These games from 4Mation Software cannot be played online, or downloaded, as 4Mation still enforce copyright on their titles.</p>\r\n<p>Flowers Of Crystal is still for sale <a href="http://www.4mation.co.uk/retro/retrofoc.html">here</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-08 23:57:36', '2019-04-05 09:24:22', 2, NULL, 0, 'N', 'Y', '0'),
(3127, NULL, 'The', 'Box Of Treasures', '1985', 405, 'R', '<p>People of a certain age may remember Granny''s Garden, Flowers of Crystal, Dragon World, and Box of Treasures from school in the 1980s.</p>\r\n<p>These games from 4Mation Software cannot be played online, or downloaded, as 4Mation still enforce copyright on their titles.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-08 23:49:51', '2019-04-05 09:31:05', 2, NULL, 0, 'N', 'Y', '0'),
(3128, NULL, '', 'Dragon World', '1985', 405, 'R', '<p>People of a certain age may remember Granny''s Garden, Flowers of Crystal, Dragon World, and Box of Treasures from school in the 1980s.</p>\r\n<p>These games from 4Mation Software cannot be played online, or downloaded, as 4Mation still enforce copyright on their titles.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-05 09:39:24', '2019-04-05 09:33:10', 2, NULL, 0, 'N', 'Y', '0'),
(3129, NULL, '', 'Bomber', '1984', 2, 'M', '<p>This listing was published in the February 1984 issue of What Micro? magazine.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-04-19 13:51:21', '2019-04-06 08:55:28', 2, '2019-04-06 08:58:21', 2, 'N', 'Y', '0'),
(3130, NULL, '', 'Deathmaze (AKA Death Maze)', '1983', 1, 'B', '<p>From the book Games BBC Computers Play by Tim Hartnell, S.M. Gee, and Mike James. Published by Interface Publications.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Speed is the essence of this game in which you try to get across the maze</strong><br /><strong>without crossing the lines. The maze is black on white with a shimmering</strong><br /><strong>border, and you are the man figure. You move the man with the arrow keys,</strong><br /><strong>trying to get to the fight hand side in the shortest possible time, without</strong><br /><strong>crossing lines. Note that once you start moving in any direction, you''ll keep</strong><br /><strong>moving that way until you change direction.</strong><br /><strong>The score is decreasing all the time, but it is only updated on the screen when</strong><br /><strong>you go into a black area. If you hit any border except the right hand one the</strong><br /><strong>game will end. At the end of the game, your score for that turn is displayed.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:21:08', '2019-04-06 08:56:08', 2, '2019-12-02 09:33:22', 2, 'N', 'Y', '0'),
(3131, NULL, '', 'Letter Chaser', '1984', 1, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong>The letters of the alphabet appear scattered at random across</strong><br /><strong>the screen. You have to run over them in order. You are a little</strong><br /><strong>ball, and you never stop moving, so a great deal of skill is</strong><br /><strong>required to make sure you don''t hit the letters in the wrong</strong><br /><strong>order.</strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">You control your ball with the following keys:</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Z to move left</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">X to move right</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">: to move up</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">/ to move down</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-23 18:06:02', '2019-04-06 08:56:22', 2, '2019-04-06 08:58:58', 2, 'N', 'Y', '0'),
(3132, NULL, '', 'Tug Of War', '1983', 2, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">Tug-of-War is a two player game consisting of a canyon with a rope</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">stretched across the top, held by a team of three figures on either side. A</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">small UFO flies overhead and each player takes turns in dropping a</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">parachute from it, attempting to land on a target which appears lower</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">down the screen in a random position. Every time a parachutist hits the</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">target, the opposing team is pulled further towards the edge of the canyon</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">and if a man topples over the precipice, the team is weakened. The</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">winner is the player who succeeds in pulling all the opposing team over</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">the edge of the canyon.</span></span></strong></p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-04-23 13:07:52', '2019-04-06 08:56:41', 2, '2019-04-06 08:59:19', 2, 'N', 'Y', '0'),
(3133, NULL, '', 'Computer Battle Games (Robot Missile, The Vital Message, Shootout, Desert Tank Battle, Battle At Traitor''s Castle, Robot Invaders, Secret Weapon, Escape!, Pirate Dogfight, Supersonic Bomber, Iceberg, The Wizard''s Wall, Missile!)', '1982', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:44:46', '2019-04-19 13:25:51', 2, '2019-04-19 15:47:46', 2, 'N', 'Y', '0'),
(3134, NULL, '', 'Computer Space Games (Starship Take-Off, Intergalactic Games, Evil Alien, Beat The Bug Eyes, Moonlander, Monsters Of Galacticon, Alien Snipers, Asteroid Belt, Trip Into The Future, Death Valley, Space Mines, Space Rescue, Touchdown)', '1982', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:45:27', '2019-04-19 13:26:30', 2, '2019-04-19 15:48:09', 2, 'N', 'Y', '0'),
(3135, NULL, '', 'Computer Spy Games (Spy Eyes, Searchlight, Robospy, Spy Q Test, Secret Message Maker, Rendezvous, Morse Coder)', '1984', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:36:35', '2019-04-19 13:27:32', 2, '2019-04-19 13:33:44', 2, 'N', 'Y', '0'),
(3136, NULL, '', 'Creepy Computer Games (Computer Nightmare, The Number Wizard, Ghost Guzzler, Spiderwoman, Gravedigger, Mad House, Ghost Maze, Seance)', '1983', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:39:30', '2019-04-19 13:28:00', 2, '2019-04-19 13:34:08', 2, 'N', 'Y', '0'),
(3137, NULL, '', 'Practical Things To Do With A Microcomputer (Downhill Racer, Space Game)', '1983', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:38:13', '2019-04-19 13:28:36', 2, '2019-04-19 13:34:38', 2, 'N', 'Y', '0'),
(3138, NULL, '', 'Practise Your BASIC (Fruit Machine, Treasure Hunt, Car Crash, Escape From Zorgos)', '1983', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:37:39', '2019-04-19 13:29:08', 2, '2019-04-19 13:34:58', 2, 'N', 'Y', '0'),
(3139, NULL, '', 'Weird Computer Games (Tower Of Terror, Skulls Of The Pyramid, Monster Wrestling, Jaws, Flying Witches, Micro Puzzle)', '1984', 599, 'B', '<p>A book of type-in listings that helped the reader learn programming in BASIC<em>.</em></p>\r\n<p>A free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-19 15:35:09', '2019-04-19 13:29:41', 2, '2019-04-19 13:35:20', 2, 'N', 'Y', '0'),
(3140, NULL, '', 'V-Wing Attack', '1984', 10, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>Guide your ship around the screen, running over the numbers</strong><br /><strong>which appear at random for a short time. If you''re not quick,</strong><br /><strong>the number will disappear. You have a limited time, and you</strong><br /><strong>are constantly trying to beat your previous score.</strong><br /><strong>You control your ship with the following keys:</strong></p>\r\n<p style="padding-left: 60px;"><br /><strong>X to move right</strong><br /><strong>Z to move left</strong><br /><strong>/ to move down</strong><br /><strong>: to move down</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:15:43', '2019-04-25 12:50:55', 2, '2019-04-25 15:05:33', 2, 'N', 'Y', '0'),
(3141, NULL, '', 'Bob''s Bat And Ball (AKA Bobs Bat And Ball)', '1982', 18, 'M', '<p>Published in the October 1982 issue of Practical Computing magazine (volume 5, issue 10).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:21:39', '2019-04-25 12:52:05', 2, '2019-04-25 15:06:01', 2, 'N', 'Y', '0'),
(3142, NULL, '', 'Fruit Machine', '1983', 462, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong>Here&rsquo;s a way of playing the fruit machine without spending a penny</strong><br /><strong>your BBC Micro gives you 100 pence to start with, takes l0 pence for</strong><br /><strong>every go, and awards you a sum between 5 pence and 50 pence every</strong><br /><strong>time you come up with a winning combination. You can give up while</strong><br /><strong>you are winning or carry on playing until you are broke.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:26:41', '2019-04-25 12:54:13', 2, '2019-04-25 15:06:26', 2, 'N', 'Y', '0');
INSERT INTO `games` (`id`, `parent`, `title_article`, `title`, `year`, `genre`, `reltype`, `notes`, `players_min`, `players_max`, `joystick`, `save`, `hardware`, `electron`, `version`, `series`, `series_no`, `lastupdater`, `lastupdated`, `created`, `creator`, `imgupdated`, `imgupdater`, `compat_a`, `compat_b`, `compat_master`) VALUES
(3143, NULL, '', 'Newmarket', '1983', 497, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This is another game with an equestrian flavour, except this time around</strong><br /><strong>you''ll require the skills of a budding Lester Piggot. There are eight horses</strong><br /><strong>in the race, and two things will happen once you have decided which one</strong><br /><strong>you want to ride. Firstly, all the other horses will gallop off at the start,</strong><br /><strong>leaving you floundering at half speed. You soon discover that your mount</strong><br /><strong>is one of those creatures that only pulls its weight when the finishing line</strong><br /><strong>is in sight and then it will go twice as fast as anything else on four legs.</strong><br /><strong>The second problem is that the other horses have a (cleverly computed)</strong><br /><strong>desire to crowd you out of action. They will tend to close up in front of</strong><br /><strong>you and even steer straight at you from the side! There''s no steward to</strong><br /><strong>protect you in this race, so aim for a gap in the field and hope you will be</strong><br /><strong>fast enough to avoid trouble. Any horses colliding with each other are</strong><br /><strong>flung randomly sideways and backwards, thus losing valuable speed. OK,</strong><br /><strong>you''re under starter''s orders...</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:34:15', '2019-04-25 12:54:41', 2, '2019-04-25 15:06:47', 2, 'N', 'Y', '0'),
(3144, NULL, '', 'Voyage', '1983', 10, 'M', '<p>This listing was published in the November 1983 issue of What Micro? magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:37:17', '2019-04-25 12:55:07', 2, '2019-04-25 15:07:15', 2, 'N', 'Y', '0'),
(3145, NULL, '', 'Time-Bomb (AKA Time Bomb)', '1984', 47, 'B', '<p>Published in the book "BBC micro programs in BASIC" from Newnes technical books. The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>The dastardly Sir Simon Ffoul-Enuff has </strong><strong>planted a bomb in the refreshment tent</strong><br /><strong>at your school fete! It is bolted to </strong><strong>the tea urn and so cannot be moved. The</strong><br /><strong>only way for you to save civilisation </strong><strong>as we know it, is to render </strong><strong>the bomb harmless.</strong><br /><strong>There are seven numbers to find. If </strong><strong>your guess is low, the mechanism gives</strong><br /><strong>a low note, while if it is high, then </strong><strong>a high note is emitted.</strong><br /><strong>A beep tells you that you have found </strong><strong>that number &amp; can move on to the next.</strong><br /><strong>You have only a few seconds.</strong><br /><strong>Good luck!</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-08 14:46:05', '2019-04-25 12:55:47', 2, '2019-04-25 15:07:40', 2, 'N', 'Y', '0'),
(3146, NULL, '', 'Nine By Eight (AKA 9 x 8)', '1984', 31, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This game, based on one written by Chris Callender, is</strong><br /><strong>somewhat like Draughts, except that the board measures nine</strong><br /><strong>squares by eight, rather than eight by eight. Captures are made</strong><br /><strong>like pawn captures in Chess. That is, you move diagonally and</strong><br /><strong>land on top of an opponent''s piece in order to capture it.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:52:25', '2019-04-25 12:56:27', 2, '2019-04-25 15:08:04', 2, 'N', 'Y', '0'),
(3147, NULL, '', 'Guideline', '1983', 34, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This is a game of skill in which you have to guide a square along an</strong><br /><strong>irregular wavy wire. When you play this game with a real wire and a</strong><br /><strong>ring, it&rsquo;s a test of how steadily you can guide the ring along the wire.</strong><br /><strong>In this BBC Micro version it&rsquo;s a matter of speed as well as hand and</strong><br /><strong>eye co-ordination.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 15:57:25', '2019-04-25 12:56:55', 2, '2019-04-25 15:08:30', 2, 'N', 'Y', '0'),
(3148, NULL, '', 'Carrot', '1983', 21, 'P', '<p>This game was written by David Griffin in 1983, but first saw the light of day on his <a href="https://www.ee.ucl.ac.uk/~dgriffin/bbc/">website</a></p>\r\n<p>It is based on the traditional game of <a href="https://en.wikipedia.org/wiki/Nim">Nim</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-25 16:05:08', '2019-04-25 12:57:25', 2, '2019-04-25 15:08:57', 2, 'N', 'Y', '0'),
(3149, NULL, '', 'April Fool Island', '1983', 569, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 13 (31st March 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-29 11:37:13', '2019-04-29 09:58:45', 2, '2019-04-29 10:03:57', 2, 'N', 'Y', '0'),
(3150, NULL, '', 'Attack', '1984', 454, 'B', '<p>Published in the book <strong>Take Off With The Electron And BBC Micro</strong> published by Granada Publishing Ltd.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>This is a very fast Arcade game for one player. While waves of</strong><br /><strong>attackers from Outer Space descend upon you, you shoot as many of</strong><br /><strong>them as you can. Try to hit as many as possible before the game ends.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-29 11:33:36', '2019-04-29 09:58:58', 2, '2019-04-29 10:04:15', 2, 'N', 'Y', '0'),
(3151, NULL, '', 'Builder', '1984', 4, 'M', '<p>This listing was published in the June 1984 issue of What Micro? magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-29 11:23:31', '2019-04-29 09:59:13', 2, '2019-04-29 10:04:34', 2, 'N', 'Y', '0'),
(3152, NULL, '', 'Dice Poker', '1986', 34, 'P', '<p>The source of this game is unknown at present.</p>\r\n<p>Do you know anything about it?</p>', 1, 7, '', '', '', '', '', '', '', 2, '2019-11-21 10:39:06', '2019-04-29 09:59:28', 2, '2019-04-29 10:04:53', 2, 'N', 'Y', '0'),
(3153, NULL, '', 'Energy Fields', '1983', 454, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>You are at the edge of Time, closely pursued by a fleet of alien craft who</strong><br /><strong>are out to steal your ship''s power. However you have a trick or two up</strong><br /><strong>your sleeve. You have the capacity to guard the ends of the time tunnel by</strong><br /><strong>setting up energy fields at each of the four open ends of the system. If you</strong><br /><strong>attempt to set up a force field anywhere other than at the ends of the time</strong><br /><strong>tunnel, the force will feed back and destroy you. Likewise if you set up a</strong><br /><strong>field at the end of an unoccupied tunnel you are finished. Passive cruiser</strong><br /><strong>commanders who allow too many aliens through will find their power</strong><br /><strong>drained and the game over.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-29 11:14:27', '2019-04-29 09:59:43', 2, '2019-04-29 10:05:10', 2, 'N', 'Y', '0'),
(3154, NULL, '', 'Jog', '1984', 467, 'M', '<p>This listing was published in the May 1984 issue of What Micro? magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-29 11:09:47', '2019-04-29 09:59:59', 2, '2019-11-25 18:30:06', 2, 'N', 'Y', '0'),
(3155, NULL, '', 'Sheepdog Trial', '1983', 10, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong>If you&rsquo;ve ever watched a shepherd and his dog coax a flock of sheep</strong><br /><strong>into a pen you&rsquo;re bound to agree that its a quite astounding feat. The</strong><br /><strong>experienced shepherd makes it all look so effortless as he shouts and</strong><br /><strong>whistles commands to his dog who obediently stands his ground, or</strong><br /><strong>edges up a few paces, or runs around the back of the flock to head off</strong><br /><strong>a straggler.</strong><br /><strong>This game is an extremely realistic simulation. In fact its so true-tolife</strong><br /><strong>that the only person we know who&rsquo;s scored a &lsquo;Super Shepherd&rsquo;</strong><br /><strong>rating was a real sheep farmer!! Five fluffy white sheep and a black</strong><br /><strong>dog appear in a green field surrounded by a picket fence &minus; it creates</strong><br /><strong>just the right country atmosphere.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-04-29 11:06:09', '2019-04-29 10:00:18', 2, '2019-04-29 10:05:42', 2, 'N', 'Y', '0'),
(3156, NULL, '', 'Solitaire', '1984', 498, 'M', '<p>Published in Electron User Magazine vol.1 issue 10 in July 1984.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2019-04-29 10:59:59', '2019-04-29 10:00:36', 2, '2019-04-29 10:06:05', 2, 'N', 'Y', '0'),
(3157, NULL, '', 'Storm', '1984', 20, 'M', '<p>Published in "Big K." magazine issue 6 in September 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-04 09:52:03', '2019-05-04 09:45:26', 2, '2019-05-04 09:49:48', 2, 'N', 'Y', '0'),
(3158, NULL, '', 'Yahtzee!', '1989', 549, 'M', '<p>Published in Micro User Magazine vol.7 issue 3 in May 1989</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-05-04 09:55:55', '2019-05-04 09:45:40', 2, '2019-11-21 12:38:54', 2, 'N', 'Y', '0'),
(3159, NULL, '', 'Milly The Mink', '1984', 1, 'M', '<p>Published in "Which Micro? &amp; Software Review" magazine, August 1984, issue 25.</p>\r\n<p>**Please note - the listing as printed in the magazine was buggy and would crash, so has been tweaked to stop this from happening.**</p>\r\n<p>For the technically minded, it is amusing that the author knew the game was flawed, and one of the REPEAT...UNTIL loops in the program REPEATS UNTIL ERR=44 which means REPEAT this loop until I crash with an error of "TOO MANY REPEATS"..... This has been altered!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-04 10:08:51', '2019-05-04 09:45:56', 2, '2019-05-06 16:59:08', 2, 'N', 'Y', '0'),
(3160, NULL, '', 'Rubik''s Cube', '19XX', 17, 'W', '<p>Does anyone know where this game is from?</p>\r\n<p>Let us know if you do!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-10 17:17:28', '2019-05-06 17:31:43', 2, '2019-06-10 17:16:49', 2, 'N', 'Y', '0'),
(3161, NULL, 'The', 'Frog', '1982', 4, 'R', '<p>HelixSoft was a one-man operation: James Hager of Camborne, Cornwall.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-06-05 23:20:06', '2019-05-08 11:14:20', 2, '2019-06-05 08:42:55', 2, 'N', 'Y', '0'),
(3162, NULL, '', 'Night-Raid', '1984', 1, 'M', '<p>The game listing was published in the January 1984 issue of Personal Computing Today. Vol.2 No.6.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 10:27:10', '2019-05-10 10:23:27', 2, '2019-05-10 10:33:50', 2, 'N', 'Y', '0'),
(3163, NULL, '', 'Simon (AKA Sensational Simon)', '1984', 565, 'M', '<p>Published in the February 1984 issue of Practical Computing magazine (volume 7, issue 2).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 10:37:36', '2019-05-10 10:36:00', 2, '2019-05-10 10:39:17', 2, 'N', 'Y', '0'),
(3164, NULL, '', 'Barrage', '1984', 546, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>In this fine two-player game you''ll find yourself facing a great</strong><br /><strong>screen display of a barrage in the form of a mountain. You''re</strong><br /><strong>told the wind speed and direction, and the aim of the game is,</strong><br /><strong>of course, to lob shells over the mountain to try and destroy</strong><br /><strong>each other''s tanks.</strong></p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-05-10 16:19:39', '2019-05-10 16:08:44', 2, '2019-05-11 10:45:51', 2, 'N', 'Y', '0'),
(3165, NULL, '', 'Dam Eaters', '1983', 2, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book states the program was originally written by Paul Stanley, and converted for the BBC Micro by Ian Thomas.</p>\r\n<p>The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">The object of this game is to prevent the dam-eating creatures from eating</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">away the dam which is built up on the left-hand side of the screen by</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">dropping shells on them from any of the three cannon at the top. The</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">dam eaters enter randomly from the right of the screen and gradually</span></span></strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 60px;" align="LEFT"><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">chew away the bricks of the dam until finally they break through and you&nbsp;</span></span></strong><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">have lost the game. The game contains a number of other features which&nbsp;</span></span></strong><strong><span style="font-family: Calibri, sans-serif;"><span style="font-size: medium;">you will have to discover by experience.</span></span></strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-11 01:52:16', '2019-05-10 16:09:01', 2, '2019-05-10 16:10:46', 2, 'N', 'Y', '0'),
(3166, NULL, '', 'Foxhole', '1984', 2, 'M', '<p>This listing was published in the August 1984 issue of What Micro? magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 16:29:50', '2019-05-10 16:09:17', 2, '2019-05-10 16:12:24', 2, 'N', 'Y', '0'),
(3167, NULL, '', 'Radar', '1982', 2, 'M', '<p>Published in the September 1982 issue of Personal Computer World magazine (PCW).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-05-10 16:35:56', '2019-05-10 16:09:30', 2, '2019-05-10 16:13:10', 2, 'N', 'Y', '0'),
(3168, NULL, '', 'Xanir Adventure', '19XX', 13, 'W', '<p>This game was probably downloaded from the Computer Telesoftware service sometime in the 1980s.</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-05-13 09:52:17', '2019-05-13 09:38:06', 2, '2019-05-13 09:40:39', 2, 'N', 'Y', '0'),
(3169, NULL, 'The', 'Book Of Listings Part 1 (Racetrack, Turtle Graphics, Numbfinger, Cairo, Little Eliza, Life, Fairground Organ, Space Storm, Outlaw, 3D Super Plot, Codebreaker, Masterword, Bomb Squad, Dome Dweller, Wordsquare, Tyranno, Franglais, Rain Catcher)', '1982', 599, 'B', '<p>All programs are by Tim Hartnell and Jeremy Ruston except the following:</p>\r\n<p>Life is based on LIFE, (C) 1970, John Conway.</p>\r\n<p>Outlaw is based on a program written by Alastair Gourlay.</p>\r\n<p>All games should run on a Model A, except Space Storm And 3D Super Plot, which require a Model B.</p>\r\n<p>Please note that all of the programs on the discs "The Book Of Listings Part 1" and "The Book Of Listings Part 2" are all to be found in the book "The Book Of Listings" published by BBC Soft in 1982.</p>\r\n<p>The follow up was entitled <a href="index.php?rt_B=&amp;search=second+book+of+listings&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=b">The Second Book Of Listings</a></p>\r\n<p><em>Please note: some of the listings have been improved and made more robust in line with the recommendations in the book.</em></p>\r\n<p><em>The original listings, as printed in the book, can be found on Side 2 of the disc, in the "O" directory.</em></p>', 1, 1, '', '', '', '', '', 'Book Of Listings, The', '1', 2, '2019-07-25 19:56:06', '2019-06-07 15:36:16', 2, '2019-06-07 15:50:45', 2, 'Y', 'Y', '0'),
(3170, NULL, 'The', 'Book Of Listings Part 2 (Reversi, Poet, Magic Square, Romland, Gomoku, Safari, Character Definition, String Art, Cat O'' Six Tails, Chess Art, Prison Bars, Eight O'' Clock, Polar Plotting, Cartwheel, Quadrant String Art, Oval, Goodbye', '1982', 599, 'B', '<p>All programs are by Tim Hartnell and Jeremy Ruston, except the following:</p>\r\n<p>Gomoku which is adapted from a program written by Graham Charlton.</p>\r\n<p>All programs should run on a Model A, except the graphics demos: String Art, Chess Art, Polar Plotting version 2, Cartwheel, and Oval, which all require a Model B.</p>\r\n<p>Please note that all of the programs on the discs "The Book Of Listings Part 1" and "The Book Of Listings Part 2" are all to be found in the book "The Book Of Listings" published by BBC Soft in 1982.</p>\r\n<p>The follow up was entitled <a href="index.php?rt_B=&amp;search=second+book+of+listings&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=b">The Second Book Of Listings</a></p>\r\n<p><em>Please note: some of the listings have been improved and made more robust in line with the recommendations in the book.</em></p>\r\n<p><em>The original listings, as printed in the book, can be found on Side 2 of the disc, in the "O" directory.</em></p>', 1, 1, '', '', '', '', '', 'Book Of Listings, The', '1', 2, '2019-07-25 20:04:53', '2019-06-07 15:55:16', 2, '2019-06-07 15:55:54', 2, 'Y', 'Y', '0'),
(3171, NULL, '', 'Asteroid Belt', '1984', 454, 'M', '<p>Published in the June 1984 issue of Practical Computing magazine (volume 7, issue 6).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-24 11:51:26', '2019-06-24 11:50:43', 2, '2019-06-24 11:52:21', 2, 'N', 'Y', '0'),
(3172, NULL, '', 'Mover', '1983', 1, 'R', '<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:06:56', '2019-06-28 09:36:13', 2, '2019-06-28 09:52:44', 2, 'N', 'Y', '0'),
(3173, NULL, '', 'Dominoes', '1986', 499, 'W', '', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:09:19', '2019-06-28 09:36:28', 2, '2019-06-28 09:44:44', 2, 'N', 'Y', '0'),
(3174, NULL, '', 'Snail Trail', '1991', 1, 'P', '<p>This game first saw the light of day on<a href="http://cowlark.com/2015-02-03-bbc-micro/index.html"> David Given''s website.</a></p>', 1, 2, '', '', '', '', '', '', '', 2, '2019-06-28 12:13:01', '2019-06-28 09:36:45', 2, '2019-06-28 09:45:20', 2, 'N', 'Y', '0'),
(3175, NULL, '', 'Mighty Missile', '1983', 454, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT"><strong>Your weapon can destroy anything anything that it actually hits. So the</strong><br /><strong>only problem in this game is to ensure that the missile finds its target,</strong><br /><strong>quickly and accurately. The enemy ships sweep in from the left and</strong><br /><strong>the right firing relentlessly. Your missile is only vulnerable if its</strong><br /><strong>protective shield is eroded away and then it can be easily blasted in its</strong><br /><strong>home base. Otherwise, it is impervious to enemy fire, even outside its</strong><br /><strong>base. If it hits an enemy it will explode on contact but if it fails to find</strong><br /><strong>its target it will disintegrate as it reaches the upper atmosphere. You</strong><br /><strong>can launch ten missiles and there are ten enemy ships. Each ship</strong><br /><strong>maintains a stable orbit until you actually take a shot at it so you can</strong><br /><strong>wait in the base while deciding which side to fire from, and when to</strong><br /><strong>fire &minus; except that with every orbit more of your shield is blasted away</strong><br /><strong>by enemy fire and once there is only 20 per cent of it left you will no</strong><br /><strong>longer have any protection from the enemies&rsquo; lasers. This fast moving</strong><br /><strong>graphics game is enhanced by sound effects and is quite compulsive to</strong><br /><strong>play.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:24:19', '2019-06-28 09:37:13', 2, '2019-06-28 09:46:41', 2, 'N', 'Y', '0'),
(3176, NULL, '', 'Turkey Shoot', '1983', 2, 'R', '<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:26:21', '2019-06-28 09:37:43', 2, '2019-06-28 09:47:05', 2, 'N', 'Y', '0'),
(3177, NULL, '', 'Death Wall', '1985', 16, 'M', '<p>The listing was published in Popular Computing Weekly, volume 4, No. 40 (3rd October 1985).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:29:58', '2019-06-28 09:37:59', 2, '2019-06-28 09:47:28', 2, 'N', 'Y', '0'),
(3178, NULL, '', 'Breakout', '1982', 18, 'M', '<p>Published in the June 1982 issue of Personal Computer World magazine (PCW).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:34:12', '2019-06-28 09:40:14', 2, '2019-06-28 09:47:50', 2, 'N', 'Y', '0'),
(3179, NULL, '', 'Forest Run', '1983', 1, 'R', '<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:36:11', '2019-06-28 09:40:29', 2, '2019-06-28 09:48:12', 2, 'N', 'Y', '0'),
(3180, NULL, '', 'Christmas Eve (AKA Xmas Eve)', '1983', 473, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>Xmas Eve is a race against time for Santa, who must rush to deliver</strong><br /><strong>presents before the inhabitants of the houses awake.</strong><br /><strong>By manoeuvering Santa''s sleigh left and right you can catch the presents</strong><br /><strong>as they are thrown down from above by the elves. Presents can then be</strong><br /><strong>dropped down the chimneys by pressing the M key. Each time a present</strong><br /><strong>is successfully delivered, the inhabitants of the house awake and switch on</strong><br /><strong>the lights, which causes the snow on the roof to melt at a rate</strong><br /><strong>proportional to the activity in the house. The more work Santa does the</strong><br /><strong>more he has to hurry, in order to complete his work without being seen.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 14:04:31', '2019-06-28 09:40:52', 2, '2019-06-28 09:48:35', 2, 'N', 'Y', '0'),
(3181, NULL, '', 'Bertie The Beetle', '1984', 1, 'M', '<p>Published in the May 1984 issue of Practical Computing magazine (volume 7, issue 5).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:50:08', '2019-06-28 09:41:11', 2, '2019-06-28 09:48:51', 2, 'N', 'Y', '0'),
(3182, NULL, '', 'Ye Olde Castle (AKA Castle)', '1984', 2, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 17 (26th April 1984).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 12:53:06', '2019-06-28 09:41:27', 2, '2019-06-28 09:49:11', 2, 'N', 'Y', '0'),
(3183, NULL, '', 'Battleships', '1983', 34, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> cassette states the program was originally written by John Edyvane, and converted for the BBC Micro by James Byrne.</p>\r\n<p>It also contained the following description:</p>\r\n<p style="padding-left: 90px;"><strong>A version of the classic game of Battleships, in which your fleet is<br />engaged in action with that of the computer. The shelling is<br />accompanied by appropriate explode/splash sound effects!<br />&nbsp;&nbsp; After positioning its own fleet, the program asks you to set<br />yours. This is done by specifying grid positions on the screen<br />display. After this, you get to fire three rounds, followed by three<br />for the computer, another three for you, and so on, until one or<br />other''s fleet has been consigned to Davey Jones'' Locker! The<br />display is continually updated to show the current state of events.<br />Co-ordinates must be entered in the form ''letternumber'' with no<br />spaces or commas.<br /></strong></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-08 14:05:48', '2019-06-28 09:41:46', 2, '2019-06-28 09:49:32', 2, 'N', 'Y', '0'),
(3184, NULL, '', 'Dodge Dad', '1983', 1, 'R', '<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 13:08:15', '2019-06-28 09:42:01', 2, '2019-06-28 09:49:53', 2, 'N', 'Y', '0'),
(3185, NULL, '', 'Four Up', '1984', 34, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>In this game, as its name implies, the aim is to get four of your&nbsp;</strong><strong>pieces in a line in any direction before the computer manages&nbsp;</strong><strong>to do this with its pieces.</strong><br /><strong>Once you''ve decided which column you wish to move into,&nbsp;</strong><strong>the piece drops to the lowest available position in that column.</strong><br /><strong>The computer plays this game fairly well, and surprisingly&nbsp;</strong><strong>quickly, when you see how many loops it has to go through.</strong><br /><strong>In this version of Four Up, the BBC Micro always allows&nbsp;</strong><strong>the human to have the first move, and bases its initial move on&nbsp;</strong><strong>the move made by the human.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 23:55:01', '2019-06-28 09:42:17', 2, '2019-06-28 09:50:17', 2, 'N', 'Y', '0'),
(3186, NULL, '', 'Demolition', '1984', 27, 'M', '<p>Published in the October 1984 issue of Practical Computing magazine (volume 7, issue 10).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 13:15:23', '2019-06-28 09:42:34', 2, '2019-06-28 09:50:41', 2, 'N', 'Y', '0'),
(3187, NULL, '', 'Blind-Man''s Buff', '1983', 1, 'R', '<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-28 13:17:00', '2019-06-28 09:42:52', 2, '2019-06-28 09:51:03', 2, 'N', 'Y', '0'),
(3188, NULL, '', 'December 24th', '1984', 473, 'M', '<p>This listing was published in the January 1984 issue of What Micro? magazine.</p>\r\n<p>**The author''s name is spelled "Kilmore" in this game, but a subsequent game, "Space Dodgems" spelled it "Kilmoore".**</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-06-30 16:22:31', '2019-06-30 15:12:24', 2, '2019-07-05 10:32:16', 2, 'N', 'Y', '0'),
(3189, NULL, '', 'Pontoon', '1982', 38, 'M', '<p>Published in issue 2 of Laserbug user group magazine in May 1982.</p>', 1, 5, '', '', '', '', '', '', '', 2, '2019-06-30 16:17:25', '2019-06-30 15:12:41', 2, '2019-06-30 15:14:34', 2, 'N', 'Y', '0'),
(3190, NULL, '', 'Lifter', '1984', 4, 'M', '<p>Published in Games Computing magazine, issue 3, March 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 10:57:54', '2019-07-05 10:45:09', 2, '2019-07-05 10:48:10', 2, 'N', 'Y', '0'),
(3191, NULL, '', 'Sky-Diver', '1985', 569, 'M', '<p>Published in the January 1985 issue of Practical Computing magazine (volume 8, issue 1).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 11:01:35', '2019-07-05 10:45:23', 2, '2019-07-05 10:48:50', 2, 'N', 'Y', '0'),
(3192, NULL, '', 'Space Dodgems', '1984', 20, 'M', '<p>This listing was published in the March 1984 issue of What Micro? magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 11:06:42', '2019-07-05 10:45:43', 2, '2019-07-05 10:49:38', 2, 'N', 'Y', '0'),
(3193, NULL, '', 'Play Your Cards Right', '1984', 38, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>You and the clever computer have a row of cards in this game,</strong><br /><strong>where the aim is to reach the end of the row by guessing if the</strong><br /><strong>next card to be turned over will be higher or lower than the</strong><br /><strong>previous one.</strong><br /><strong>Your turn lasts as long as you guess correctly. If you make a</strong><br /><strong>mistake and guess wrongly, you lose all the cards which come</strong><br /><strong>after your ''freeze marker''. You can end your turn early and</strong><br /><strong>move your marker to the current card by pressing ''F'' for freeze.</strong><br /><strong>You start the play by using your option of changing the</strong><br /><strong>current card (using ''Y'' for yes or ''N'' for no) if you think the</strong><br /><strong>card is not a good one to proceed with.</strong><br /><strong>You''ll find the BBC Micro plays very well in this highly</strong><br /><strong>effective program, based on one written by Paul Toland,</strong><br /><strong>although it tends to err a little on the safe side. The cards are</strong><br /><strong>drawn randomly from a proper pack. You''ll be most impressed</strong><br /><strong>with the appearance of the cards.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 11:14:25', '2019-07-05 10:45:59', 2, '2019-07-05 10:50:13', 2, 'N', 'Y', '0'),
(3194, NULL, '', 'Missile Command', '1984', 454, 'M', '<p>Published in the July 1984 issue of Practical Computing magazine (volume 7, issue 7).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 11:18:10', '2019-07-05 10:46:14', 2, '2019-07-05 10:50:55', 2, 'N', 'Y', '0'),
(3195, NULL, '', 'Commando Jump', '1983', 569, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT"><strong>This game is a real test of your reaction time and dexterity, and is quite</strong><br /><strong>compulsive to play. A bright red wall of varying height appears with a</strong><br /><strong>little man figure beside it. A countdown &ldquo;Ready, Steady, GO&rdquo; is</strong><br /><strong>flashed up on the left of the screen and on the word &ldquo;GO&rdquo; the man has</strong><br /><strong>to jump as high as possible and then scrabble up the remainder of the</strong><br /><strong>wall. Your success in this game depends entirely on your quick wits</strong><br /><strong>and nimble fingers.</strong><br /><strong>How to play:</strong><br /><strong>On the word &ldquo;GO&rdquo;, and no sooner, press any key to make the man</strong><br /><strong>jump. The height of the initial jump depends entirely on the delay</strong><br /><strong>between the signal appearing and your key press. The quicker you</strong><br /><strong>react, the higher the man will jump. The time left to scale the wall is</strong><br /><strong>displayed on the screen and while the rest of your five seconds tick</strong><br /><strong>away you must keep on pressing any key to get the man over the wall.</strong><br /><strong>The man will climb one brick higher for every ten key presses so the</strong><br /><strong>more rapidly you press, the more quickly he will climb. If you keep</strong><br /><strong>your finger on a key the man will stay where he is this is because only</strong><br /><strong>complete key presses, i.e. press and release, count. If the man is not</strong><br /><strong>over within the time limit he will slither back down the wall and you</strong><br /><strong>have another try. In all you are given ten attempts. Even if you are</strong><br /><strong>very slow off the mark, do press a key &minus; until you do so you cannot</strong><br /><strong>move on to the next try. If you hit a key just before the &ldquo;GO&rdquo; signal,</strong><br /><strong>the computer will accuse you of cheating and you will lose that turn.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 23:47:27', '2019-07-05 10:46:28', 2, '2019-07-05 10:51:38', 2, 'N', 'Y', '0'),
(3196, NULL, '', 'Break Out', '1984', 18, 'M', '<p>Published in Games Computing magazine, issue 3, March 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-05 11:25:59', '2019-07-05 10:46:42', 2, '2019-07-05 10:52:23', 2, 'N', 'Y', '0'),
(3197, NULL, '', 'Cowboy', '1984', 2, 'M', '<p>Published in the June 1984 issue of Practical Computing magazine (volume 7, issue 6).</p>\r\n<p>This game may not be playable without a joystick. JSBeeb (the JavaScript BBC Micro emulator) does not currently emulate a joystick so it might not be possible to play this game online. Try using a desktop emulator or a real BBC Micro.</p>', 2, 2, 'R', '', '', '', '', '', '', 3, '2019-08-12 10:38:17', '2019-07-05 10:46:56', 2, '2019-08-08 17:30:53', 2, 'N', 'Y', '0'),
(3198, NULL, '', 'Solitaire', '1986', 498, 'M', '<p>Published on the Electron Computing issue 7 cassette in 1986.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2019-07-05 11:33:18', '2019-07-05 10:47:14', 2, '2019-07-05 10:54:23', 2, 'N', 'Y', '0'),
(3199, NULL, '', 'To Hell In A Hamper', '2006', 13, 'W', '<p>Press the Shift key to scroll the text whenever it pauses on screen. If you get stuck, try typing HINT.</p>\r\n<p>To Hell In A Hamper was originally written in 2003 by <a href="https://ifdb.tads.org/search?searchfor=author%3AJ.+J.+Guest">J.J. Guest</a> using the ADRIFT development system. The game was&nbsp;<a href="http://forum.adrift.co/viewtopic.php?f=4&amp;t=3206">ported</a>&nbsp;to BBC BASIC by&nbsp;<a href="index.php?search=Dave+Edwards">Dave Edwards</a>&nbsp;in 2006. (The version of the port on this webpage was created in 2019 and includes some minor bugfixes.)</p>\r\n<p>More info at <a href="https://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=17461#p241962">Stardot</a>, at <a href="http://www.solutionarchive.com/game/id%2C2180/To+Hell+in+a+Hamper.html">CASA</a>, and at <a href="https://ifdb.tads.org/viewgame?id=6d9dfn2akcrlq1bu">IFDB</a>.&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-12-30 19:06:54', '2019-07-06 16:19:37', 3, '2019-07-22 00:02:08', 3, 'N', 'Y', '0'),
(3200, NULL, '', 'Whitehall', '1982', 21, 'M', '<p>Published in the May 1982 issue of Practical Computing magazine (volume 5, issue 5).</p>\r\n<p>The original listing was in Apple Integer BASIC. It was ported to the BBC Micro in 2019. See <a href="https://stardot.org.uk/forums/viewtopic.php?f=2&amp;t=17065&amp;p=236166&amp;hilit=whitehall#p236084">here.</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-07 18:24:48', '2019-07-07 18:22:47', 2, '2019-07-07 18:27:27', 2, 'N', 'Y', '0'),
(3201, NULL, '', 'Across The Ravine', '1983', 569, 'B', '<p>Published in the book 21 Games For The BBC Micro by Mike James, S. M. Gee and Kay Ewbank, published by Granada Publishing Ltd.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following description:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT"><strong>Have you got the skill and judgement needed to lead an expedition</strong><br /><strong>through dangerous terrain? This colour graphics game provides an</strong><br /><strong>easy way to discover your potential. The object of the game is to get</strong><br /><strong>your party of five intrepid explorers across a deep ravine with a fast</strong><br /><strong>flowing river at the bottom of steep cliffs. There is only one option, to</strong><br /><strong>swing across on a rope. The rope swings all the time so each man must</strong><br /><strong>run and leap to catch it &minus; any one who mistimes his jump falls into the</strong><br /><strong>river and is lost. Listen out for the sound effects as a man falls towards</strong><br /><strong>the river!</strong><br /><strong>How to play:</strong><br /><strong>This game is all a matter of timing &minus; you have to judge when to start</strong><br /><strong>each run for the rope. It is vital to catch the rope on the downswing</strong><br /><strong>and each man can jump approximately his own width. You can wait as</strong><br /><strong>long as you like before making any run and when you are ready press</strong><br /><strong>any key to jump. When your first little man has made his run and</strong><br /><strong>either swung to safety, or perished, the second explorer will appear in</strong><br /><strong>position. There are five of them in all and the length of the rope</strong><br /><strong>remains the same for all of them. In each new game the rope changes</strong><br /><strong>at random.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-07 19:02:27', '2019-07-07 18:31:30', 2, '2019-07-07 18:36:07', 2, 'N', 'Y', '0'),
(3202, NULL, '', 'Downfall', '2019', 17, 'P', '<p>Written for the&nbsp;<a href="https://gkanold.wixsite.com/homeputerium/kopie-von-basic-10liners-2019">2019 BASIC 10-liner contest</a>.</p>\r\n<p><a href="https://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=17223&amp;p=238591&amp;hilit=downfall#p238591">More details</a>&nbsp;at Stardot.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-13 11:21:24', '2019-07-07 18:31:43', 2, '2020-01-08 13:54:01', 2, 'N', 'Y', '0'),
(3203, NULL, '', 'Fruit Machine', '1983', 462, 'M', '<p>Published in the May 1983 issue of Practical Computing magazine (volume 6, issue 5).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-07 18:45:55', '2019-07-07 18:31:56', 2, '2019-07-07 18:37:38', 2, 'N', 'Y', '0'),
(3204, NULL, '', 'Halma', '1988', 31, 'M', '<p>Published in Micro User magazine, volume 6, issue 5, in July 1988</p>', 2, 4, '', '', '', '', '', '', '', 3, '2020-01-08 20:47:00', '2019-07-07 18:32:10', 2, '2020-01-08 13:54:20', 2, 'N', 'Y', '0'),
(3205, NULL, '', '3D OXO', '1984', 34, 'M', '<p>Published in the January 1984 issue of Practical Computing magazine (volume 7, issue 1).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-12 17:13:30', '2019-07-12 16:46:09', 2, '2020-01-16 15:21:18', 2, 'N', 'Y', '0'),
(3206, NULL, '', 'Commodities', '1985', 496, 'M', '<p>The listing for this game was published in the January 1985 issue of Computing Today magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-12 17:10:23', '2019-07-12 16:46:25', 2, '2019-07-12 16:51:42', 2, 'N', 'Y', '0'),
(3207, NULL, '', 'Mastercode', '1984', 17, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>This clever computer implementation of the ever-popular</strong><br /><strong>''coloured pegs in holes, deduce the code'' game is now ready to</strong><br /><strong>challenge your wits. Full instructions are within the program.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-12 17:06:30', '2019-07-12 16:46:41', 2, '2019-07-12 16:52:00', 2, 'N', 'Y', '0'),
(3208, NULL, '', 'Pentoms-Puzzle', '1984', 17, 'U', '<p>According to the author, this game was about to go on sale via Woolworths, but just before release, the software division pulled out so it was never released.</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-12 17:00:12', '2019-07-12 16:47:01', 2, '2019-07-12 16:52:16', 2, 'N', 'Y', '0'),
(3209, NULL, '', 'Sea-Dog (AKA Sea Dog)', '1984', 2, 'M', '<p>Published in Games Computing magazine, issue 4, April 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-12 16:56:40', '2019-07-12 16:47:14', 2, '2019-07-12 16:52:33', 2, 'N', 'Y', '0'),
(3210, NULL, 'The', 'Second Book Of Listings (Ricochet Golf, Meteors, Rollers, Slalom, Rebel, Balrog, Graves, March, Mine, Solitaire, Towers, Rotate, Quiz, Backgammon, Awari, Queens, Edit, Coffee Adventure)', '1984', 599, 'B', '<p>The book is subtitled "More great Model B programs".&nbsp;All programs are by Martin Bryant.&nbsp;</p>\r\n<p>This is a follow-up to the 1982 <a href="index.php?rt_B=&amp;search=book+of+listings+part&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=b">Book Of Listings</a> also by BBC Publications.</p>', 1, 9, '', '', '', '', '', 'Book Of Listings, The', '2', 3, '2019-07-26 13:44:21', '2019-07-25 09:35:08', 2, '2019-07-25 19:51:14', 2, 'N', 'Y', '0'),
(3211, NULL, '', 'Know Your Own Personality', '1984', 568, 'R', '', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-07-26 12:04:36', '2019-07-26 12:01:55', 2, '2019-07-26 12:04:13', 2, 'N', 'Y', '0'),
(3212, NULL, '', 'Booty', '1984', 1, 'M', '<p>Published in Games Computing magazine, issue 9, September 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-27 13:49:29', '2019-07-27 13:38:45', 2, '2019-07-27 13:44:27', 2, 'N', 'Y', '0'),
(3213, NULL, '', 'Fighter', '1982', 454, 'M', '<p>Published in the August 1982 issue of Practical Computing magazine (volume 5, issue 8).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-27 13:53:32', '2019-07-27 13:39:07', 2, '2019-08-05 10:27:32', 2, 'N', 'Y', '0'),
(3214, NULL, '', 'Simonn (AKA Simon Says)', '1983', 565, 'M', '<p>Published in issue 4 of Home Computing Weekly in March 1983.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-27 13:57:38', '2019-07-27 13:39:27', 2, '2019-08-05 11:20:18', 2, 'N', 'Y', '0'),
(3215, NULL, '', 'Space Pirates', '2019', 45, 'P', '<p>An entry in a private competition to write a 2K game. More details <a href="https://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=17207#p238407">at Stardot</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-07-29 09:55:48', '2019-07-27 13:39:45', 2, '2019-07-27 13:46:03', 2, 'N', 'Y', '0'),
(3216, NULL, '', 'Shuttle', '1984', 45, 'M', '<p>Published In the February 1984 issue of Computer &amp; Video Games. Issue 28 in the ''Book of games'' supplement.</p>\r\n<p>This game may not be playable without a joystick. JSBeeb (the JavaScript BBC Micro emulator) does not currently emulate a joystick so it might not be possible to play this game online. Try using a desktop emulator or a real BBC Micro.</p>', 1, 1, 'R', '', '', '', '', '', '', 2, '2019-10-28 19:08:56', '2019-07-27 13:40:01', 2, '2019-08-08 17:30:07', 2, 'N', 'Y', '0'),
(3217, NULL, '', 'Euler''s Tour (AKA Euler''s Touring Knight)', '1984', 17, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=pcw+games+collection&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">PCW Games Collection</a> from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>PCW Games Collection</em> contained the following description:</p>\r\n<p style="padding-left: 90px;"><strong>For those of you who dislike the fast action games, here is a</strong><br /><strong>computerized version of an old chess problem. The idea is to</strong><br /><strong>visit every square on the board, once only, with a knight.</strong><br /><strong>Although there is an option to allow the computer to demonstrate</strong><br /><strong>the pattern of moves, you should find this problem much harder</strong><br /><strong>than it appears at first sight.</strong><br /><strong>When you run the program you will be presented with the</strong><br /><strong>chessboard and the option of either playing or watching the</strong><br /><strong>computer demonstration. Whichever option is chosen, you must</strong><br /><strong>then specify the starting position for the tour round the board.</strong><br /><strong>When viewing the demonstration, all you have to do is to press</strong><br /><strong>the space bar for each move. When attempting the tour yourself</strong><br /><strong>you must enter the co-ordinates of each successive move. In both</strong><br /><strong>cases the knight is represented by a K and squares are coloured</strong><br /><strong>red if they have already been visited.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-07-27 14:24:53', '2019-07-27 13:40:16', 2, '2019-07-27 13:46:43', 2, 'N', 'Y', '0');
