(3219, NULL, '', 'Answer Back Senior Quiz (General Knowledge)', '1984', 29, 'R', '<p>Filenames for the quizzes are GS1, GS2, ..., GS20.</p>\r\n<p>Kosmos Software released expansion packs known as "Factfile 500" which featured 500 extra questions on such subjects as <strong>English Words, First Aid, Know England, Know Scotland, Super Sports, General Science, Natural History, Spelling, World Geography, Arithmetic.</strong></p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-08-15 09:03:49', '2019-08-05 11:12:11', 2, '2019-08-13 17:58:30', 2, 'N', 'Y', '0'),
(3220, NULL, '', 'Answer Back Junior Quiz (General Knowledge)', '1984', 29, 'R', '<p>Filenames for the quizzes are GJ1, GJ2, ..., GJ20.</p>\r\n<p>Kosmos Software released expansion packs known as "Factfile 500" which featured 500 extra questions on such subjects as <strong>English Words, First Aid, Know England, Know Scotland, Super Sports, General Science, Natural History, Spelling, World Geography, Arithmetic.</strong></p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-08-15 09:04:20', '2019-08-05 11:16:44', 2, '2019-08-06 08:49:36', 2, 'N', 'Y', '0'),
(3221, NULL, '', 'Answer Back Sport Quiz', '1984', 29, 'R', '<p>Filenames for the quizzes are Q1, Q2, ..., Q26.</p>\r\n<p>Kosmos Software released expansion packs known as "Factfile 500" which featured 500 extra questions on such subjects as <strong>English Words, First Aid, Know England, Know Scotland, Super Sports, General Science, Natural History, Spelling, World Geography, Arithmetic.</strong></p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-08-15 09:05:32', '2019-08-06 08:52:00', 2, '2019-08-31 10:53:40', 2, 'N', 'Y', '0'),
(3222, 741, '', 'By Fair Means Or Foul [128K] (Enhanced 128K Version)', '1988', 500, 'R', '<p>See&nbsp;<a href="gameimg/screenshots/741/Play-It-Again-Sam-12-001.jpg">the instructions</a>&nbsp;for keyboard controls, etc.</p>\r\n<p>This version can play either as the standard game or as an enhanced game on a 128K BBC Master.</p>\r\n<p>The original cassette release contained both the standard and the enhanced versions of the game.</p>', 1, 2, 'O', '', '', '', '', '', '', 3, '2019-08-08 15:58:59', '2019-08-06 15:31:48', 2, '2019-08-06 15:39:13', 2, 'N', 'N', 'Y'),
(3223, 973, '', '3D Terror Chase (AKA Haunted House) (AKA Halloween) (AKA Ghost House)', '1983', 1, 'B', '<p>You will probably be killed as soon as the game boots, but if you then press Escape you will be able to start a new, more forgiving, game!</p>\r\n<p>Published in the book Games For Your BBC Micro by Virgin Books in 1983.</p>\r\n<p>An almost identical listing had been published in Popular Computing Weekly, volume 1, No. 28 (28th October 1982), under the title <a href="game.php?id=973">Haunted House</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-11-11 17:35:34', '2019-08-09 21:14:29', 2, '2019-08-09 21:27:39', 2, 'N', 'Y', '0'),
(3224, 1607, '', 'Air Raid (AKA Bomber Strike)', '1985', 2, 'M', '<p>Published in the February 1985 issue of Practical Computing magazine (volume 8, issue 2).</p>\r\n<p>A very similar listing had been published in Electron User magazine (volume 1, issue 1) in October 1983. (This magazine was a pullout within Micro User, volume 1, issue 8, in October 1983.)</p>\r\n<p>The Practical Computing article credited Andrew Graham as the author.</p>\r\n<p>Whether Andrew Graham is the author of Bomber Strike from 1983 is debatable!</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-12 10:35:26', '2019-08-09 21:15:38', 2, '2019-08-09 21:27:54', 2, 'N', 'Y', '0'),
(3225, NULL, '', 'Caterpillar (AKA Millipede)', '1983', 1, 'M', '<p>Published in the March 1983 issue of Practical Computing magazine (volume 6, issue 3).</p>\r\n<p>This is an early version of <a href="game.php?id=787">Millipede</a> which was published in Your Computer magazine (volume 3, issue 5) in May 1983.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-12 10:34:08', '2019-08-09 21:16:30', 2, '2019-08-09 21:28:14', 2, 'N', 'Y', '0'),
(3226, 3219, '', 'Factfile 500 English Words', '1985', 29, 'R', '<p>To load this set of questions, choose "L"oad from the menu, then select drive 1 and then type the filename of the question set you wish to load.</p>\r\n<p>Then type "B"egin quiz.</p>\r\n<p>Filenames for the English word quizzes are EW1, EW2, ..., EW20.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-14 08:53:37', '2019-08-09 21:21:58', 2, '2019-08-14 08:29:02', 2, 'N', 'Y', 'Y'),
(3227, 729, 'The', 'Hunt: Search For Shauna (Disc Version)', '1987', 13, 'R', '', 1, 1, '', 'D', '', '', 'Disc Version', '', '', 2, '2019-08-09 21:56:59', '2019-08-09 21:22:20', 2, '2019-08-09 21:28:50', 2, 'N', 'Y', '0'),
(3228, NULL, '', 'Monsters (AKA Cellars)', '1984', 4, 'M', '<p>Published in the January 1984 issue of Practical Computing magazine (volume 7, issue 1).</p>\r\n<p>A very similar listing was later published in the March/April 1984 issue of A&amp;B Computing, under the title "Cellars".</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-09 21:51:02', '2019-08-09 21:22:42', 2, '2019-08-09 21:29:08', 2, 'N', 'Y', '0'),
(3229, NULL, '', 'Painter (AKA Airbrush)', '1983', 1, 'M', '<p>Published in Which Micro? &amp; Software Review magazine, May 1983, issue 10.</p>\r\n<p>The game was later released commercially as Airbrush by Soft Hits, and Iain Dawson as well as Shingo Sugiura was credited as author.</p>\r\n<p>The only differences between the type-in listing and the commercial release are some slight alterations to the wording in the intro and the addition of a high score table.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-08-12 10:32:42', '2019-08-09 21:23:04', 2, '2019-08-09 21:29:26', 2, 'Y', 'Y', '0'),
(3230, 659, '', 'Pitfall Pete (10 Extra Screens)', '1991', 1, 'M', '<p>This updated version of the game, complete with the ten extra screens, was published on the Beebug magazine disc, volume 10, issue 7, in December 1991.</p>\r\n<p>The original game was published in Beebug magazine, volume 5, issue 7, in December 1986.</p>', 1, 1, '', 'D', '', '', '', '', '', 3, '2019-08-12 10:30:07', '2019-08-09 21:23:24', 2, '2019-12-05 18:16:14', 2, 'N', 'Y', '0'),
