(3241, 3219, '', 'Factfile 500 Quiz Loader (Based On Answer Back Senior Quiz (General Knowledge))', '1984', 29, 'L', '<p>This version of the quiz has been slightly modified to make it easier to load the Factfile 500 expansion packs.</p>\r\n<p>It allows the files to be loaded from Drive 1, rather than having to swap discs or write the files to the reverse of the original disc.</p>\r\n<p>Why Kosmos did it that way in the first place is a mystery!</p>\r\n<p>All the available Factfile 500 quiz questions can be found <a href="index.php?rt_R=&amp;search=Factfile&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">here</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-14 22:03:12', '2019-08-14 08:06:57', 2, '2019-08-15 08:49:50', 2, 'N', 'Y', '0'),
(3242, NULL, '', 'Martian Nim', '1988', 21, 'M', '<p>Published on the April 1988 issue of Disk User. Issue 06.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-19 11:27:27', '2019-08-19 11:14:48', 2, '2019-08-19 12:10:40', 2, 'N', 'Y', '0'),
(3243, NULL, '', 'Penalty Decider', '1984', 10, 'M', '<p>Published in Games Computing magazine, issue 4, April 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-19 11:29:52', '2019-08-19 11:15:06', 2, '2019-08-19 12:11:04', 2, 'N', 'Y', '0'),
(3244, NULL, '', 'Space Invaders Type Game', '1983', 454, 'M', '<p>Published in the February 1983 issue of Practical Computing magazine (volume 6, issue 2).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-19 11:34:11', '2019-08-19 11:15:26', 2, '2019-08-19 12:11:23', 2, 'N', 'Y', '0'),
(3245, NULL, '', 'Snakes And Ladders', '1984', 527, 'B', '<p>Published in the book The Electron Gamesmaster from Granada Technical Books (Granada Publishing Ltd).</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>In this chapter a traditional and well known game, Snakes and Ladders,</strong><br /><strong>is given new life in a computer implementation. Traditional games are</strong><br /><strong>an obvious source for anyone looking for new ideas for computer</strong><br /><strong>games. Not only can they be implemented according to their original</strong><br /><strong>rules, they often provide the starting point for games that could only be</strong><br /><strong>played with the aid of a computer. As an example of this idea, at the</strong><br /><strong>end of this chapter Snakes and Ladders is modified into a fast action</strong><br /><strong>computer game that could never have been played using a board and</strong><br /><strong>dice!</strong></p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2019-08-19 11:44:59', '2019-08-19 11:15:45', 2, '2019-08-19 12:11:43', 2, 'N', 'Y', '0'),
(3246, NULL, '', 'Nuclear Fallout', '1984', 564, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>The scenario for this game, written by Tim Rogers, is not</strong><br /><strong>particularly pleasant. Your city is the target for a number of</strong><br /><strong>nuclear bombs, and your job is to protect as many people as</strong><br /><strong>you can from the nuclear blast. If you have strong objections to</strong><br /><strong>the basic idea behind this game, you could still use the new</strong><br /><strong>framework to produce a game of your choice, protecting a toy</strong><br /><strong>factory from an invasion of wicked gnome-missiles or whatever</strong><br /><strong>you like.</strong><br /><strong>The game fits into the general ''Kingdoms'' category, that</strong><br /><strong>class of computer games which attempts to model reality in</strong><br /><strong>some way. These programs expect you to make decisions about</strong><br /><strong>the expenditure of limited resources in order to acquire items</strong><br /><strong>which are needed for the continued existence of your city,</strong><br /><strong>country of planet.</strong><br /><strong>In this case, your resource is money, and you need to buy</strong><br /><strong>as much shelter as you can, in order to save the maximum</strong><br /><strong>number of people. This analysis of the game suggests that any</strong><br /><strong>scenario requiring you to buy a single resource to achieve a</strong><br /><strong>specific aim could be slotted into the framework of this</strong><br /><strong>program. Essentially, all you would need to change would be</strong><br /><strong>the print statements.</strong><br /><strong>The idea, then, is to protect as many people as you can</strong><br /><strong>from a nuclear blast. You start off with an amount of money</strong><br /><strong>which steadily increases as the game progresses. You must</strong><br /><strong>decide whether to buy shelter and use up most of your money,</strong><br /><strong>or to save it in order to buy the largest possible area of shelter</strong><br /><strong>later on. The only problem with this latter idea is that a nuclear</strong><br /><strong>attack could be launched when you have no shelter at all. And</strong><br /><strong>if you have no shelter, there will be no survivors.</strong><br /><strong>In most Kingdom-type games, the ruler is assassinated,</strong><br /><strong>impeached, lynched or otherwise disposed of, if a certain</strong><br /><strong>proportion of the people in his or her care die, whether the</strong><br /><strong>deaths occur from famine, plagues of rats, attacks by muscle-</strong><br /><strong>bound Norsemen in long boats, or - as in this case - from a</strong><br /><strong>nuclear blast. If more than half your city is wiped out, the</strong><br /><strong>hitherto complacent masses (or, at least, those who have</strong><br /><strong>survived) will rise up in one coordinated movement and wipe</strong><br /><strong>you and your family out.</strong><br /><strong>You must balance your delay in spending money for shelter</strong><br /><strong>against the fact that, in this game, the longer you delay, the</strong><br /><strong>more likely a nuclear attack becomes. This chance increases</strong><br /><strong>and, at the end of the game, it is close to one in one.</strong><br /><strong>Full instructions are included within the game.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-31 17:01:47', '2019-08-19 11:16:03', 2, '2019-08-19 12:12:04', 2, 'N', 'Y', '0'),
(3247, NULL, '', 'Singing Heads', '1984', 565, 'M', '<p>Published in the December 1984 issue of Practical Computing magazine (volume 7, issue 12).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-19 12:02:39', '2019-08-19 11:16:19', 2, '2019-08-19 12:12:27', 2, 'N', 'Y', '0'),
(3248, NULL, '', 'Mastermind', '1984', 17, 'P', '<p>Published on the GLM Public Domain disc 02.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-20 08:59:39', '2019-08-19 11:16:35', 2, '2019-09-09 11:08:58', 2, 'N', 'Y', '0'),
(3249, NULL, '', 'Draughts', '1984', 503, 'M', '<p>The game listing was published in the October 1984 issue of Computing Today magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-19 12:07:13', '2019-08-19 11:16:54', 2, '2019-08-19 12:13:14', 2, 'N', 'Y', '0'),
(3250, NULL, '', 'Supreme', '1985', 453, 'P', '<p>A clone of the famous <a href="game.php?id=366">Elite</a> which was published on the following public domain discs:</p>\r\n<p>BBC PD disc 88</p>\r\n<p>GLM PD disc 02</p>\r\n<p>The slightly modified Acorn Electron version can be found on EUG PD disc 70.</p>', 1, 1, '', 'T', '', '', '', '', '', 2, '2019-08-24 10:03:15', '2019-08-19 11:17:10', 2, '2019-08-24 10:04:01', 2, 'N', 'Y', '0'),
(3251, 1488, '', 'Noughts And Crosses', '1982', 534, 'L', '<p>This appears to be a hack of "Noughts And Crosses" by Terry Allen. See <a href="game.php?id=1488">here</a></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-19 12:48:11', '2019-08-19 12:18:03', 2, '2019-08-19 12:19:11', 2, 'Y', 'Y', '0'),
(3252, NULL, '', 'Speed Trial', '1982', 457, 'M', '<p>This game was published as a type-in listing in issue 2 of OWL magazine.&nbsp;OWL magazine was a supplementary pull-out in Computer &amp; Video Games magazine.</p>\r\n<p>As far as can be seen there were only two issues printed.&nbsp;Issue 1 of OWL came with the June 1982 (issue 8) of C&amp;VG while issue 2 of OWL came with the September 1982 issue of C&amp;VG (issue 11).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-02 21:01:36', '2019-08-24 09:47:13', 2, '2019-08-24 10:05:43', 2, 'Y', 'Y', '0'),
