(3258, NULL, '', 'Time Traveller (AKA Time Traveler)', '1983', 405, 'R', '<p>Eductaional history game featuring mini-games to break up the quiz.</p>', 1, 1, 'O', '', '', '', '', '', '', 2, '2019-09-07 09:30:06', '2019-08-31 10:56:38', 2, '2019-09-26 20:09:13', 2, 'N', 'Y', 'Y'),
(3259, NULL, '', 'Simon', '1982', 565, 'M', '<p>The listing was published in Popular Computing Weekly, volume 1, No. 17 (12th August 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-31 12:13:56', '2019-08-31 10:58:03', 2, '2019-08-31 11:15:53', 2, 'Y', 'Y', '0'),
(3260, NULL, '', 'Stock Market', '1983', 21, 'B', '<p>Originally authored by Bob Chappell for the Commodore PET, and converted for the BBC Micro by Brian Jones.</p>\r\n<p>The original Commodore PET listing was published in Personal Computer World May 1982. (**To fact-check**)</p>\r\n<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW Software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The PCW book accompanying the <em>Best of PCW Software For The BBC Micro</em> contained the following description:</p>\r\n<p style="padding-left: 90px;"><strong>This simulation gives you a chance to make money with your</strong><br /><strong>micro, but unfortunately you lose it all when you switch the power</strong><br /><strong>off!</strong><br /><strong>&nbsp;&nbsp; You are dealing in four commodities: GOLD, TIN, ZINC and</strong><br /><strong>LEAD. If you buy and sell at the right time, you can make your</strong><br /><strong>fortune, but watch out for takeovers or you could lose your shirt.</strong><br /><strong>On each turn your portfolio, profit and loss account, and the</strong><br /><strong>market trends are displayed in colour in MODE 7, and you can</strong><br /><strong>choose to buy or sell shares. After a few games you may feel ready</strong><br /><strong>for the real thing!</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-31 13:57:06', '2019-08-31 10:58:19', 2, '2019-08-31 11:16:41', 2, 'N', 'Y', '0'),
(3261, NULL, '', 'Tail Blasers', '1983', 1, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 2, No. 4 (27th January 1983).</p>\r\n<p>This game may not be playable without a joystick. Jsbeeb does not currently emulate a joystick so it might not be possible to play this game on the website. Try using an emulator or a real BBC.</p>', 2, 2, 'R', '', '', '', '', '', '', 2, '2019-08-31 14:06:41', '2019-08-31 10:58:47', 2, '2019-08-31 14:07:31', 2, 'N', 'Y', '0'),
(3262, NULL, '', 'Target Practice', '1982', 546, 'M', '<p>The listing was published in Popular Computing Weekly, volume 1, No. 8 (10th June 1982).</p>\r\n<p>The listing contained many errors.</p>\r\n<p>A corrected listing was published in issue 13 on the 15th of July 1982. This worked on OS 0.1 machines but not OS 1.2 machines so has been tweaked slightly to make it work on OS 1.2</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-31 14:15:31', '2019-08-31 10:59:06', 2, '2019-08-31 11:17:19', 2, 'N', 'Y', '0'),
(3263, NULL, '', 'Transplex', '1987', 1, 'M', '<p>Published In the February 1987 issue of Computer &amp; Video Games. Issue 64, in the "Book Of Games 1987" supplement.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-31 14:19:49', '2019-08-31 10:59:19', 2, '2019-09-09 11:10:00', 2, 'N', 'Y', '0'),
(3264, NULL, '', 'Solitaire', '1983', 498, 'P', '<p>Published on 8BS on disc CJR-01</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-08-31 12:31:03', '2019-08-31 11:13:49', 2, '2019-08-31 11:16:10', 2, 'N', 'Y', '0'),
(3265, NULL, '', 'Dodge City', '1984', 2, 'M', '<p>Published In the July 1984 issue of Computer &amp; Video Games. Issue 33, in the ''Book of games'' supplement.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-02 21:00:14', '2019-09-02 20:23:22', 2, '2019-09-02 20:54:22', 2, 'N', 'Y', '0'),
(3266, NULL, '', 'Fishing (AKA Gone Fishin'')', '1983', 487, 'M', '<p>Published in Micro User Magazine vol.1 issue 8 in October 1983</p>', 1, 4, '', '', '', '', '', '', '', 2, '2019-12-04 00:28:31', '2019-09-02 20:23:36', 2, '2019-09-02 20:55:16', 2, 'N', 'Y', '0'),
(3267, NULL, '', 'Golf', '1984', 21, 'M', '<p>Published in Games Computing magazine, issue 5, May 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-02 21:11:45', '2019-09-02 20:23:50', 2, '2019-09-02 20:54:43', 2, 'Y', 'Y', '0'),
(3268, NULL, '', 'Astrosmash', '1982', 3, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 1, No. 29 (4th November 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-03 08:58:12', '2019-09-02 20:24:06', 2, '2019-09-03 09:52:25', 2, 'Y', 'Y', '0'),
(3269, NULL, '', 'Canyon', '1982', 455, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 1, No. 23 (23rd September 1982).</p>\r\n<p>The program was adapted from "Road Runner", a listing for the Sinclair ZX81 by Tim Hartnell that appeared in issue 1 of Popular Computing Weekly. It was converted for the BBC micro by Peter Cassidy.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-03 08:38:09', '2019-09-02 20:24:21', 2, '2019-09-03 09:52:41', 2, 'N', 'Y', '0'),
(3270, NULL, '', 'Fall Guy', '1983', 1, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News. The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>This is a game for two, in which each player directs a small figure down a</strong><br /><strong>vertical maze so that it can drop through a hole in the moving floor at the</strong><br /><strong>bottom. The figure is manoeuvred through the maze by directing markers</strong><br /><strong>up and down the outer walls and shifting horizontal sections of the maze</strong><br /><strong>to the left or right, allowing the figures to drop through to lower levels.</strong><br /><strong>The trick is to alter the internal pattern of the maze in order to move your</strong><br /><strong>own figure without at the same time opening up advantages for the</strong><br /><strong>opposition.</strong></p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-09-03 09:03:33', '2019-09-02 20:24:40', 2, '2019-09-03 09:53:03', 2, 'N', 'Y', '0'),
(3271, NULL, '', 'Go-Moku', '1983', 533, 'B', '<p>Published on the <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=best+of+PCW+software&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=a">Best of PCW software for the BBC Micro</a> compilation from Personal Computer World magazine.</p>\r\n<p>These compilation cassettes were published by Century Communications Ltd.</p>\r\n<p>The book contained the following description:</p>\r\n<p style="padding-left: 90px;"><strong>This is a straight-forward yet intriguing game played on an 11 by</strong><br /><strong>11 colour grid, in which the player pits his wits against the</strong><br /><strong>computer.</strong><br /><strong>&nbsp;&nbsp; The object of the game is to place five counters in a straight row,</strong><br /><strong>either horizontally, vertically or diagonally, before your opponent</strong><br /><strong>(the computer) does so. This requires careful thinking ahead,</strong><br /><strong>taking into account blocking moves as well as potential winning</strong><br /><strong>moves, making both defensive and offensive games possible.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-03 09:19:43', '2019-09-02 20:24:54', 2, '2019-09-03 09:53:37', 2, 'N', 'Y', '0'),
(3272, NULL, '', 'Moonguard 3D (AKA Moon Guard)', '1983', 454, 'M', '<p>Keyboard controls: the seven guns, from bottom to top, can be fired with the number-keys 1, 2, 3, 4, 5, 6, and 7.&nbsp;</p>\r\n<p>Published in the October 1983 issue of Computer &amp; Video Games (issue 24).</p>\r\n<p>A pair of red/blue 3D glasses is required to see the 3D effect!</p>\r\n<p>The listing was part of an article on early 3D games and was written by Mike Singleton, the author of 3Deep Space by Postern Software, the advert for which had the strapline "The world''s first true 3D game".</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-10 21:23:41', '2019-09-02 20:25:10', 2, '2019-09-03 09:53:57', 2, 'N', 'Y', '0'),
(3273, NULL, '', 'Nim', '1983', 21, 'M', '<p>Published in Micro User Magazine vol.1 issue 2 in April 1983</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-03 09:43:50', '2019-09-02 20:25:23', 2, '2019-09-03 09:54:12', 2, 'N', 'Y', '0'),
(3274, NULL, '', 'Soccer Manager', '1987', 472, 'M', '<p>Published in Micro User Magazine vol.5 issue 7 in September 1987</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2019-09-03 08:54:16', '2019-09-02 20:25:46', 2, '2019-09-09 11:10:36', 2, 'N', 'Y', '0'),
(3275, NULL, '', 'Spyplane (AKA Spy Plane)', '1982', 2, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 1, No. 26 (14th October 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-03 09:50:32', '2019-09-02 20:26:00', 2, '2019-09-03 09:54:56', 2, 'N', 'Y', '0'),
(3276, NULL, '', 'Tangle', '1983', 1, 'M', '<p>Published in the February 1983 issue of Practical Computing magazine (volume 6, issue 2).</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-09-03 09:46:44', '2019-09-02 20:26:21', 2, '2019-11-22 14:10:32', 2, 'N', 'Y', '0'),
(3277, NULL, '', 'Yahtzee (AKA Poker Dice)', '1982', 34, 'R', '<p>This game was later renamed to Poker Dice by Micro Power. Presumably for copyright reasons.</p>', 1, 6, '', '', '', '', '', '', '', 2, '2019-09-02 20:51:40', '2019-09-02 20:26:43', 2, '2019-09-02 20:49:27', 2, 'N', 'Y', '0'),
(3278, NULL, '', '3-D Maze (AKA 3D Maze) (AKA Lodestar)', '1984', 1, 'B', '<p>Published in the book The Giant Book Of Games For Your BBC Micro from Fontana Publishing.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>You have to find your way around a maze, searching for the</strong><br /><strong>precious Lodestar. Throughout the game you see the view</strong><br /><strong>ahead. You are told which doors are open ahead, to the left and</strong><br /><strong>to the right. As well, you are able to read the output of the</strong><br /><strong>''Lodestar indicator'' which gives you a clue as to how close you</strong><br /><strong>are to the goal.</strong><br /><strong>If you find you are lost in the maze, you can use the ''H'' (for</strong><br /><strong>''help'') option. When you press the ''H'' key, you''ll see a view</strong><br /><strong>showing where you are in the maze and indicating with square</strong><br /><strong>''dots'' the path you have travelled so far.</strong><br /><strong>The Lodestar can be in one of a number of positions, and</strong><br /><strong>the maze changes to some extent from game to game, so you</strong><br /><strong>will take a long time to master the program. Start off slowly</strong><br /><strong>with this game, until you''re familiar with the representation of</strong><br /><strong>the ''view'', and you''ll be pleased to discover how good you''ll get</strong><br /><strong>at making your way around the maze. You move through the</strong><br /><strong>maze using the cursor keys.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-04 09:00:46', '2019-09-04 08:42:17', 2, '2019-09-04 08:59:52', 2, 'N', 'Y', '0'),
(3279, NULL, '', 'Moon Lander', '1982', 569, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 1, No. 24 (30th September 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-04 09:12:05', '2019-09-04 08:42:36', 2, '2019-09-09 11:11:33', 2, 'Y', 'Y', '0'),
(3280, NULL, '', 'North Sea Oil', '1985', 496, 'M', '<p>Published on the Electron Computing issue 1 cassette in June/July 1985.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2019-09-04 09:15:40', '2019-09-04 08:42:55', 2, '2019-09-04 09:12:33', 2, 'N', 'Y', '0'),
(3281, NULL, '', 'Tron (AKA Light Cycles)', '1983', 1, 'M', '<p>Published in issue 20 of Home Computing Weekly in July 1983.</p>\r\n<p>This game may not be playable without a joystick. Jsbeeb does not currently emulate a joystick so it might not be possible to play this game on the website. Try using an emulator or a real BBC.</p>', 2, 2, 'R', '', '', '', '', '', '', 2, '2019-09-04 08:51:08', '2019-09-04 08:43:20', 2, '2019-09-09 11:11:01', 2, 'N', 'Y', '0'),
(3282, NULL, '', 'Get That Bird', '1984', 47, 'B', '<p>Published in the book <em>BBC Micro Programs in Basic</em> from <em>Newnes Technical Books</em>, which contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>If your kids are like the one that has the contract to hike mud into</strong><br /><strong>our house, they will love a certain cartoon character that travels at a</strong><br /><strong>great rate of knots along a road, always eluding the foxy type who is</strong><br /><strong>trying to catch him. In this computer game, they are trying to catch</strong><br /><strong>the bird. We suppose that a charge of dynamite has been placed in</strong><br /><strong>the road and as soon as the bird appears, the player has to slap any</strong><br /><strong>key to detonate the charge. The problem is of course that the bird</strong><br /><strong>travels very fast indeed. Actually, I have included skill levels from 0</strong><br /><strong>to 9, and although anyone can win at the lowest level, quite frankly,</strong><br /><strong>I think that level 9 is completely impossible - which is to admit that I</strong><br /><strong>at least have never won at that level!</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-04 09:06:08', '2019-09-04 08:43:44', 2, '2019-09-04 09:01:47', 2, 'N', 'Y', '0'),
(3283, NULL, '', 'Idiot''s Delight Patience', '1991', 38, 'P', '<p>This card game was published on various public domain discs:</p>\r\n<p>EUG43/44 (using a Mode 6 instructions screen rather than Mode 7).</p>\r\n<p>HPD-00 from HeadFirst PD.</p>\r\n<p>HPD-10 from HeadFirst PD in 1993.</p>\r\n<p>TBI-144 (sometime after 1999).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-07 09:15:08', '2019-09-07 09:13:22', 2, '2019-09-07 09:15:56', 2, 'N', 'Y', '0'),
(3284, NULL, '', 'Salvage (AKA Asteroids)', '1982', 20, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 1, No. 33 (2nd December 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-07 09:20:32', '2019-09-07 09:19:53', 2, '2019-09-07 09:21:11', 2, 'N', 'Y', '0'),
(3285, NULL, '', 'Word Square', '1984', 344, 'B', '<p>Published in the book "BBC micro programs in BASIC" from Newnes technical books. The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>Another firm favourite with the children! In fact, the one in our</strong><br /><strong>house used to buy whole books of these problems every week until I</strong><br /><strong>wrote this program.</strong><br /><strong>You can either enter your own choice of words for the kids to</strong><br /><strong>find, or they can have the computer choose words from a series of</strong><br /><strong>DATA statements - see lines 990 to 1070. You could put your own</strong><br /><strong>words in here, but memory space is rather tight and you cannot</strong><br /><strong>extend the number of words very much before getting a ''No room''</strong><br /><strong>message at run time. This is because of the graphics mode used, and</strong><br /><strong>a useful alteration - if you have a printer - would be to have the</strong><br /><strong>puzzle printed out on paper rather than on the screen, which would</strong><br /><strong>result in an enormous saving of memory.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-07 09:36:46', '2019-09-07 09:32:06', 2, '2019-09-07 09:32:51', 2, 'N', 'Y', '0'),
(3286, 429, '', 'Stryker''s Run [Enhanced Version]', '1986', 22, 'R', '<p>This release included the original game plus an enhanced version for the Master 128 computer.</p>', 1, 1, '', '', '', '', '', 'Stryker''s Run', '1', 2, '2019-09-10 21:03:36', '2019-09-09 11:26:34', 2, '2019-09-09 11:33:13', 2, 'N', 'Y', 'Y'),
(3287, NULL, '', '36 Challenging Games for the BBC Micro [Part 1]', '1983', 599, 'B', '<p>Published in the book ''36 Challenging Games for the BBC Micro'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following note about Hi-Scores:</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT"><strong>In some of the programs in this book, the integer-variable H%</strong><br /><strong>is used to store the hi-score for a particular game because it is</strong><br /><strong>not altered by RUN. Because of this you must type in</strong><br /><br /><strong>H%=0</strong><br /><br /><strong>before running a game for the first time so that you do not have</strong><br /><strong>the hi-score from the previous game interfering.</strong><br /><strong>In some games, the ''highest score'' is actually the lowest score,</strong><br /><strong>for example in games where you have to do things as quickly as</strong><br /><strong>possible. Before playing games of this sort, please enter</strong><br /><br /><strong>H%=9999</strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Attributions:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Tim D. Rogers:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">18th Hole, 3D Invaders, Aspirin, Balloons, ''Copter, Guess</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Chris Callender:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Animate, Battlefield, Big Business, Breakout, The Clever Computer, Dodge, Downhill Skiing, Fruit Machine, Gold Mine, Hop It!</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Grant Evans:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Defender, DR 2000.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Please note that some of the games need alterations (which are noted in the book) to make them work on a BBC Micro Model A.</p>', 1, 1, 'O', '', '', '', '', '', '', 2, '2019-09-15 01:16:52', '2019-09-14 10:39:54', 2, '2019-09-14 10:59:24', 2, 'Y', 'Y', '0'),
(3288, NULL, '', 'Towering Inferno', '1984', 13, 'M', '<p>Published in Games Computing magazine, issue 12, December 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-16 20:34:19', '2019-09-16 20:33:41', 2, '2019-09-16 20:35:18', 2, 'N', 'Y', '0'),
(3289, NULL, '', '36 Challenging Games for the BBC Micro [Part 2]', '1983', 599, 'B', '<p>Published in the book ''36 Challenging Games for the BBC Micro'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">The book contains the following note about Hi-Scores:</p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT"><strong>In some of the programs in this book, the integer-variable H%</strong><br /><strong>is used to store the hi-score for a particular game because it is</strong><br /><strong>not altered by RUN. Because of this you must type in</strong><br /><br /><strong>H%=0</strong><br /><br /><strong>before running a game for the first time so that you do not have</strong><br /><strong>the hi-score from the previous game interfering.</strong><br /><strong>In some games, the ''highest score'' is actually the lowest score,</strong><br /><strong>for example in games where you have to do things as quickly as</strong><br /><strong>possible. Before playing games of this sort, please enter</strong><br /><br /><strong>H%=9999</strong></p>\r\n<p class="western" style="margin-bottom: 0cm; padding-left: 90px;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Attributions:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Tim D. Rogers:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Lander, Nightfall, Poem, Portals, Shock, Slaves, Smash Chamber, The Well, Yahm</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Chris Callender:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Morse Test, Parachute, Pilot, Shark, Synthesiser, Target, Ups ''n'' Downs</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT"><strong>Grant Evans:</strong></p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Invaders, Rat Attack</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">&nbsp;</p>\r\n<p class="western" style="margin-bottom: 0cm;" align="LEFT">Please note that some of the games need alterations (which are noted in the book) to make them work on a BBC Micro Model A.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-19 21:31:05', '2019-09-19 21:19:05', 2, '2019-09-24 22:05:17', 2, 'Y', 'Y', '0'),
(3290, NULL, '', 'Knight Orc picture disc', '1987', 13, 'R', '<p>To play the game online, see the main entry for <a href="game.php?id=3291">Knight Orc</a>.</p>\r\n<p>This disc contains only the pictures for the game and can''t be played by itself.</p>', 1, 1, '', 'D', 'BBC Micro with 16K Sideways RAM for text only. BBC Master for full graphics.', '', '', '', '', 3, '2019-09-27 00:54:02', '2019-09-25 12:08:02', 2, '2019-09-25 12:13:13', 2, 'N', 'Y', 'Y'),
(3291, NULL, '', 'Knight Orc', '1987', 13, 'R', '<p>It is not clear whether Knight Orc was ever officially released for either the BBC Micro or the BBC Master.&nbsp;The version seen here was recovered from a "play test" disc discovered at the Centre for Computing History. See Stardot for&nbsp;<a href="https://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=17952#p248986">more details</a>.</p>\r\n<p>The game will run in text-only mode on a BBC Micro with at least 16K of&nbsp;<a href="https://en.wikipedia.org/wiki/Sideways_address_space#Sideways_RAM">Sideways RAM</a>, but the ideal platform for the game is a BBC Master, which will display the pictures.</p>\r\n<p>See also the <a href="game.php?id=3290">Knight Orc picture disc</a>.</p>', 1, 1, '', 'D', 'BBC Micro with 16K Sideways RAM for text only. BBC Master for full graphics.', '', '', '', '', 3, '2019-09-27 01:02:12', '2019-09-25 12:10:11', 2, '2019-09-25 12:49:25', 3, 'N', 'Y', 'Y'),
(3292, NULL, '', 'Connect 4', '1983', 34, 'R', '', 1, 2, '', '', '', '', '', '', '', 2, '2019-09-26 21:44:43', '2019-09-26 20:14:52', 2, '2019-09-26 21:46:05', 2, 'N', 'Y', '0'),
