(3294, NULL, '', 'Shock', '1983', 454, 'B', '<p>Published in the book ''<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-07 12:51:50', '2019-09-26 20:15:31', 2, '2019-09-26 21:45:17', 2, 'N', 'Y', '0'),
(3295, NULL, '', 'Tank Battle', '1983', 2, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 5 (3rd February 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-26 21:39:51', '2019-09-26 20:15:45', 2, '2019-09-26 21:45:39', 2, 'N', 'Y', '0'),
(3296, NULL, '', 'Tennis', '1983', 18, 'B', '<p>This listing was published in the book "100 Programs for the BBC Microcomputer" by Prentice Hall international in association with Acornsoft.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 120px;"><strong>This is an adaption of an old video game. We have two players playing tennis on a green pitch.</strong></p>\r\n<p style="padding-left: 120px;"><br /><strong>Player 1 uses keys Z and X to move his bat up and down.</strong><br /><strong>Player 2 uses keys . and / to move his bat up and down.</strong></p>\r\n<p style="padding-left: 120px;"><br /><strong>The score is displayed at the top of the screen. There are a total of fifty balls available in the game, rather more than in the old video games.</strong><br /><strong>This is an interesting program in that no graphics are used. The movements are accomplished by print statements.</strong><br /><strong>Try using *FX11 and *FX12 commands to improve the program.</strong></p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-11-13 12:16:10', '2019-09-28 12:39:30', 2, '2019-09-30 09:05:52', 2, 'Y', 'Y', '0'),
(3297, NULL, '', 'Nightfall', '1983', 2, 'B', '<p>Published in the book ''<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-07 12:51:26', '2019-09-28 12:39:55', 2, '2019-09-28 12:55:37', 2, 'N', 'Y', '0'),
(3298, NULL, '', 'Balloonist', '1984', 569, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 1 (5th January 1984).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-09-28 12:44:57', '2019-09-28 12:40:23', 2, '2019-09-28 12:55:19', 2, 'N', 'Y', '0'),
(3299, 308, '', 'Video Pinball (AKA Arcade Pinball)', '1988', 463, 'R', '<p>This game had previously been released by Microbyte Software as Arcade Pinball.&nbsp;<span style="color: #333333; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif;">This version gives the option to choose whether you are playing on a BBC Micro or an Electron.</span></p>', 1, 4, '', '', '', '', '', '', '', 2, '2019-10-06 20:14:43', '2019-10-06 10:02:20', 2, '2019-10-06 10:05:24', 2, 'N', 'Y', '0'),
(3300, 2678, '', 'Wall Game [pre-release] (AKA Breakout)', '1982', 18, 'U', '<p>This is a pre-release version of the Breakout game that later appeared on the <a href="game.php?id=2302">Fun Games</a> and <a href="game.php?id=2678">Arcade Action</a> compilations from BBC Soft/Acornsoft.</p>\r\n<p>It has a "moving wall" feature that was removed from the released version.</p>\r\n<p>This version was typed in from screen-grabs from episode 1 of The Computer Programme, originally broadcast in 1982.</p>\r\n<p>More Info <a href="game.php?id=2302">here</a></p>', 1, 1, '', '', '', '', '0.2', '', '', 2, '2019-11-20 00:28:24', '2019-10-28 09:22:58', 2, '2019-11-19 14:04:54', 2, 'N', 'Y', '0'),
(3301, 392, '', 'Space Invaders [pre-release] (AKA Teletext Invaders)', '1982', 454, 'U', '<p>This is an early or alternate version of the Invaders program to that featured on the <a href="game.php?id=2678">Arcade Action</a> compilation from Acornsoft.</p>\r\n<p>This version featured on the ''Introducing Graphics'' episode of the TV show "Making The Most of The Micro".</p>\r\n<p>More info can be found <a href="https://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=18134&amp;p=251823&amp;hilit=early+version#p251823">here</a></p>', 1, 1, '', '', '', '', 'pre-release', '', '', 2, '2019-11-20 00:26:10', '2019-10-28 09:37:22', 2, '2019-12-07 11:26:21', 2, 'N', 'Y', '0'),
(3302, NULL, '', '3D Invaders', '1983', 454, 'B', '<p>Published in the book ''<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-07 12:50:26', '2019-11-09 17:40:51', 2, '2019-11-11 17:16:19', 2, 'N', 'Y', '0');
INSERT INTO `games` (`id`, `parent`, `title_article`, `title`, `year`, `genre`, `reltype`, `notes`, `players_min`, `players_max`, `joystick`, `save`, `hardware`, `electron`, `version`, `series`, `series_no`, `lastupdater`, `lastupdated`, `created`, `creator`, `imgupdated`, `imgupdater`, `compat_a`, `compat_b`, `compat_master`) VALUES
(3303, NULL, '', 'Barmy Butterflies', '1987', 4, 'M', '<p>Published on the June/July 1987 issue of Disk User. Issue 01.</p>', 1, 1, 'O', 'D', '', '', '', '', '', 2, '2019-11-11 16:44:37', '2019-11-09 17:41:31', 2, '2019-11-11 17:00:19', 2, 'N', 'Y', '0'),
(3304, NULL, '', 'Bombs', '1983', 454, 'B', '<p>This listing was published in the book "100 Programs for the BBC Microcomputer" by Prentice Hall international in association with Acornsoft.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 150px;"><span style="color: #333333; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13px; background-color: #ecf3f7;">In this program, the user has to defend his city against attacks from the sky.<br />The game is played purely in text, with many user defined characters. The city is built up in lines 230 to 360.<br />The user has control of a laser gun which can be used to knock out bombs which appear at random at the top of the screen.<br />To control the gun, we use the edit keys (hence the use of *FX4,1) to move horizontally and &lt;COPY&gt; to fire the gun.<br />The game finishes when the city is destroyed, which can take some time!<br /></span></p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-11-13 12:12:32', '2019-11-09 17:42:05', 2, '2019-11-11 17:08:11', 2, 'N', 'Y', '0'),
(3305, NULL, '', 'Cattapilla', '1984', 1, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 43 (25th October 1984).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-11-11 16:52:07', '2019-11-09 17:42:34', 2, '2019-11-11 17:01:06', 2, 'N', 'Y', '0'),
(3306, NULL, '', 'Galactic Tycoon', '1985', 21, 'M', '<p>Given away as a free extra game for people who purchased the Micro User Magazine tape vol.2 issue 11 in January 1985</p>', 2, 6, '', '', '', '', '', '', '', 2, '2019-11-11 16:39:13', '2019-11-09 17:43:21', 2, '2019-11-11 16:59:59', 2, 'N', 'Y', '0'),
(3307, NULL, '', 'Gunboat', '1990', 34, 'M', '<p>Published in Electron User magazine volume 7, issue 10 in July 1990.</p>', 2, 2, '', '', '', 'Y', '', '', '', 2, '2019-11-11 16:57:12', '2019-11-09 17:43:56', 2, '2019-11-11 17:03:19', 2, 'N', 'Y', '0'),
(3308, NULL, '', 'Smash Chamber', '1983', 1, 'B', '<p>Published in the book ''<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-07 12:50:58', '2019-11-09 17:44:32', 2, '2019-11-11 17:00:45', 2, 'N', 'Y', '0'),
(3309, NULL, '', 'Trapper', '1983', 1, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 2, No. 14 (7th April 1983).</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-11-11 17:13:01', '2019-11-09 17:45:07', 2, '2019-11-11 17:13:26', 2, 'N', 'Y', '0'),
(3310, 2302, '', 'Snake', '1982', 1, 'R', '<p>Snake is a clone of the 1976 arcade game&nbsp;<a href="https://www.youtube.com/watch?v=5v-0CwiabZA">Blockade</a> from Gremlin.</p>\r\n<p>Blockade is believed to have been the original ''Snake'' game, although the 1982 arcade game <a href="https://www.youtube.com/watch?v=YTFOwqZcEP4">Nibbler</a> from Rock-Ola, may be the first where the snake grows after eating food.</p>\r\n<p>This version can be found on the <a href="game.php?id=2302">Fun Games</a> compilation from BBC Soft, and is an early version of the <a href="game.php?id=69">Snake</a> game found on <a href="game.php?id=2678">Arcade Action</a> from Acornsoft.</p>', 1, 1, '', '', '', '', 'V4', '', '', 2, '2019-11-19 14:18:58', '2019-11-18 17:01:55', 2, '2019-11-19 14:06:47', 2, 'Y', 'Y', '0'),
(3311, NULL, '', 'Dodgems', '1982', 483, 'R', '<p>Dodgems is a clone of the 1979 arcade game&nbsp;<a href="https://www.youtube.com/watch?v=iYDrd9jE4WU">Head On</a> from Gremlin/Sega.</p>\r\n<p>This version can be found on the <a href="game.php?id=2302">Fun Games</a> compilation from BBC Soft, and is an early version of the <a href="game.php?id=331">Dodgems</a> game found on <a href="game.php?id=2678">Arcade Action</a> from Acornsoft.</p>', 1, 1, '', '', '', '', 'V1', '', '', 2, '2019-11-19 14:19:39', '2019-11-18 17:06:56', 2, '2019-11-19 14:07:21', 2, 'Y', 'Y', '0'),
(3312, 2302, '', 'Breakout', '1982', 18, 'R', '<p>Breakout is a clone of the 1976 arcade classic&nbsp;<a href="https://www.youtube.com/watch?v=AMUv8KvVt08">Breakout</a> from Atari.</p>\r\n<p>This version can be found on the <a href="game.php?id=2302">Fun Games</a> compilation from BBC Soft, and is an early version of the <a href="game.php?id=397">Breakout</a> game found on <a href="game.php?id=2678">Arcade Action</a> from Acornsoft.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-11-19 14:22:28', '2019-11-19 14:11:25', 2, '2019-11-19 14:11:51', 2, 'Y', 'Y', '0'),
(3313, NULL, '', 'Eastor', '2013', 1, 'P', '<p>Published in Drag ''n'' Drop DVD magazine in 2013.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-11-22 17:05:16', '2019-11-22 16:01:27', 2, '2019-11-22 16:02:02', 2, 'N', 'Y', '0'),
(3314, NULL, '', 'Core Wars (AKA Core War)', '1985', 656, 'M', '<p>Published in Your Computer magazine volume 5, issue 9, in September 1985.</p>\r\n<p>Core Wars is a BBC Micro implementation of&nbsp;<a href="https://en.wikipedia.org/wiki/Core_War">Core War</a>.</p>\r\n<p>See Also <a href="game.php?id=2720">RAM Wars</a> from Micro User magazine.</p>', 2, 2, '', '', '', '', '', '', '', 3, '2019-11-23 12:33:04', '2019-11-22 17:20:25', 2, '2019-11-23 12:16:13', 2, 'N', 'Y', '0'),
(3315, NULL, '', 'Jaws', '1984', 20, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 34 (23rd August 1984).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-11-22 17:48:35', '2019-11-22 17:36:39', 2, '2019-11-22 17:37:06', 2, 'N', 'Y', '0'),
(3316, NULL, '', '3D Maze', '1983', 1, 'B', '<p>From the book Games BBC Computers Play by Tim Hartnell, S.M. Gee, and Mike James. Published by Interface Publications.</p>\r\n<p>The introductory text reads:</p>\r\n<p style="padding-left: 60px;"><strong>In this program by Dave Kelsall, you are in a maze (whose dimensions you</strong><br /><strong>determine) trying to get through it to the exit. At every turn you see the scene in</strong><br /><strong>front of you, and you''ll find it quite uncanny how ''solid'' and ''real'' the maze can</strong><br /><strong>seem. If you''re in trouble, the ''help option'' will provide a bird''s-eye view of the</strong><br /><strong>maze.</strong><br /><strong>When you first run the program, you''ll be asked to enter the width of the maze</strong><br /><strong>first, then the height. You can enter any integer between two and 12 for the</strong><br /><strong>width, and between two and 10 for the height.</strong><br /><strong>The program length is awesome, but we assure you the effort of entering all of</strong><br /><strong>it will be amply repaid</strong>.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-11-24 19:02:51', '2019-11-24 18:57:45', 2, '2019-11-29 21:17:17', 2, 'N', 'Y', '0'),
(3317, NULL, '', 'Death Race 2000', '1983', 6, 'B', '<p>Published in the book ''<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, 'O', '', '', '', '', '', '', 2, '2019-12-07 13:15:19', '2019-11-24 19:05:03', 2, '2019-11-24 19:05:53', 2, 'N', 'Y', '0'),
(3318, NULL, '', 'Gobble', '1983', 1, 'B', '<p>This listing was published in the book "100 Programs for the BBC Microcomputer" by Prentice Hall international in association with Acornsoft.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 60px;"><strong>We have two beasties eating up a field of grass.</strong><br /><strong>This is a two-player game, with each player taking the part of one of the beasties.</strong><br /><strong>If a player leaves the field or attempts to eat a patch of grass which has already been eaten, he dies.</strong><br /><strong>Every time a piece is eaten points are scored.</strong></p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-11-24 19:16:30', '2019-11-24 19:09:34', 2, '2019-11-24 19:09:59', 2, 'N', 'Y', '0'),
(3319, NULL, '', 'Hexplode', '1983', 21, 'M', '<p>Published in the December 1983 issue of Personal Computer World magazine (PCW).</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-11-24 19:20:10', '2019-11-24 19:19:31', 2, '2019-11-24 19:20:39', 2, 'N', 'Y', '0'),
