(3322, 2622, '', 'BBC Defend (AKA Defender) (AKA Air Strike)', '1983', 473, 'M', '<p>Published In the July 1983 issue of Computer &amp; Video Games. Issue 21.</p>\r\n<p>The listing appeared in the "Games Extra" section under the title "Defender" although the listing named the game "BBC Defend".</p>\r\n<p>The listing appears to be buggy.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="game.php?id=2622">A slightly different&nbsp;version</a> of this game had been published in BBC Micro User Magazine vol.1 issue 3 in May 1983</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-02 23:23:55', '2019-12-05 18:11:53', 2, '2019-12-05 18:12:32', 2, 'N', 'Y', '0'),
