(3336, NULL, '', 'Space Match (AKA Space-Match)', '1983', 38, 'M', '<p>Published in the July/August 1983 issue of A&amp;B Computing.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-12-14 12:09:02', '2019-12-14 11:32:30', 2, '2019-12-14 12:05:48', 2, 'N', 'Y', '0'),
(3337, NULL, '', 'Saurus Island', '1983', 676, 'B', '<p>First published in the book "Computing for all the Family with a BBC Computer" published by Sigma Technical Press in 1983.</p>\r\n<p>Later published in issue 59 of Home Computing Weekly in April 1984.</p>\r\n<p>Both the book and the magazine re-print contained an accurate map of the island which made the game a little easier to navigate rather than having to map it from scratch!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-14 12:33:40', '2019-12-14 11:32:50', 2, '2019-12-14 11:48:01', 2, 'N', 'Y', '0'),
(3338, NULL, '', 'Jaws (AKA Beeb Jaws)', '1983', 2, 'M', '<p>The listing was published in Popular Computing Weekly, Vol. 2, No. 10 (10th March 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-14 11:44:29', '2019-12-14 11:33:09', 2, '2019-12-14 11:41:05', 2, 'Y', 'Y', '0'),
(3339, NULL, '', 'Horse Of The Year', '1985', 497, 'M', '<p>The listing was published in Popular Computing Weekly, volume 4, No. 18 (2nd May 1985).</p>', 2, 2, '', '', '', '', '', '', '', 2, '2019-12-14 11:38:37', '2019-12-14 11:33:30', 2, '2019-12-14 11:39:18', 2, 'N', 'Y', '0'),
(3340, NULL, 'The', 'Paragon', '1993', 4, 'M', '<p>Given away on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.11 special in late 1993.</p>\r\n<p>Two more levels were given away on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.11 no.12 in January 1994.</p>\r\n<p>The levels are named ORIGINS, TRICKY, and TWOPLAY.</p>', 1, 2, 'O', '', '', '', '', '', '', 2, '2019-12-27 11:49:12', '2019-12-27 10:51:57', 2, '2019-12-27 11:35:15', 2, 'N', 'Y', 'Y'),
(3341, NULL, '', 'Balloons', '1983', 20, 'B', '<p>Published in the book ''<a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>'' by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-27 11:00:58', '2019-12-27 10:52:15', 2, '2019-12-27 10:55:54', 2, 'N', 'Y', '0'),
(3342, NULL, '', 'Parachute (AKA Paras)', '1993', 10, 'P', '<p>Published on the 8BS Public Domain disc 26 in April 1993.</p>\r\n<p>Published on the HeadFirst Public Domain Disc 13.</p>\r\n<p>Also published on the July 1993 issue of the Acorn User subscriber''s disc.</p>\r\n<p>Also given away on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.11 issue 7 in September 1993.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-27 11:26:49', '2019-12-27 10:52:34', 2, '2019-12-27 11:29:00', 2, 'N', 'Y', '0'),
(3343, NULL, '', 'Vulcan', '1985', 569, 'M', '<p>The listing was published in Popular Computing Weekly, volume 4, No. 6 (7th February 1985).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-27 11:57:15', '2019-12-27 11:51:07', 2, '2019-12-27 11:58:27', 2, 'N', 'Y', '0'),
(3344, NULL, '', 'Hidden Numbers', '1984', 606, 'M', '<p>Published in issue 61 of Home Computing Weekly in May 1984.</p>', 1, 2, '', '', '', '', '', '', '', 2, '2019-12-30 13:07:33', '2019-12-30 12:47:32', 2, '2019-12-30 12:49:30', 2, 'N', 'Y', '0'),
(3345, NULL, '', 'Marble Mania', '1986', 1, 'M', '<p>The listing was published in Popular Computing Weekly over 2 issues: volume 5, No. 22 and volume 5, No. 23 (29th May 1986 and 5th June 1986).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-30 13:12:33', '2019-12-30 12:47:48', 2, '2019-12-30 12:50:10', 2, 'N', 'Y', '0'),
(3346, NULL, '', 'Sixty Six', '1994', 38, 'P', '<p>Published on 8BS Public Domain disc 35 in June 1994. *Only on the ADFS version of the disc*</p>\r\n<p>Also given away on the BBC Subscribers disc in Acorn Computing magazine (formerly The Micro User), volume 12, issue 9, in November 1994.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2020-01-09 10:10:11', '2019-12-30 12:48:03', 2, '2019-12-30 12:50:58', 2, 'N', 'Y', '0'),
(3347, NULL, '', 'Target', '1983', 454, 'B', '<p>Published in the book <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>&nbsp;by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2019-12-31 12:55:24', '2019-12-30 12:48:16', 2, '2019-12-30 12:51:38', 2, 'N', 'Y', '0'),
(3348, NULL, '', 'Tri-oids', '1982', 454, 'M', '<p>The listing was published in Popular Computing Weekly, volume 1, No. 21 (9th September 1982).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2019-12-30 13:23:58', '2019-12-30 12:48:36', 2, '2019-12-30 12:52:14', 2, 'N', 'Y', '0'),
(3349, NULL, '', 'Eggsman', '2019', 1, 'P', '<p>Written for the&nbsp;<a href="https://gkanold.wixsite.com/homeputerium/kopie-von-basic-10liners-2019">2019 BASIC 10-liner contest</a>.</p>\r\n<p><a href="https://stardot.org.uk/forums/viewtopic.php?f=57&amp;t=17223&amp;p=238591&amp;hilit=downfall#p238591">More details</a>&nbsp;at Stardot.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-03 09:57:16', '2020-01-03 09:46:50', 2, '2020-01-08 13:54:45', 2, 'N', 'Y', '0'),
(3350, NULL, '', 'Fruit Machine (AKA Jackpot)', '1992', 462, 'P', '<p>Published on the 8BS Public Domain disc 21 in September 1992.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-03 10:03:00', '2020-01-03 09:47:06', 2, '2020-01-03 09:48:47', 2, 'N', 'Y', '0'),
(3351, NULL, '', 'Pet Spiders', '1983', 17, 'M', '<p>Published in the November/December 1983 issue of A&amp;B Computing (volume 1, issue 4).</p>', 1, 1, '', '', '', '', '', '', '', 3, '2020-01-09 19:15:08', '2020-01-03 09:47:22', 2, '2020-01-03 16:36:35', 2, 'N', 'Y', '0'),
(3352, NULL, '', 'Space Blitz', '1983', 454, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 20 (19th May 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-03 10:11:41', '2020-01-03 09:47:35', 2, '2020-01-03 09:50:19', 2, 'N', 'Y', '0'),
(3353, NULL, '', 'Boa-Constructor', '1983', 1, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 7 (17th February 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-04 16:09:48', '2020-01-04 16:00:14', 2, '2020-01-04 16:00:57', 2, 'N', 'Y', '0'),
(3354, NULL, '', 'Meteors', '1984', 20, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 27 (5th July 1984).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-04 16:30:05', '2020-01-04 16:01:16', 2, '2020-01-04 16:01:53', 2, 'N', 'Y', '0'),
(3355, NULL, '', 'Pirate''s Gold', '1993', 31, 'M', '<p>Given away on the BBC Subscribers disc in Acorn Computing magazine (formerly The Micro User), volume 11, issue 1, in March 1993.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-04 16:38:02', '2020-01-04 16:03:06', 2, '2020-01-04 16:03:45', 2, 'N', 'Y', '0'),
(3356, NULL, '', 'Seafarer (AKA Trading Simulation)', '1992', 278, 'P', '<p>Published on the 8BS Public Domain disc 22 in October 1992.</p>', 1, 1, '', 'D', '', '', 'V2', '', '', 2, '2020-01-04 16:43:54', '2020-01-04 16:04:20', 2, '2020-01-04 16:04:59', 2, 'N', 'Y', '0'),
(3357, NULL, '', 'Zim', '1986', 17, 'M', '<p>Published in the May 1986 issue of A&amp;B Computing.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2020-01-04 16:47:24', '2020-01-04 16:05:11', 2, '2020-01-08 13:57:01', 2, 'N', 'Y', '0'),
(3358, NULL, '', 'Golf Game (+ Course Designer)', '1990', 465, 'M', '<p>Published in Micro User magazine, volume 7, issue 12, in February 1990.</p>\r\n<p>Extra courses were included on the subscribers'' disc for volume 8, issue 3 and volume 8, issue 4 in May and June 1990.</p>\r\n<p>These extra courses were ''compacted'' and not that easy to find!</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2020-01-20 10:43:07', '2020-01-04 17:22:21', 2, '2020-01-20 09:28:52', 2, 'N', 'Y', '0'),
(3359, 3358, '', 'Golf Game (Course 2)', '1990', 465, 'M', '<p>The original Golf Game and course designer was published in Micro User magazine, volume 7, issue 12, in February 1990.</p>\r\n<p>This is the first of 2 extra courses that were included on the subscribers'' disc for volume 8, issue 3 and volume 8, issue 4 in May and June 1990.</p>\r\n<p>These extra courses were ''compacted'' and not that easy to find!</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2020-02-01 11:51:25', '2020-01-09 16:57:13', 2, '2020-02-01 11:16:01', 2, 'N', 'Y', '0'),
(3360, NULL, '', 'Sudoku Solver', '2019', 677, 'P', '<p>Credited to Edwardian Duck: <a href="http://www.duckology.co.uk">www.duckology.co.uk</a><!--&nbsp;(<a href="http://web.archive.org/web/20020222122122/http://www.ducksoft.co.uk/">archived</a>)--></p>\r\n<p>A sudoku solver for the BBC Micro, ported from the author''s earlier 8-bit Atari version.</p>', 1, 1, '', 'D', '', '', 'V1.0', '', '', 3, '2020-01-15 20:20:20', '2020-01-10 15:50:13', 2, '2020-01-10 15:56:38', 2, 'N', 'Y', '0'),
(3361, NULL, '', 'Nellan Is Thirsty', '1980', 13, 'M', '<p>A child-friendly text adventure game written by Furman Smith, originally published as a type-in listing in the <a href="https://archive.org/details/1980-07-recreational-computing/page/n3">July-August issue</a> of Recreational Computing magazine in 1980.</p>\r\n<p><em>&nbsp;&nbsp;&nbsp;To the best of my knowledge, the article contained the first published Computer Fantasy Simulation (CFS) written expressly for children. As with any CFS, obstacles and unfavorable situations had to be overcome. Unlike many, the creatures were all friendly and there was no violence; thus, planning, problem solving, and inventiveness were encouraged in a non-threatening atmosphere.</em> &mdash;<a href="https://web.archive.org/web/20010429172609/http://sciences.aum.edu/~furman/RC_2CFS.htm">Furman&nbsp;Smith</a></p>\r\n<p>The game was written for the TRS-80 and for the "Heath" (whatever that is).</p>\r\n<p>Ported to BBC BASIC for the BBC Micro computer in 2020.</p>\r\n<p>More details at <a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=18536#p257305">Stardot</a>, at <a href="http://www.solutionarchive.com/game/id%2C735/Nellan+is+Thirsty.html">CASA</a>, at <a href="https://bluerenga.blog/2019/01/31/nellan-is-thirsty-1980/">Renga In Blue</a>, at <a href="https://ifdb.tads.org/viewgame?id=ata4hor6osh3c02">IFDB</a>, and at the <a href="https://archive.org/details/1980-07-recreational-computing/page/n3">Internet</a> <a href="https://archive.org/details/d64_Nellan_is_Thirsty_19xx_The_Guild_Adventure_Software">Archive</a>.</p>', 1, 1, '', '', '', '', '1.9', '', '', 3, '2020-01-25 13:02:34', '2020-01-12 13:22:10', 3, '2020-01-21 20:32:55', 3, 'N', 'Y', '0'),
(3362, NULL, '', 'Crack-Code', '1983', 17, 'M', '<p>Published in the May 1983 issue of Practical Computing magazine (volume 6, issue 5).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-20 10:06:56', '2020-01-20 09:35:15', 2, '2020-01-20 09:53:01', 2, 'N', 'Y', '0'),
(3363, NULL, '', 'Ambush (AKA Sniper Ambush)', '1983', 473, 'B', '<p>Published in the book Sixty Programs For The BBC Micro by Pan Books Ltd, in association with Personal Computer News.</p>\r\n<p>The book contains the following description:</p>\r\n<p style="padding-left: 90px;"><strong>High resolution graphics make this forest scene something worth seeing!</strong><br /><strong>You are trapped by snipers hiding amongst the trees. Your only shelter is</strong><br /><strong>a low wall. Can you kill all the snipers before one of them succeeds in</strong><br /><strong>shooting you.</strong></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-20 10:00:14', '2020-01-20 09:35:31', 2, '2020-01-20 09:52:43', 2, 'N', 'Y', '0'),
(3364, NULL, '', 'Eggdash', '1983', 10, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 2 (13th January 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-20 10:09:58', '2020-01-20 09:35:48', 2, '2020-01-20 12:10:03', 2, 'N', 'Y', '0'),
(3365, NULL, '', 'Snake Island', '1983', 1, 'M', '<p>The listing was published in Popular Computing Weekly, volume 2, No. 19 (12th May 1983).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-20 20:58:21', '2020-01-20 09:36:06', 2, '2020-01-20 09:53:40', 2, 'N', 'Y', '0'),
(3366, NULL, '', 'Tower Of Hanoy Patience (AKA Tower Of Hanoi Patience)', '1991', 38, 'P', '<p><strong>"Hanoy" was probably a mis-spelling on the part of the author. The Public Domain discs spell the word as "Hanoi" in the menu.</strong></p>\r\n<p>Published on the HeadFirst Public Domain Disc 0.</p>\r\n<p>Published on the HeadFirst Public Domain Disc 10.</p>\r\n<p>Later published on Electron User Group PD Disc 46 in November 1999.</p>\r\n<p>Later published on the Public Domain disc TBI-144 (sometime after 1999).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-20 10:27:39', '2020-01-20 09:36:27', 2, '2020-01-20 09:53:57', 2, 'N', 'Y', '0'),
(3367, NULL, '', 'Wormy Num Num', '1990', 1, 'M', '<p>Published in Micro User magazine, volume 8, issue 2, in April 1990</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-20 10:32:50', '2020-01-20 09:36:43', 2, '2020-01-20 09:54:20', 2, 'N', 'Y', '0'),
(3368, NULL, '', 'Chroma', '2020', 17, 'P', '<p>A new puzzle game from <a href="http://level7.org.uk/chroma/">level7.org.uk</a>.</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2020-01-31 13:42:28', '2020-01-30 20:22:13', 2, '2020-01-31 09:34:47', 2, 'N', 'Y', '0'),
(3369, NULL, '', 'Hastings 1066 (AKA 1066 War Game) (AKA 1066 Wargame)', '1986', 21, 'M', '<p>Published in the February 1986 issue of A&amp;B Computing.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-31 09:49:10', '2020-01-31 09:35:43', 2, '2020-01-31 09:38:51', 2, 'N', 'Y', '0'),
(3370, NULL, '', 'Breakout', '1983', 18, 'B', '<p>Published in the book <a href="index.php?rt_R=&amp;rt_B=&amp;rt_M=&amp;rt_P=&amp;rt_U=&amp;rt_W=&amp;rt_L=&amp;search=36+Challenging+Games+for+the+BBC+Micro+%5BPart&amp;on_T=on&amp;on_Y=on&amp;on_P=on&amp;on_A=on&amp;on_G=on&amp;on_S=on&amp;on_Z=on&amp;on_C=on&amp;sort=u">36 Challenging Games for the BBC Micro</a>&nbsp;by Tim D. Rogers and Chris Callender, published by Interface Publications.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-31 09:53:44', '2020-01-31 09:35:56', 2, '2020-01-31 09:39:12', 2, 'N', 'Y', '0'),
(3371, NULL, '', 'Dice Game', '1984', 34, 'R', '<p>This game appeared on the TV series "Making The Most Of The Micro" which was broadcast on BBC2 in January 1983.</p>\r\n<p>The dice game was released as part of a compilation cassette of the same name, which was released in 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-31 11:22:35', '2020-01-31 09:36:11', 2, '2020-01-31 16:27:53', 2, 'N', 'Y', '0'),
(3372, NULL, '', 'Little Meanies', '1984', 454, 'M', '<p>The listing was published in Popular Computing Weekly, volume 3, No. 20 (17th May 1984).</p>', 1, 1, '', '', '', '', '', '', '', 2, '2020-01-31 09:57:58', '2020-01-31 09:36:32', 2, '2020-01-31 09:39:45', 2, 'N', 'Y', '0'),
